INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1179021, 'Ludwig van Beethoven', 'Given a hearing aid, Beethoven hears some of his most famous compositions for the first time.', 66033, 1, 1179021, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843023, 'Ernest Hemingway', 'Dan attempts to bond with Hemingway over their common interests in drinking and writing, but is intimidated by his masculinity.', 66033, 2, 1843023, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843024, 'Thomas Edison', 'Unsatisfied with the quality of his phonograph recording, Edison insists on recording a new version in a modern studio.', 66033, 3, 1843024, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843025, 'Mary Wollstonecraft', 'Mary''s arrival gives Dan a chance to express his feminism, but he is irritated by Mary''s stern demeanor. Meanwhile, it is Spencer''s birthday.', 66033, 4, 1843025, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843026, 'William Shakespeare', 'Shakespeare is unimpressed by Community, preferring the bawdy comedy film Dirty Grandpa.', 66033, 5, 1843026, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843027, 'Idi Amin', 'Amin''s arrival fulfills Dan''s desire for ethnic diversity, until he takes the office hostage.', 66033, 6, 1843027, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843028, 'Betsy Ross', 'Betsy''s racism discomforts Dan until they broach the subject of Bernie Sanders.', 66033, 7, 1843028, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843029, 'Amelia Earhart', 'Amelia is disappointed with her legacy of getting lost, and sets out to prove that she is indeed still alive.', 66033, 8, 1843029, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843030, 'Sigmund Freud', 'Freud arrives just in time, as Spencer refuses to use catchphrases written for him by Dan.', 66033, 9, 1843030, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843031, 'Edgar Allan Poe', 'Poe undermines Dan''s need to impress a History Channel executive, who falls for Poe. Dan and Spencer attempt to influence their date to secure an additional run of episodes.', 66033, 10, 1843031, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843033, 'Buddha', 'The Buddha participates in a series of product placements, making Dan feel guilty.', 66033, 11, 1843033, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843034, 'John Wilkes Booth', 'Booth emphasizes his skills as an actor rather than his notoriety as the assassin of Abraham Lincoln.', 66033, 12, 1843034, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843035, 'Ada Lovelace', 'After they bond over their shared love of coding, Ada convinces Spencer to convert his body to code and join her in virtual reality.', 66033, 13, 1843035, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843036, 'John F. Kennedy', 'Kennedy is accidentally transported along with a spider, creating an additional half-Kennedy-half-spider being which cocoons the crew.', 66033, 14, 1843036, 75679, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1843038, 'Harry S. Truman', 'Dan takes Truman to a gay bar to teach him about gay rights and desperately pander to LGBT critics.', 66033, 15, 1843038, 75679, null);
