INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182786, 'Episode #1.1', 'Yamase Kazuko is a 23-year-old part-time worker who recently got cheated and dumped by her boyfriend and also just lost her job—basically she feels she has reached the rock bottom in life. One day, she walks by a store and finds a teddy bear she fell in love with at first sight. She immediately buys and happily returns home with the teddy bear. The next morning, as she wakes up, what she saw in the mirror was a reflection of herself cuddling with … an tough-looking, middle-aged man! However apparently, no one can see him but Kazuko. He is actually the spirit of a man named Amano Yasuo, a detective who lost his life in the line of duty, hosted within the body of a teddy bear. With exchange conditions, the appealingly odd pair a job-less young female and middle-aged detective decide to work together to uncover the truth behind that criminal case that Amano pursued while he was alive.', 66079, 1, 1182786, 75932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182812, 'Episode #1.2', '', 66079, 2, 1182812, 75932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182813, 'Episode #1.3', '', 66079, 3, 1182813, 75932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182814, 'Episode #1.4', '', 66079, 4, 1182814, 75932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182854, 'Dorothy Finds a Friend', 'Dorothy meets a scarecrow, who joins her on the search for the Great Wizard to get him granted a brain, because his head is just full of straws. Together, they decide to continue over the yellow brick road, heading to Emerald City.', 66081, 1, 1182854, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182856, 'Dorothy Finds a Friend', 'Dorothy and the scarecrow find a man made of tin and he wants to join them to find the wizard - he is in hopes of finding a heart. as they journey they wind up in a forrest -- here they encounter a Cowardly Lion -- he wants Courage so he joins the little party.', 66081, 2, 1182856, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182857, 'Adventures Along the Yellow Brick Road', 'Dorothy and the scarecrow find a man made of tin and he wants to join them to find the wizard - he is in hopes of finding a heart. as they journey they wind up in a forrest -- here they encounter a Cowardly Lion -- he wants Courage so he joins the little party.', 66081, 3, 1182857, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182858, 'The Journey to Emerald City', 'The group of friends discover that to follow the yellow road, they need to cross a river. The tin man thinks that building a raft to go over it should be a good idea. When they start to cross, the scarecrow gets trapped in the middle of the river. To rescue him, the group tries to convince a little bird to get her aid.', 66081, 4, 1182858, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182859, 'Saved By The Mouse Queen', 'The friends travel through a poppy field and Dorothy, the Lion and Toto fall fast asleep -- the Tin Man must call upon the Queen of the Mice and her Legions to help them.', 66081, 5, 1182859, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182860, 'The Emerald City, At Last', 'They Reach the Emerald City at last and meet the Wizard. The Wizard will only help them if they bring him the Wicked Witch of the West''s broom. They agree.', 66081, 6, 1182860, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182861, 'Wizard Wants A Favour', 'Scarecrow, Tin Man and Lion meet the Wizard, and they too are told their wishes will be granted as soon as they destroy the Wicked Witch of the West.', 66081, 7, 1182861, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182862, 'The Wicked Witch of the West', 'Well, the Witch isn''t so easy to steal from and she captures the friends. She knows that as long as Dorothy is wearing her sister''s Silver Shoes she is protected -- the Witch wants the shoes! She realizes she must be patient. She makes them all work for her as her personal slaves.', 66081, 8, 1182862, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378261, 'Vykopávky', '', 66179, 7, 1378261, 93840, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378262, 'Karavan', '', 66179, 8, 1378262, 93840, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182863, 'Dorothy''s Magic Powers', 'The Witch is getting impatient -- she decides to take Dorothy''s shoes from her -- when she goes to do this Toto attacks her -- the Witch tries to hit him -- Dorothy sees it happen and she fights back -- she hurls a bucket of water at the Witch ( well the Witch can''t touch water) and promptly melts therefore freeing all of her slaves (the Quadling People).', 66081, 9, 1182863, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182864, 'Freedom from the Witch', 'With the Witch dead the Quadling people are free and take Dorothy to meet Glinda, the Good Witch of the South. Glinda helps Dorothy to return home. The Wizard, originally from Omaha, is also sent back to Dorothy''s world.', 66081, 10, 1182864, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182865, 'Mombi, Tip and the Golden Cap', 'Mombi the Witch treats her young charge Tip , a boy with no family, very badly. So he retaliates by creating a scarecrow with a pumpkin''s head on it to scare her.', 66081, 11, 1182865, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182867, 'Back to Emerald City', 'The Wizard is told that he must find Ozma, the little daughter of the former King of Oz, who mysteriously vanished. He must travel to see Glinda.', 66081, 12, 1182867, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182868, 'The Wizard''s Disappointing Secret', 'It turns out that the Wizard turned the Princess Ozma, the rightful ruler of Oz, over to Mombi to hide. Mombi in turn transformed Ozma into a boy named Tip!', 66081, 13, 1182868, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182869, 'The Wizard Tries to Help', 'The Wizard fulfils his promise and grants Scarecrow a brain, Tin Man a heart, and Lion courage.', 66081, 14, 1182869, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182870, 'Journey to the South', 'Dorothy, Lion, Scarecrow and Tin Man set out from the Emerald City in search of Glinda.', 66081, 15, 1182870, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182871, 'Glinda, the Good Witch', 'The Princess of the Crystal Kingdom saves Dorothy and her friends from the Crystal Cannon and points them in the right direction.', 66081, 16, 1182871, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182872, 'Home Sweet Home Again', 'Mombi brings Tip''s scarecrow to life with a magical powder. She tells Tip she has no use for him and locks him up. Jack Pumpkinhead, Tip''s former scarecrow prank, helps him escape, and they go to the Emerald City.', 66081, 17, 1182872, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182873, 'Dorothy Meets the Wizard, Again', 'Glinda transports Dorothy back to Oz. She asks her to join the wizard in the search for Ozma.', 66081, 18, 1182873, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182874, 'Back to Oz', 'Dorothy and the Wizard head toward the Emerald City after finding out from Glinda''s book that, not only is Ozma Tip, but that there is also an army of girls headed for the Emerald City.', 66081, 19, 1182874, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182875, 'The Escape from Mombi', 'Back in Oz, while stranded Dorothy stays with Mombi. Mombi agree''s to let Dorothy stay with her in an attempt to steal the magic she thinks Dorothy possesses.', 66081, 20, 1182875, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182876, 'General Jinjur Attacks', 'General Ginger attacks the Emerald City and holds Scarecrow,Tinman, Dorothy and the Wizard hostage within the walls of the palace.', 66081, 21, 1182876, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182877, 'Escape from the Emerald City', 'The friends build a flying machine with a gumps head prow on which they sprinkle Powder of Life. They escape by fly out of the Palace tower window.', 66081, 22, 1182877, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182878, 'Tinman to the Rescue', 'Dorothy, Pumpkin Head, Tip and Scarecrow head to find Tin Man in the land of the west to help them take back Emerald City from Jinjur and her evil minions.', 66081, 23, 1182878, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182879, 'Mombi''s Terrible Magic', 'Mombi heads for the Emerald City to try to stop the runaway Tip. Upon arrival, she joins up with General Jinjur.', 66081, 24, 1182879, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182880, 'Trapped in the Palace', 'After their escape from the tree, Dorothy and the gang head back to the Emerald City to stop General Jinjur. Mombi thwarts them and they end up trapped again back in the Palace.', 66081, 25, 1182880, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182881, 'The Magical Escape', 'Glinda reads about the goings on in her book. She sends a magic carpet for the group that returns them to Glinda''s Castle.', 66081, 26, 1182881, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182882, 'Glinda Agrees to Help', 'Glinda it told about Mombi''s treachery and decides it is time to get involved.', 66081, 27, 1182882, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182883, 'The Emerald City, Captured', 'General Jinjur finally storms the palace and seizes it, just in time to face Glinda.', 66081, 28, 1182883, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182884, 'Mombi''s Attempt to Trick Glinda', 'Glinda asks Jinjur to leave and demands cooperation from Mombi. Mombi and Jinjur fool everyone with imposters.', 66081, 29, 1182884, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182885, 'Ozma, Princess of Oz', 'Glinda removes the enchantment on Tip. He transforms back to his rightful form, the Princess Ozma of Oz.Ozma returns Dorothy to Kansas.', 66081, 30, 1182885, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182886, 'Tik-Tok the Mechanical Man', 'Dorothy is on her Kansas farm. She looks up in the sky and sees a magical light. The next day outside she finds a key with the letters "O" and "Z". Upon examination, the key transports her to Ev, a magical land across the Deadly Desert from Oz. She is then chased by a group called Wheelers up a mountain. She finds a door at the top of the mountain. The door is unlocked with the key. Inside, she finds a mechanical man named Tik-Tok.', 66081, 31, 1182886, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182887, 'The Kidnapped Prince', 'When she gets to the castle in Ev, Wheelers are still nipping at her heels, Dorothy learns that the Gnome King has Kidnapped the entire Royal Family of Ev.', 66081, 32, 1182887, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182888, 'The Deadly Desert', 'Ozma is already aware that Ev is in trouble. She crosses the Deadly Desert by magic carpet, her and her entire court in tow. They are all surprised to find Dorothy. The friends have a joyful reunion. They set out for the Gnome King''s underground palace.', 66081, 33, 1182888, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182889, 'The Talking Hen', 'Dorothy discovers with her a talking hen, Billina. She traveled with Dorothy from Kansas.', 66081, 34, 1182889, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182890, 'Monsters of Stone', 'On their journey to Noland, the frustrated yet determined group passes by a mysterious rock.', 66081, 35, 1182890, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182893, 'The Underground Country of Gnomes', 'They reach the Palace of the Nomes and get an audience with the Nome King.', 66081, 36, 1182893, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182894, 'The Deadly Guessing Game', 'The Nome King is prepared to release the Royal Family of Ev if the group play a dangerous game. His magic belt transformed the Royal Family into ornaments in the Ornament Room. The group each only have three guesses to identify which ornament is a Royal. Only a correct guess transforms them back! The friends agree its lucky Bellina is hidden inside Jack''s hollow pumpkin head.', 66081, 37, 1182894, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182895, 'Dorothy Outsmarts the King', 'All the friends have been transformed into ornaments for guessing wrong! On her last guess, she gets lucky and figures out the pattern. She frees the Royal Family and correctly deduces the pattern to free her Oz friends.', 66081, 38, 1182895, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182896, 'The Secret Fear of the Nomes', 'An angry Nome King send his army after them. A frightened Billina hiding in Jack''s head lays an egg. The egg falls out and roll towards the Nome army who flee. Eggs are poisonous to Nomes! Billina lays more eggs to bind the Nome King and disarm him of his magic belt.', 66081, 39, 1182896, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182897, 'The Nome King Sets a Trap', 'The Nome King tries to stop them, but Ozma uses the Magic Belt on him. He succumbs to defeat.', 66081, 40, 1182897, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719331, 'Bridge to the Turnabout - 4th Trial', 'While Iris is brought in to work on the trick lock, Phoenix finds a charred letter instructing someone to channel someone, along with a talisman Elise was carrying.', 66103, 20, 1719331, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182898, 'Saved by the Sun', 'The group escapes and thank Billina for her help, but then the ship and the surrounding sand begins to sink by the Nome King again, but once Lion saves Scarecrow from being lost, they are all finally free and safe and go home.', 66081, 41, 1182898, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182899, 'The Nome King Plans Revenge', 'The Nome King wants revenge, but without his Magic Belt he doesnt know how to accomplish this. He sends for the captain of his army and the two plot.', 66081, 42, 1182899, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182900, 'Princess Ozma''s Secret', 'Princess Ozma has three weapons: a magic picture that shows her anything she wants to see, the Nome King''s Magic Belt, and a magic fountain that completely erases the mind of the drinker.', 66081, 43, 1182900, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182901, 'Miss Cuttenclip and Mister Fuddle', 'Dorothy has always wanted to see Oz, and unaware of the Nome King''s intention, sets off on a journey. She meets a woman who has created a village of living paper dolls and a living fiddle.', 66081, 44, 1182901, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182902, 'The Growleywog Joins the Nomes', 'The Nome King asks the Evil and Powerful Growleywogs to join in his attack on the Emerald City.', 66081, 45, 1182902, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182903, 'The Water of Oblivion', 'Knowing the Nomes'' fear and weakness, Guff enlists the help of the monstrous Growleywog to ensure their victory.', 66081, 46, 1182903, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182904, 'Nomes on the March', 'The Nome King has commissioned a tunnel that runs beneath the Deadly Desert and right into the gardens of the Emerald City Palace. The Nomes and the Growleywogs set off for the attack.', 66081, 47, 1182904, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182905, 'A Winky Helps his King', 'As the Tin Man battles Growleywog, Dorothy borrows the Magic Bird and tries to solve the problem without ruining any plans for Ozma.', 66081, 48, 1182905, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182906, 'The Crowning of Ozma', 'Nome King & his Army attempts to charge Emerald City, but Scarecrow''s wondering of where and looking for Dorothy forces them back into the tunnel.', 66081, 49, 1182906, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182907, 'The Nomes Attack', 'Ozma puts magic dust in the Nome tunnel to make the army very thirsty. The first thing they see when they emerge is the Water of Oblivion fountain. After drinking desperately, everyone forgets why they are there and who they are.', 66081, 50, 1182907, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182908, 'Dorothy and Her Friends Defend the Palace', 'Dorothy and Billina pelt the few who do not drink from the Fountain with eggs until they are forced to drink of the magical and dangerous water.', 66081, 51, 1182908, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182909, 'A Very Happy Ending', 'With everything peaceful again, Ozma arranges to send Dorothy home again, with the promise that she can return anytime. Dorothy agrees and returns home.', 66081, 52, 1182909, 75937, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182920, 'Can I Cry?', '', 66082, 1, 1182920, 75939, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187351, 'A Relationship Due To Willful Negligence', '', 66082, 2, 1187351, 75939, null);
