INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182985, 'The Sakurada Family''s Nine Siblings', 'Shy Akane is the fourth of nine siblings of the Royal Sakurada Family. Although she cannot even pass by a surveillance camera without wanting to hide, her father, the King, has decided to hold an election to name his successor.', 66083, 1, 1182985, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182986, 'Big Sister''s Good Image / Sato''s Unrequited Love', 'Kanade and Akane leave for school to go to a student council meeting. On the way, Kanade points out the obvious flaw in Akane''s plan to become king, namely, that it would bring her more attention. Kanade then tries to ditch Akane for clinging to her too closely. Akane is then almost hit by a truck while saving a cat, but Kanade saves her by materializing a giant, shock-absorbent wall. Akane asks how much it cost, and is shocked when Kanade tells her it cost 40,000,000 yen. The second part of the episode focuses on Hana Satō, who is bemoaning that no one at school knows her after she transferred away for a few years. She is shocked to find that Shū still remembers her. After school, she sees him walking home with Akane, and assumes that Akane is his girlfriend. Realizing the misunderstanding, she confesses her feelings for him. He says he would return her feelings, but is focused on the election, trying to prevent Kanade from becoming king, and agrees to return them once it is over. That evening, he calls her to make sure she arrived home alright. Later, Akane wonders why Shū would want to prevent Kanade from becoming king.', 66083, 2, 1182986, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182987, 'I Want to Become Popular / First Errand / Idol Activities', '', 66083, 3, 1182987, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182988, 'The Royal Princess'' Skirt / The Mysterious Student Council President', 'Akane goes to school without a crucial piece of clothing. Also, the student council is making all students participate in a town beautification day. Who is behind this and how will Akane deal with all the cameras?', 66083, 4, 1182988, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182989, 'Summer Vacation / Online Secret / Eight of Misaki', 'It''s summer and the Sakurada Royal Family are at the beach! Haruka is doing something fishy on the internet, and Misaki is busy at school as all her clones help out in different clubs. Misaki isn''t too happy about it, though.', 66083, 5, 1182989, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182990, 'The Election and Me / My Big Sister is Sentimental', 'During the first part, the Sakurada siblings are busy with their election campaigns and the plot moves to Kanade, whom reveals her intention to become the king: long ago, she brought Akane and Shu to play at a park in their childhood. When she materialized a castle for Akane to play in, it crumbled and injured both Shu and Akane. Shu was the one that mostly affected and it severed his leg (even Kanade''s ability proven futile), simultaneously crushing his dream to become a soccer player. Due to this, she wants to become a king in order to advance the medical systems and corrects her past mistake on Shu. Meanwhile Haruka sees an improvement in his siblings, even seeing Misaki for the first time trying to campaigning for herself. In the second part, after visiting the kindergarten, Kanade sees Aoi as a rival to her and asks Aoi about her true power. Aoi''s true power, Absolute Order allows her to command anyone to her liking but she stops using it out of fear being unfit as a king, as well as having little control over it. While returning home, Aoi believes that she has several friends because of her royalty status but Akane denies such fact, having known their true relationship.', 66083, 6, 1182990, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378263, 'Masky', '', 66179, 1, 1378263, 93841, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182991, 'Worrywart King / Secret Idol', 'The King goes on a business trip, reluctantly leaving Kanade in charge of a Akane and Shiori. Meanwhile, Hikari gets to work with Sacchy, but Sacchy is not friendly. How can Hikari get Sacchy to like her?', 66083, 7, 1182991, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182992, 'Troubled Sato / The King''s Side Trip', 'The whole family''s superpowers are acting up! Meanwhile, Hana asks Akane for dating advice about Shu. Then, we take a look into the past and see how Akane''s mom and dad met.', 66083, 8, 1182992, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182993, 'Scarlet Bloom / Big Sister''s Birthday', 'We meet Scarlet Bloom, a masked heroine with red pigtails and who can control gravity. Who could her true identity be?! While things are ramping up for the election, it''s almost Christmas Eve, which is also Aoi''s birthday.', 66083, 9, 1182993, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182994, 'Search☆Light''s Whereabouts / Big Brother Acting Like A Big Bro', 'The elections are drawing near and Search☆Light is performingagain, but there is tension in the air between Sachiko and Raito. Meanwhile, even though Kanade and Shu are twins, they have their differences in opinion.', 66083, 10, 1182994, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182995, 'Goodbye, Scarlet Bloom', 'It''s one month before the elections. We learn why Akane hates being in the public eye. Then, due to an unfortunate circumstance, the king cannot perform his duties. How will the Sakurada Royal Siblings save the day?', 66083, 11, 1182995, 75940, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1182996, 'Who Will the Crown Shine Upon', 'The elections are finally here and the siblings are preparing for their final speeches. Who will be crowned as the successor to the throne?', 66083, 12, 1182996, 75940, null);
