INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183418, 'The First Turnabout', 'Naruhodo Ryuichi (Phoenix Wright), attorney at law, sets foot in a courtroom for his very first trial... in which he has to defend his best friend?!', 66103, 1, 1183418, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183674, 'Turnabout Sisters - First Trial!', 'A shocking murder leaves Mayoi (Maya), little sister of Chihiro (Mia), in a situation Naruhodo (Phoenix) cannot ignore.', 66103, 2, 1183674, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191824, 'Turnabout Sisters - 2nd Trial', 'The trial for the chief''s murder begins. Will Naruhodo (Phoenix) be able to get Mayoi (Maya) out of this?', 66103, 3, 1191824, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191825, 'Turnabout Sisters - Last Trial', 'The case reaches its climax, as Naruhodo (Phoenix) and Konaka (White) look to get each other convicted.', 66103, 4, 1191825, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197834, 'Turnabout Samurai - 1st Trial', 'Popular television hero Steel Samurai is arrested for murder, and it''s down to Naruhodo (Phoenix) and Mayoi (Maya) to defend him.', 66103, 5, 1197834, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197835, 'Turnabout Samurai - 2nd Trial', 'The investigation on the Steel Samurai case turns to a new direction, as the security lady''s information gives our attorneys a valuable lead.', 66103, 6, 1197835, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197836, 'Turnabout Samurai - Last Trial', 'Will the true culprit of the Steel Samurai case be caught? And why did they do it?', 66103, 7, 1197836, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197837, 'Turnabout Goodbyes - 1st Trial', 'The body of a man shot dead is found in Gourd Lake, and the suspect is none other than...', 66103, 8, 1197837, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197838, 'Turnabout Goodbyes - 2nd Trial', 'The trial begins, and the god of prosecutors immediately shows off his immense prowess.', 66103, 9, 1197838, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197839, 'Turnabout Goodbyes - 3rd Trial', 'Things are looking desperate, as a guilty verdict looms on the horizon. Will the secret behind this case be revealed?', 66103, 10, 1197839, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197840, 'Turnabout Goodbyes - 4th Trial', 'Will the defense be able to prove the guilt of the real culprit? And how will they do it?', 66103, 11, 1197840, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197841, 'Turnabout Goodbyes - Last Trial', 'Turnabout Goodbyes reaches to its shocking conclusion!', 66103, 12, 1197841, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206310, 'Turnabout Promise', 'With the DL-6 Incident and the lunch money case now solved, memories of fifteen years ago come flooding back.', 66103, 13, 1206310, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206311, 'Reunion and Turnabout - 1st Trial', 'A while after the last case, a new client arrives with the request to attend a channeling ritual.', 66103, 14, 1206311, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206312, 'Reunion and Turnabout - 2nd Trial', 'Gumshoe gives his testimony, explaining that Grey was first stabbed before being shot by his own pistol. He presents Maya''s ceremonial robes, which are covered in blood and have a hole in the sleeve. While Franziska claims that bullet hole is irrelevant, Phoenix notices the hole is missing a gunpowder burn that would appear if it was shot at close range. Lotta is then brought to the stand, presenting the photo she had taken of "Maya" when entering the crime scene. Phoenix notices that the person in the photo is missing the head ornament Maya was wearing, believing that another person was impersonating Maya. As Phoenix struggles to prove how this additional person entered the locked room, Pearl manages to channel Mia, who reminds Phoenix of the room key Pearl gave him, which proves the possibility of another person.', 66103, 15, 1206312, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232259, 'Reunion and Turnabout — 3rd Trial', 'While returning to Kurain, Pearl explains to Phoenix how, when the murder took place, she was in an outdoor walkway trying to repair a sacred urn that she had accidentally broken. After speaking with Morgan, who explains how Maya was supposed to be next in line to inherit the channeling school following Misty''s disappearance, Phoenix finds a piece of Maya''s outfit in the incinerator where Pearl found the key. Coming across Lotta again, Phoenix finds a clothes basket with a hole in it, while Lotta gives him information on Ini, revealing she was in the same car accident as Mimi and had to undergo reconstruction surgery. As Phoenix questions Ini about the incident, Morgan goes with the police to join the investigation. On the second day of the trial, Phoenix asks Pearl to channel Mia again so that she doesn''t hear what happens during the trial. The trial begins with Morgan testifying against Maya, claiming she fled from the channeling room after committing the murder, before Ini is brought to the stand.', 66103, 16, 1232259, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216078, 'The Devil Scoffs When You Talk of Next Year', 'It''s the end of the year, which means Christmas presents and lots of cleaning! Fortunately, Hino is there to make sure everyone takes a break.', 66112, 8, 1216078, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378264, 'Zlatá horúčka', '', 66179, 2, 1378264, 93841, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232262, 'Reunion and Turnabout — Last Trial', 'Ini claims that Maya, possessed by Mimi, came to see her in the side room following the murder. However, Phoenix finds this claim to be false, as she would have encountered Pearl trying to fix the urn in the walkway. Putting together the evidence, Phoenix deduces that Ini was hiding in the clothes basket in the channeling chamber, where she knocked out Maya and stabbed Grey, who used the last of his strength to try and shoot her. He further deduces that Morgan was her accomplice, helping her to frame Maya and dispose of evidence. Tasked with finding a motive for committing such a complicated murder, Phoenix questions Ini about the car accident, deducing from her statement that she is actually Mimi, who had been reconstructed with Ini''s face following the accident that took the real Ini''s life. Mimi reveals that she had hoped to escape her history of medical negligence following the accident, but when Grey''s decision to hold a channeling ritual threatened to expose her, Morgan came up with the murder plan in order to frame Maya and have Pearl become the head of the Kurain school. Following the trial, as Morgan is arrested and the channeling school is temporarily closed, Pearl encourages Maya to return to Phoenix''s side.', 66103, 17, 1232262, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232264, 'Turnabout Big Top — 1st Trial', 'Phoenix and Maya go to see the Berry Big Circus show headlined by magician Max Galactica. The next day, they discover that Max has been accused of murdering the circus'' ringmaster, Russell Berry, though Max states he is innocent, as he was discussing his salary with him. After meeting Berry''s daughter, Regina, Phoenix and Maya hear about the crime from Gumshoe, who claims that Max''s ability to fly places him as the prime suspect as only the victim''s footprints were found. Finding that most of the staff seem to also suspect Max because of his cocky attitude, they hear from Moe the Clown that Max allegedly hit Ben the ventriloquist with a bottle the other day. While looking through Berry''s office, they find the contract that Max had mentioned to be dated a week prior to the meeting. Phoenix threatens to drop Max''s defense, prompting Max to confess his strained relationship with the other performers, convincing Phoenix to change his mind. Phoenix ends up chasing a monkey to one of the performer''s rooms, where they find a bust of Max and a diamond ring, which allegedly belongs to Ben''s puppet, Trilo. Speaking through Trilo, Ben claims that he saw Max heading to the crime scene on the night of the murder, but Phoenix points out that he would''ve had to see the ringmaster too. Trilo rebukes Phoenix, saying he wasn''t the only witness to the incident.', 66103, 18, 1232264, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232265, 'Turnabout Big Top — 2nd Trial', 'As the trial begins, Gumshoe explains the strange circumstances of the case before Moe is brought to the stand as a witness, claiming that he saw Max flying off outside his window moments after Berry''s murder. After the trial is postponed so that the prosecution can investigate how the murder occurred, Max reveals that he lent Berry his costume on the night of the murder. Revisiting the room they came across the previous day, Phoenix and Maya meet Ken "Acro" Dingling, an acrobat who lost the use of his legs six months ago, but he is dragged away by Franziska, who reveals she wants revenge against Phoenix for defeating Edgeworth. After hearing from Moe that Berry was angry about something on the morning of the murder, Phoenix checks his office and finds a threatening letter pertaining to an incident six months ago, calling Berry to the place where he was murdered. Asked about the incident, Moe explains how Acro''s brother, Bat, was put into a coma by Regina''s pet lion, Leon, who was then shot by Berry. Regina then reveals that she found the note while returning from Acro''s room, leading Phoenix to suspect the note may be from Acro. As the trial resumes, Phoenix accuses Acro of being the one who plotted Berry''s murder.', 66103, 19, 1232265, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232266, 'Turnabout Big Top — Last Trial', 'Phoenix deduces the mystery behind the crime scene, explaining that a bust of Max was dropped on Berry''s head when he attempted to open a heavy box. When the bust was pulled back up, it latched onto Max''s costume, leading Moe to mistake it for Max himself. Believing Acro, who lives directly above the scene, is the only one who could have committed the crime, Phoenix brings out the threatening note, explaining how it relates to the incident six months ago. He reveals that the reason Bat was attacked was because the scarf Regina gave him was covered in pepper, which caused Leon to sneeze and bite down on him, meaning that Acro''s intended target was Regina. As the decisive evidence, the bust, appears to be nowhere to be found, Phoenix deduces that Acro has been hiding it inside his wheelchair, leading Acro to admit his guilt. Afterwards, as Moe takes over as the Big Berry Circus'' ringmaster, Gumshoe gets in contact with Edgeworth.', 66103, 20, 1232266, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232267, 'Farewell, My Turnabout — 1st Trial', 'During a Hero of Heroes Grand Prix event held at a hotel, one of the actors, Juan Corrida, is murdered, with the current Nickel Samurai actor, Matt Engarde, accused of the crime. Just after learning about the murder, Phoenix is contacted by someone known as Shelly de Killer, who reveals he has kidnapped Maya and will only release her if Phoenix can get Engarde acquitted within the trial''s first day. The next day, Phoenix interviews Engarde''s manager, Adrian Andrews, and investigates Corrida''s dressing room. Just before the trial the following day, Franziska is suddenly shot by a sniper hired by de Killer, prompting Edgeworth, who has returned from his long absence, to take her place on the prosecutor''s bench.', 66103, 21, 1232267, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232268, 'Farewell, My Turnabout — 2nd Trial', 'At the start of the trial, Gumshoe explains that, despite the obvious knife wound on the body, Corrida was actually killed by strangulation. Oldbag, who had been working security at the hotel, then testifies that she saw Engarde leave Corrida''s room, presenting a photo of the Nickel Samurai costume. Noticing that the person in the costume is shorter than Engarde, Phoenix accuses Adrian and calls her to the stand. She reveals that she had planned to hold a conference with Corrida in the Nickel Samurai costume, as he knew a secret about Engarde''s career. With Adrian refusing to testify and a lack of evidence to convict her, Phoenix is unable to stop the trial from becoming extended. After Phoenix manages to convince de Killer to give him more time, Edgeworth, learning about Maya''s kidnapping from Phoenix, deduces from a calling card Adrian had picked up from the scene that Corrida was killed by de Killer, suspecting Engarde was the one who contracted him. Meanwhile, Maya manages to briefly break out of the basement and find a framed photo of someone before de Killer catches her again. Inspecting the crime scene again, Phoenix and Edgeworth discover a hidden camera hidden in one of the teddy bears, discovering Engarde was the one sent it. When confronted about it, Engarde reveals to Phoenix that he is indeed the one who contracted de Killer to kill Corrida.', 66103, 22, 1232268, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1736161, 'Bridge to the Turnabout - 5th Trial', 'As court resumes with Phoenix once again against Godot, Iris suddenly claims that she helped cover up Elise''s murder after she was allegedly killed by Maya in self-defense. However, her testimony proves false with the reveal of real murder weapon and Elise''s identity as Misty.', 66103, 21, 1736161, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1736162, 'Bridge to the Turnabout - 6th Trial', 'Dahlia reveals she had plotted with Morgan to murder Maya and make Pearl head of the Kurain family so she could get revenge against Mia.', 66103, 22, 1736162, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378265, 'Misska', '', 66179, 3, 1378265, 93841, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378266, 'Zub', '', 66179, 4, 1378266, 93841, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232269, 'Farewell, My Turnabout — 3rd Trial', 'Revealing that he hid the camera as insurance against de Killer, Engarde reminds Phoenix about what will happen to Maya if he fails to secure a "not guilty" verdict. As Edgeworth asks Phoenix to think about what the right thing to do is, they hear the sound of Engarde''s pet cat over de Killer''s radio, leading them to Engarde''s mansion. Although Maya is nowhere to be found by the time they get there, they discover a photo of Adrian''s sister, Celeste, and a message from Maya telling Phoenix to find Engarde guilty no matter the cost. The next day, as Edgeworth brings in Adrian to testify about a teddy bear that was removed from the crime scene, Pearl manages to use Mia to inform Gumshoe about Maya''s current whereabouts. Adrian explains that the bear was a gift to Corrida from Celeste, who hung herself after being dumped by Corrida after he learned about her relationship with Engarde. She further reveals that Corrida was planning to reveal Celeste''s suicide note to the public during the conference, leading Adrian to tamper with the crime scene in order to implicate Engarde. As the note is revealed to be inside the bear that was taken from the scene, Phoenix calls for the note to be analyzed to buy some time. Gumshoe manages to find some evidence left behind by Maya, but ends up getting into a traffic accident en route to the courtroom, where de Killer decides to testify over a transceiver.', 66103, 23, 1232269, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1232270, 'Farewell, My Turnabout — Last Trial', 'De Killer claims that Adrian is his client, but exposes his lie when he wrongly assumes her to be a man. Just as de Killer adjusts his testimony and Engarde is about to be declared innocent, Franziska arrives with the video disk Gumshoe had picked up, containing footage of de Killer killing Corrida. Turning his thinking around, Phoenix shows the video to de Killer, revealing that Engarde had been planning to use it to blackmail him. Realizing he has been betrayed, de Killer cancels his contract with Engarde, choosing him as his next target, and releases Maya. Terrified for his own safety, Engarde is forced to confess his guilt. After the trial, as Franziska is baffled over Phoenix being happy with a guilty verdict, Edgeworth states that his battles with Phoenix have taught him that trust between attorneys and prosecutors is necessary in order to find the truth. As Maya is reunited with Phoenix, Edgeworth sees Franziska off at the airport.', 66103, 24, 1232270, 75981, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1587003, 'The Lost Turnabout', 'Phoenix suffers a blow to the head from behind and loses his memory right before a trial, in which he is defending police officer Maggey Byrde for the murder of her boyfriend and fellow officer Dustin Prince.', 66103, 1, 1587003, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1593692, 'The Stolen Turnabout – 1st Trial', 'When the Kurain Village''s sacred urn is stolen from an exhibit at the Lordly Tailor by the mysterious thief Mask DeMasque, Phoenix, Maya, and Pearl investigate the scene and meet self-proclaimed ace detective Luke Atmey.', 66103, 2, 1593692, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1593697, 'The Stolen Turnabout – 2nd Trial', 'As Phoenix struggles to make a case that Ron wasn''t the one who stole the urn, Maya brings in Larry, who was working as a security guard for the exhibition.', 66103, 3, 1593697, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604906, 'The Stolen Turnabout – 3rd Trial', 'After Phoenix and Maya notice that her urn has been covered in splotches and returned to its original shape, Adrian reveals she accidentally broke and tried to cover it up by moving a statue, which was in different position to when Phoenix first found it.', 66103, 4, 1604906, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604907, 'The Stolen Turnabout – Last Trial', 'Godot begins the trial by stating that the CEO fired Ron for stealing confidential data and was blackmailing him in exchange for not telling Desirée.', 66103, 5, 1604907, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604908, 'Sound the Turnabout Melody', 'Phoenix thinks back to his middle school days, three years after Edgeworth lost his father and began living with von Karma and Franziska.', 66103, 6, 1604908, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604909, 'Recipe for Turnabout – 1st Trial', 'Phoenix is surprised to hear that Maggey was found guilty in a murder trial that he himself was reportedly the defense attorney for.', 66103, 7, 1604909, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604910, 'Recipe for Turnabout – 2nd Trial', 'Resuming their investigation at Trés Bien, Phoenix and Maya learn that Armstrong owes money to a loan shark. After getting more details from Kido, Phoenix and Maya visit the office of the loan shark in question and the one who impersonated Phoenix, Furio Tigre.', 66103, 8, 1604910, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604911, 'Recipe for Turnabout – Last Trial', 'Following a hole-filled testimony by Armstrong, Phoenix suspects that the murder Kido witnessed was actually a reenactment which took place after the actual murder.', 66103, 9, 1604911, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604912, 'Northward, Turnabout Express – 1st Trial', 'On New Year''s Eve, Phoenix and Maya, along with Gumshoe and the judge, are invited by Avery Richman to ride the maiden voyage of the Silver Star express train.', 66103, 10, 1604912, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604913, 'Northward, Turnabout Express – 2nd Trial', 'The details of Richman''s original trial state that a secretary-general named Benjamin Cashanova was shot during a year-end ceremony, with Richman found with a pistol in the direction the gunshot came from.', 66103, 11, 1604913, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1604914, 'Northward, Turnabout Express – Last Trial', 'Gumshoe reports about Gale''s corpse and the "soul" he saw, which Phoenix reveals was a brief fire that he saw, as the train''s cars were actually rearranged just before the takeover.', 66103, 12, 1604914, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1678977, 'Turnabout Memories', 'Five years ago, Phoenix is accused for the murder of Doug Swallow, who was electrocuted to death. Mia, who had previously been traumatized by her first trial a year ago, defends Phoenix in court, where Payne suggests Phoenix had bad blood with Swallow over his then girlfriend Dahlia Hawthorne and pushed him into a severed electrical cable.', 66103, 13, 1678977, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1685463, 'Hear the Waves of Turnabout', 'After accidentally breaking a precious seashell that she received from Maya, Pearl asks Phoenix to help her search for an identical looking shell without Maya knowing.', 66103, 14, 1685463, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719326, 'Turnabout Beginnings – 1st Trial', 'One year prior to her first meeting with Phoenix, Mia takes on her first client; a death row convict named Terry Fawles who is accused of murdering policewoman Valerie Hawthorne, with the assistance of her senior, Diego Armando.', 66103, 15, 1719326, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719327, 'Turnabout Beginnings – Last Trial', 'After Dahlia''s attempt to feign ignorance only incriminates her further, Mia has Fawles testify about the incident from five years ago.', 66103, 16, 1719327, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719328, 'Bridge to the Turnabout - 1st Trial', 'Phoenix, Maya, and Pearl go to Hazakura Temple for Maya''s training, where they meet children''s book author Elise Deauxnim and nuns Bikini and Iris, along with Larry, who is studying as Elise''s apprentice.', 66103, 17, 1719328, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719329, 'Bridge to the Turnabout - 2nd Trial', 'While investigating the shrine, Edgeworth listens to Bikini''s account of Elise''s murder, learning that Pearl has gone missing, before meeting up with Larry, who appears to be hiding something he saw on the night.', 66103, 18, 1719329, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1719330, 'Bridge to the Turnabout - 3rd Trial', 'During his testimony, Larry presents a sketch he drew of what he saw on the night of the murder, allegedly depicting Iris flying over the flaming bridge.', 66103, 19, 1719330, 110397, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216079, 'One Good Turn Deserves Another', 'Chihiro sees the woman from Miyako''s house again on his way home from school. Once he gets home, a young guest comes to visit him.', 66112, 9, 1216079, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1746784, 'Bridge to the Turnabout - Last Trial', 'Noticing that Maya was able to identify the true culprit in the dark, Phoenix deduces that the killer is Godot, whose red visor not only glows in the dark but also leaves him unable to see anything red, including the bloody message incriminating Maya.', 66103, 23, 1746784, 110397, null);
