INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183424, 'I''m a Normal Middle School Student', 'Luluco aims to live a normal life in the abnormal town of Ogikubo, a space immigration zone where humans and aliens coexist, but her normal life comes crashing down with a bang one morning.', 66107, 1, 1183424, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186451, 'A New Transfer Student Arrives!', 'Things get stranger for Luluco, as the arrival of a transfer student and a new partner shake things up even further.', 66107, 2, 1186451, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186824, 'Battlefield Classroom', 'The newly formed team of Luluco and Nova head to school to look for Save the World, the alien circulating the Blackhole app.', 66107, 3, 1186824, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186825, 'Into the Sky All Alone', 'A meteorite comes hurtling towards Ogikubo, and only the Space Patrol trio can prevent Armageddon.', 66107, 4, 1186825, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189319, 'What Should I Do?', 'Lalaco Godspeed, Luluco''s mother and Space Pirate Captain, unveils her grand plan... and it involves Ogikubo?!', 66107, 5, 1189319, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189320, 'That One Part Awakens', 'Space Pirate Lalaco Godspeed is on a rampage, and only one man can stop her.', 66107, 6, 1189320, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195067, 'The Trap of Fate''s Threads', 'The Space Patrol gang have to find Ogikubo quickly, or they''ll have nowhere to go home to! That''s when they stumble upon a rather strange planet...', 66107, 7, 1195067, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195069, 'The Trap of the Mystical Power', ' Luluco and gang stumble upon a rather magical planet during their quest to find Ogikubo.', 66107, 8, 1195069, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195072, 'The True Trap', 'Luluco wants relationship advice, and who better to turn to than a detective agency?', 66107, 9, 1195072, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195074, 'It''s All Over', 'The shocking truth comes to light in truly heart-breaking fashion.', 66107, 10, 1195074, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195075, 'I Was Clueless', 'Luluco finds herself dead and in Hell, where she runs into a man who has been there, done that.', 66107, 11, 1195075, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195076, 'Confession', 'Back to life, Luluco decides confront to Nova once and for all.', 66107, 12, 1195076, 75985, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195077, 'I, of the Universe...', 'Luluco and Nova finally confess to each other. Their middle schooler''s first love makes them invincible and as they hold hands, the universe starts to experience strange dimensional anomalies...', 66107, 13, 1195077, 75985, null);
