INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183433, 'Those Who Do Not Work Shall Not Eat', 'After Chihiro loses his mother, he is faced with homelessness until he meets a man named Madoka who claims to be his uncle.', 66112, 1, 1183433, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216072, 'Failure Is the Mother of Success', 'First, a girl named Miyako appears at Madoka''s door. What is her connection to the Takatoris? Also, will Chihiro''s friends find out his secret?', 66112, 2, 1216072, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216073, 'Feed a Dog for Three Days and He Will Remember It for Three Years', 'Chihiro finds an abandoned dog on the street and takes it home, but Madoka is deathly afraid of dogs...', 66112, 3, 1216073, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216074, 'What One Likes, One Will Do Well', 'Madoka seems down after Chihiro cleans his room, and Chihiro looks to his past to figure out why. Also, Miyako continues to practice cooking to impress Keiichiro.', 66112, 4, 1216074, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216075, 'A Man Never Goes Back on His Word', 'When Chihiro sprains his ankle and can''t do the housework, he worries about leaving it to Madoka. A few days later, Hino brings over a scary movie…', 66112, 5, 1216075, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216076, 'Even a Chance Encounter Is Preordained', 'Chihiro and Hino meet a strange boy on the street who''s looking for Madoka. Later, Chihiro and Miyako plan a birthday party.', 66112, 6, 1216076, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216077, 'Learning Does Not Happen in a Day', 'Chihiro''s school is having open house, but will he work up the nerve to ask Madoka? He also has to write an essay about his future dreams to present.', 66112, 7, 1216077, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378258, 'Domobrana', '', 66179, 4, 1378258, 93840, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216080, 'No Heat or Cold Lasts past the Equinox', 'After Madoka''s new plan to indulge in his cat fantasies doesn''t quite work, Chihiro and Madoka prepare to visit Chihiro''s family grave during the equinox.', 66112, 10, 1216080, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216081, 'Boys, Be Ambitious', 'Chihiro and Madoka both seem down, so Hino and Miyako decide to have a flower viewing party to try and cheer them up.', 66112, 11, 1216081, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216082, 'All''s Well That Ends Well', 'Madoka gets sick during the busy wedding season, and Chihiro is visited by a strange girl…', 66112, 12, 1216082, 75990, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183434, 'April 7: An Unfortunate First Day of School', 'On her first day of high school, Ruri "Hibari" Hibarigaoka comes across an unlucky girl named Anne "Hanako" Hanakoizumi dangling off a bridge while rescuing a dog.', 66113, 1, 1183434, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196053, 'April 11: The High-Tech Physical Exam', 'While on their way to a physical exam, Hanako and the others come across a robotic rabbit named Timothy, who serves as a guide to the school.', 66113, 2, 1196053, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196054, 'April 28: My First Happiness Training', 'Class 7 end up having to take part in an overly elaborate life-sized board game. There, the girls compete with Hibiki Hagyū, who gets lost easily, and her childhood friend Ren Ekoda, who she has a crush on.', 66113, 3, 1196054, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196055, 'April 29: A Mysterious Penalty', 'As part of their penalty for coming in last, Hanako, Hibari, and Botan are tasked with taking a picture of their "lucky items" over the weekend. While Hibari and Botan look across town for a flower representing Hanako''s lucky item, Hanako comes across Hibiki and Ren as they are following the others and has them join them.', 66113, 4, 1196055, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196056, 'May 9: Getting Lost on the Way to School', 'Hibiki attempts to go to school on her own, coming across the other girls as they make their respective commutes. Holding a misdirected grudge against Hibari, Hibiki finds her pass case containing a picture of the sign she likes.', 66113, 5, 1196056, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196057, 'May 30: A Field Trip With Everyone', 'The class goes on an orienteering trip in the mountains said to contain several lucky power spots. Hanako''s group faces a troublesome encounter with some hostile monkeys, but manage to reach the first power spot and enjoy lunch together.', 66113, 6, 1196057, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196058, 'June 28: Visiting Hanako', 'As the class is tasked with making their wishes come true, Hanako comes down with a fever after becoming soaked in the rain. Hibari and Botan pay a visit to Hanako''s home and meet her mother, Sakura, who used to be a Class 7 student.', 66113, 7, 1196058, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196059, 'July 11: Fighting Final Exams', 'As part of their final exams, Class 7 are faced with a surprise exam in a virtual space, in which they must play multiple games of chance to determine their score.', 66113, 8, 1196059, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1251060, 'July 13: A Stormy Group Lesson', 'The girls have a cooking class taught by a strict teacher named Saginomiya, who is observant of the misfortunes of the Class 7 students. As Hibari feels downhearted after a mishap ruins her group''s dish, Hanako and Botan come over to her house for a sleepover to cheer her up.', 66113, 9, 1251060, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1251061, 'July 20: Our Summer Vacation', 'As summer vacation begins, the girls go to a karaoke box together, where Timothy drops a catchy rap number. The next day, Hanako and Hibari bump into a mysterious girl before joining the others at an indoor beach built by Botan''s sister.', 66113, 10, 1251061, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1251062, 'August 18: A Stormy Outdoor School', 'Class 7 goes on an outdoor school trip, where they start off with an arts and craft class making wood carvings. The next day, the students are thrown into an extreme game of tag in which they must recover their wood carvings and reunite with their teammates while avoiding Kodaira, Timothy, and his army of Mini-Timothys.', 66113, 11, 1251062, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1251063, 'August 19: A Happy Outdoor School', 'As the tag game continues, both Hibiki and Ren end up getting captured by Kodaira and Timothy, but a team of Ren-infactuated animals manages to break them free.', 66113, 12, 1251063, 75991, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183769, 'Episode 1', 'In 1935, beleaguered Bournemouth mother Louisa Durrell decides to uproot her family and build a new life on the sun-drenched island of Corfu. However, with money problems and four unruly children to care for, even a new start might not be enough to banish her troubles.', 66134, 1, 1183769, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183770, 'Episode 2', 'Larry falls dangerously ill, and it falls to Theo and his neighbour Sven to put their rudimentary medical skills to the task of saving his life. The family''s money worries continue, but Spiros brings them good news from a surprising source. Gerry adds to his growing menagerie, while Margo is emotionally wounded - but gets little sympathy from Leslie.', 66134, 2, 1183770, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184560, 'Episode 3', 'Margo takes great pride in her new job at the surgery, but after a chance encounter with a recluse, she begins to realise where her greatest talent lies. Louisa grows closer to Sven, but as Gerry befriends a convict and Leslie begins spending all his time in the local bars, she begins to suspect she has made a mistake bringing her children to Corfu.', 66134, 3, 1184560, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187125, 'Episode 4', 'Leslie falls in with a bad crowd and ends up being falsely accused of armed robbery, prompting Louisa to take desperate measures to save him. Margo takes a shine to a gardener at the Villa Mavrodaki, Captain Creech returns, and the family realises the extent of Gerry''s passion for animals when he turns his bedroom into a centre for scientific learning.', 66134, 4, 1187125, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1188886, 'Episode 5', 'The family faces the unwanted arrival of a domineering aunt, while Larry''s girlfriend also pays a visit - giving the unwelcome relative an opportunity to voice her disapproval of the whole family. Sven makes an offer that helps Louisa cope with adversity and Margo falls in love - but Gerry is more concerned with his newly acquired owlets.', 66134, 5, 1188886, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190205, 'Episode 6', 'The family prepares for a celebration, and Margo is determined to persuade the reclusive Countess Mavrodaki to attend. Sven is put to the test by his potential family, but seems to make a good impression. Gerry begins to question whether keeping animals in his personal zoo is fair, and considers releasing them into the wild.', 66134, 6, 1190205, 76041, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305983, 'Episode 1', 'Louisa tries to raise some money by selling homemade food, which attracts the attention of another Englishman. However, a former lover threatens the family''s idyllic existence. Gerry comes up with a plan to breed otters, Leslie accidentally shoots Roger, and Margo considers becoming a nun.', 66134, 1, 1305983, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305984, 'Episode 2', 'Larry''s latest novel is being published in England - but his siblings do not seem to be very impressed, his mother is more concerned with baking food to sell at the market, and even his attempts to show off in a local bar go unnoticed. Louisa attempts to make it up to him by organising a public reading. Leslie overhears Pavlos explaining to Margo how he makes liquor out of kumquats, and decides to launch a business venture brewing his own - but his sister does not approve of stealing the monk''s recipe.', 66134, 2, 1305984, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305985, 'Episode 3', 'Celebrating her birthday motivates Louisa to adopt a more youthful look. Gerry has a bewildering time with Kralefsky.', 66134, 3, 1305985, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305986, 'Episode 4', 'Aunt Hermione arrives with her friend who claims to be a medium, and so they hold a seance to see if Louisa can be reunited with her late husband.', 66134, 4, 1305986, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305987, 'Episode 5', 'Sparring for Louisa''s attention, Hugh and Spiros decide to hold a cricket match between the Greeks and the Brits.', 66134, 5, 1305987, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1305988, 'Episode 6', 'Hugh poses a life-changing question to Louisa, only to find himself a victim of Vasilia''s jealousy.', 66134, 6, 1305988, 87645, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1456520, 'Episode 1', 'When the family learn that Leslie has three girlfriends, Louisa decides to help him choose which one to pick.', 66134, 1, 1456520, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1460130, 'Episode 2', 'Louisa and Larry are both devastated to find that a dear relative has died.', 66134, 2, 1460130, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1463593, 'Episode 3', 'Larry travels with Louisa to Aunt Hermione''s Bournemouth home.', 66134, 3, 1463593, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1463594, 'Episode 4', 'The family receives a telegram from Larry, who is in Athens for a short trip, announcing that he has a friend coming to stay – Prince Jeejeebuoy. Concerned about Gerry''s education, Louisa also seeks advice from Theo.', 66134, 4, 1463594, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1471908, 'Episode 5', 'Spiros spends time with a glamorous Italian family who have recently arrived on the island. Louisa is jealous of the attention he is paying their new neighbors and invites the new neighbors over to learn more about them. She ends up convinced they are hiding something, while Margo feels threatened by their eldest daughter. Larry joins the fire service, and Gerry falls in love.', 66134, 5, 1471908, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1471909, 'Episode 6', 'The family plan a party to celebrate Gerry’s 13th birthday, but when a plague of mosquitoes descends, they are forced to hold it inside.  As the party planning progresses, Louisa is finding it hard to accept that her youngest is growing up. Gerry insists that he doesn’t want a fuss, but gets frustrated and upset when the party is clearly aimed at someone much younger.  Trying to pick up the mood, Margo’s transformation of an otherwise disastrous party results in hilarious antics as everyone but Spiros seems to join the party spirit. His distant behaviour concerns Louisa who wonders why he has locked himself in a room to sing sad love songs.', 66134, 6, 1471909, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1480097, 'Episode 7', 'Louisa finds it more than a little awkward when Larry invites Henry Miller to stay. Insisting on walking around naked, the liberal contents of Henry''s novels raise heated discussions within the family.
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1483805, 'Episode 8', 'In the Series 3 finale, the family meets members of a travelling circus, and gets involved in helping them to drum up business. Larry falls in love with a contortionist, while Margo takes to the ring in person to perform a very dangerous act. Gerry is more concerned with making sure all of the animals featured in the show are well-treated. Spiros cannot bring himself to return to his empty house and begins spending more and more time at the Durrells'' home - but the magic of the circus brings him and Louisa closer together.', 66134, 8, 1483805, 101029, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1753205, 'Episode 1', 'Louisa throws herself into running her boarding house, but mysterious guest Lazaros Vangelatos places the villa under police scrutiny.', 66134, 1, 1753205, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1753206, 'Episode 2', 'Louisa finds herself fending off unexpected romantic advances. Leslie''s arranged hunt for new guest, Colonel Ribbindane, doesn''t quite go to plan when his past revisits him.', 66134, 2, 1753206, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1753207, 'Episode 3', 'Louisa''s plan for a family picnic to Kalami goes awry when she inadvertently invites Spiros''s wife. The Durrells are surprised to discover Captain Creech''s new business venture.', 66134, 3, 1753207, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1766142, 'Episode 4', 'With the house guests getting ever more rowdy, Louisa worries about the villa''s reputation. Margo finds a surprising way to bond with Maud, while Gerry realises he has feelings for Galini.', 66134, 4, 1766142, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1771456, 'Episode 5', 'The residents of Corfu are excited at the prospect of an imminent official visit from the King of Greece, and the Durrells are keen to get themselves involved with the welcoming committee. Leslie takes over leadership of a scout troop. Love may also be in the air for Margo as she makes her return home to the island.', 66134, 5, 1771456, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1782531, 'Episode 6', 'With storm clouds gathering, the islanders realise they can no longer ignore the rumblings of war, just as it looks as though the Durrells - particularly Louisa and Spiros - may have found their happy ending. Larry marks his return by throwing an audacious play for the locals, but there are surprises for every member of the family. Series finale.', 66134, 6, 1782531, 121872, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183801, 'Episode 1', 'The first episode', 66137, 1, 1183801, 76045, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183868, 'Episode 1', 'First episode', 66141, 1, 1183868, 76050, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183870, 'Defying Gravity', 'In Africa, a caracal''s ''rocket-propelled'' launch enables it to catch birds in flight. In the Australian outback, a kangaroo''s hop is key to finding water in a desert of over a million square kilometres. On an English farm, an insect''s ultimate ejector seat accelerates it to 700G with help from a clutch in its crotch. And high above the jungles of Borneo, a leaping snake''s unique shape allows it to glide, even without wings.', 66142, 1, 1183870, 76051, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183903, 'Masters of the Sky', 'This episode looks at powered flight, revealing why peregrine falcons can top 200 miles an hour, how a hummingbird is a slave to its own rather manic lifestyle and that the albatross''s secret to flying for free is its nose. Heavyweight beetles break the rules to find love, a devious sparrow-hawk uses agility to execute a lightning-fast raid on his prey and half a million mother bats dominate the sky above, and below, the ground with a dazzling display of aerial prowess.', 66142, 2, 1183903, 76051, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184556, 'Crowded Skies', 'This episode features a creature that creates sound out of thin air with the world''s fastest courtship display and arguably the world''s most aggressive bird. 
