INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183939, 'In the Kingdom of the Dead', '', 66147, 2, 1183939, 76063, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183940, 'Renaissance', '', 66147, 3, 1183940, 76063, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183941, 'Shadow Soldiers', '', 66147, 4, 1183941, 76063, null);
