INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183947, 'Can Krakatoa Stop Time?', 'The hosts visit Asia to study a destructive volcano in the premiere of this series featuring the study of geological events.', 66148, 1, 1183947, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378259, 'Vypočujte si hlásenie', '', 66179, 5, 1378259, 93840, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378260, 'Kde je doktor?', '', 66179, 6, 1378260, 93840, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183948, 'Asteroid Armageddon', 'Investigating a giant asteroid that may have been responsible for killing off the dinosaurs. Also: a NASA super gun; an underground river in Mexico.', 66148, 2, 1183948, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183949, 'Will Iceland Poison the Skies?', 'Examining whether Iceland''s volcanoes could cause global problems in the future.', 66148, 3, 1183949, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183950, 'Will Hawaii Sink L.A.?', 'Catastrophic geological events in Hawaii''s history are examined.', 66148, 4, 1183950, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183951, 'Will Europe Burn in Hell?', 'Biologist Liz Bonnin and Geologist Martin Pepper investigate the world’s most dangerous volcano Mount Vesuvius only to discover that the three million people of Naples live in the shadow of another, much more deadly super volcano, called Campi Flegrei.', 66148, 5, 1183951, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183952, 'The Rockies Built the Atom Bomb', 'Uranium used for the atomic bomb is sought in the Rocky Mountains.', 66148, 6, 1183952, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183953, 'Ice Age or Hell Fire?', 'Evidence of the Ice Age is sought in North America.', 66148, 7, 1183953, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1183954, 'Japanese Death Match', 'A look at volcanoes, earthquakes and tsunamis in Japan.', 66148, 8, 1183954, 76064, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184339, 'Episode 1', 'The embassy hosts a barbecue for the ambassador''s birthday, and Rufus and Stephen throw a party. Rufus and the Danish defense minister talk terrorism.', 66175, 1, 1184339, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184340, 'Episode 2', 'Rufus takes classes in the Danish language, baby-sits his three visiting nieces and prepares for the upcoming LGBT Pride Parade in Copenhagen.', 66175, 2, 1184340, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199314, 'Episode 3', 'Rufus hosts a reception for a U.S. governor and attends a military conference before speaking to students and preparing to run a half-marathon.', 66175, 3, 1199314, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199315, 'Episode 4', 'Rufus visits his childhood home with Stephen while back in the U.S. for his parents'' wedding anniversary and an emotional reunion with family.', 66175, 4, 1199315, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199316, 'Episode 5', 'After a reception in Washington, D.C., Rufus returns to Denmark, where he comments on the midterms, visits a kids'' sports group and meets Mitt Romney.', 66175, 5, 1199316, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199317, 'Episode 6', 'Rufus goes from a training session with the elite Danish Frogman Corps to hosting a kids'' Halloween party, then honors fallen soldiers on Flag Day.', 66175, 6, 1199317, 76115, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1366621, 'Episode 1', 'As elections approach in Denmark, Rufus attends a unique event and visits the different political parties, while planning his wedding to Stephen.', 66175, 1, 1366621, 92794, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1366622, 'Episode 2', 'Busy schedules make grieving a death in the family difficult, even as Rufus and Stephen celebrate the legalization of gay marriage in the U.S.', 66175, 2, 1366622, 92794, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1366623, 'Episode 3', 'Rufus visits Greenland to educate himself on climate change, then debates Danes at town hall meetings and attends a speech by the prime minister.', 66175, 3, 1366623, 92794, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1366624, 'Episode 4', 'It''s a rush of activity as Rufus''s and Stephen''s families arrive in Denmark for their wedding at City Hall, presided over by Copenhagen''s mayor.', 66175, 4, 1366624, 92794, null);
