INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184430, 'Part 1', 'During World War II, Stan Vandewalle saves boxing trainer Max from the bombed German war prisoners camp, and shoots two German soldiers while escaping. After the war, Stan resolves to put all his frustration over the death of his slow-witted brother Aloïs, who dreamed of becoming an opera singer, with his side-car against a farmer''s truck in making come true Aloïs other dream, to see Stan becoming ''king of the world'' as boxer. After Max introduces him to wealthy, greedy gay manager Dumont, his career takes a rocketing start, but he gets none of the proceeds. Stan''s elder brother Romain, an honorless philanderer, finds out the cheating but prefers to demand his cut instead as exclusive bookie...', 66182, 1, 1184430, 76127, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184434, 'Part 2', 'Now sonny Fabien Dumont understands, like trainer Max, reminding Stan of Alois''s death awakes enough hatred to make him win, he becomes Belgian national champion. After bookmaker Bernier takes revenge for Romain''s betting exclusivity by having manager Dumont''s boxing license revoked by the Belgian federation ''because of his war collaboration past'', the cheaters who keep even dad Miel -who now has an open affair with a prostitute- at arms-length sell Stan to manager Kets, another shark, while keeping a stake. Mother Françoise''s idea to go with her and Max to Cuba and stay with Miel''s estranged brother Platon, another wheeler-dealer who had to flee Belgium but hopes to return, is accepted for a month. A local ''easy'' girl proves a romantic bonus for Stan, but is actually part of a plan to make him lose a match after an overdose of night life to break his pride.', 66182, 2, 1184434, 76127, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184437, 'Part 3', 'Platon has recruited Romain to help awake the worst in Stan- he says to have fucked Stan''s thus scorned ex Martha in Belgium, which induces a non-requited declaration of love to Julie. The brothers embrace each-other and nightlife although Stan realizes Romain is parasitic scum. Max makes him train hard again. After a loss against a black Cuban, Stan decides to return to Belgium, where Bernier has Dumont killed. Kets arranges a European title fight and top sport doctor Wolf for him, no more women allowed. Julie expects his baby but they decide not to keep it. Dad Miel''s prostitute mistress Annie sends him back to his wife. Kets and Romain plan Stan wins now but loses the rematch, to make a bundle on bets.', 66182, 3, 1184437, 76127, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184439, 'Part 4', 'The nasty game is played according to plan. Max worries about the hormonal preparates the quack gives Stan ...', 66182, 4, 1184439, 76127, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1184442, 'Part 5', 'The big fight...', 66182, 5, 1184442, 76127, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185020, 'Who Killed Jesus?', 'No trial or execution in history has had such a momentous outcome as that of Jesus in Roman occupied Jerusalem, 2000 years ago.
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185023, 'The Real Mary Magdalene', 'Mary Magdalene''s story is intimately linked with Jesus. She plays a starring role in one of the most powerful and important scenes in the Gospels. When Jesus is crucified by the Romans, Mary Magdalene was there supporting him in his final terrifying moments and mourning his death. She also discovers the empty tomb, and she''s a witness to the resurrection. She was there at the beginning of a movement that was going to transform the West. But the Mary Magdalene that lives in our memories is quite different. In art, she''s often semi-naked, or an isolated hermit repenting for her sins in the wilderness: an outcast.', 66198, 2, 1185023, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185027, 'The Disciples', 'Nobody knows for sure just how long Jesus'' ministry, teaching and travelling throughout Israel, lasted. Some say three years others as little as one. That Christianity grew, after such a brief inception, into the world religion we know to today is testimony to the power of the message Jesus preached. But it is also due to a much simpler and often over-looked fact. He had more than a little help from his friends.', 66198, 3, 1185027, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185029, 'Peter the Rock', 'Peter is remembered by Christians as a saint; the fisherman who became the right-hand-man of Jesus himself, the leader of the early church and a Father of the faith. But how much of his fascinating story is true? How much do we know about the real Peter?', 66198, 4, 1185029, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185022, 'Joseph and his Multi-coloured Coat', 'The story of Joseph is one of the best known tales in the Bible. The events of Joseph''s life are also found in the Torah and the Qur''an. Today it is perhaps most associated with the West End and Sunday school. Written down by scribes about 1000 years after the events supposedly took place, it is often thought that the story may have some historical tradition, but with a healthy portion of dramatic license. Egyptologists, however, have uncovered some intriguing evidence.', 66198, 5, 1185022, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185021, 'Joshua and the Battle of Jericho', 'Joshua and the walls of Jericho is one of the most violent stories of the Bible. An army of nomads emerges from the desert and destroys a heavily fortified city... not by force, but by faith. The story of how Joshua destroyed Jericho using only trumpets is one of the Bible''s most memorable, and most dramatic.', 66198, 6, 1185021, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185025, 'Herod and the Bethlehem Massacre', 'The Romans appointed King Herod as King of Judea in 37 BC. Historians agree that, in many respects Herod had a hugely successful reign. King Herod an ethnically Arab but practicing Jew increased the land he governed from Palestine to parts of modern Jordan, Lebanon and Syria constructing fortresses, aqueducts and amphitheatres and earned him the title ''Herodes Magnus'', Herod the Great.', 66198, 7, 1185025, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185024, 'David and Goliath', 'The legendary battle between the over-grown Philistine warrior Goliath and the humble shepherd boy David is an archetype which has resonance well beyond the Old Testament account. Whenever a lower division football club thwarts a premier squad in a giant-slaying encounter it is celebrated as a ''David and Goliath'' event. The defiant courage of the underdog appeals to our deep-seated emotional need to witness the powerless turning the tables, for once, on the powerful.', 66198, 8, 1185024, 76198, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185028, 'The Revelation: The End of the World?', 'The Book of Revelation, the last book of the Bible, has fascinated and puzzled Christians for centuries. With its vivid imagery of disaster and suffering - the Battle of Armageddon, the Four Horsemen of the Apocalypse, the hideous Beast whose number is 666 - many have seen it as a map to the end of the world. Some say it predicts global warming, AIDS and even the Chernobyl nuclear disaster. But Biblical scholars, having studied the text and the social and political history of the time, have a different interpretation.', 66198, 9, 1185028, 76198, null);
