INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185053, 'A Dark Overture', 'In 2006, the body of the girl Tair Rada was found in the bathroom stall at the school where she studied. Days later, the police arrested a suspect - Roman Zadorov, and after a week of intense interrogation he admits and restores the murder. However, even after he was convicted three times, many still believe in his innocence. The series explores the length and breadth provision and leaving no stone unturned in an attempt to complete the picture of the puzzle, exposing new and dramatic discoveries. Through a complex mosaic of interviews, photographs and cinematic touch with the extensive use of inquiry and archives, the show tries to fathom the overwhelming truth.', 66201, 1, 1185053, 76202, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185055, 'The Scapegoat', '', 66201, 2, 1185055, 76202, null);
