INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185058, 'Blind Date', 'Psychology Professor Jackson Cooper Coop encounters a beautiful mystery woman, Natalie, he thinks could be his soulmate. After she disappears without giving Coop her full name or number, his best friend Carter tries to help him locate her.', 66202, 1, 1185058, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185113, 'Love Me Tinder', 'Coop and Carter resort to social media to find Natalie, while his nosy neighbor Diane disapproves of their tactics. Carter helps Diane''s nephew, Shadrach, with a personal problem. Coop''s assistant, Sophie, hires an event planner.', 66202, 2, 1185113, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185114, 'Private Dick', 'Coop makes a last ditch effort to find Natalie using a private detective with questionable methods. Carter and Shadrach do some damage control when they break Coop''s television.', 66202, 3, 1185114, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185115, 'In a Pickle', 'Coop''s latest hookup, Amy, becomes more than he can handle when she keeps turning up unexpectedly. Carter finds himself in a jam.', 66202, 4, 1185115, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1185116, 'British Invasion', 'Coop gives dating advice to a hapless British colleague and relationship advice to Sophie. Carter adopts a ferret. Coop spots Natalie.', 66202, 5, 1185116, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189581, 'Retreat', 'Coop and Sophie go to a psychology dept. retreat at the home of the dept. head, Dr. Harty, who also happens to be Scarlet''s father. Carter returns to his childhood home and is forced to juggle his overbearing mother, Kitty, and his first love, Holly.', 66202, 6, 1189581, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189582, 'Strange Bedfellows', 'After a wild night, Coop and Carter both wake up with unwanted company. Coop''s colleagues question his odd behavior. Carter tries to settle things with his high school sweetheart.', 66202, 7, 1189582, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193207, 'Bullies', 'Carter hires Holly''s sister Zoe to assist him with his latest project, his memoir. Shadrach has a run in with a bully. Coop tries to take his therapist, Ira''s advice and put his past to rest by squaring things with his ex-fiance, Lisa.', 66202, 8, 1193207, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193208, 'Identity Crisis', 'After an unexpected development in her personal life, Sophie gets drunk at work on the day of the department gala. Coop rushes to cover for her and in the process encounters the event planner, Natalie.', 66202, 9, 1193208, 76203, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193209, 'Chaos & Contentment', 'Coop and Natalie attempt an actual date, but when they return to Coop''s apartment all hell breaks loose. Carter loses Zoe. Sophie needs help working things out with Jeremy, and Diane goes into labor.', 66202, 10, 1193209, 76203, null);
