INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186222, 'Episode 1', 'When the DNA of a boy who went missing in 1995 is discovered at a murder scene, the lives of four friends are turned upside down in a desperate search to solve the unsolved mystery from their past.', 66238, 1, 1186222, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186454, 'Episode 2', 'Danny brings in a suspect that could lead him to Jesse and calls on Mark for help, but he is shocked when a horrifying new lead lands at his door.', 66238, 2, 1186454, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186455, 'Episode 3', 'A shocking discovery is made by Danny and Ally and they wonder just what kind of a man Jesse could have become.', 66238, 3, 1186455, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186456, 'Episode 4', 'Pru attempts to help Mark look for information and ends up discovering some dark secrets. Danny and Ally feel perplexed after they find another body.', 66238, 4, 1186456, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186457, 'Episode 5', 'Slade’s life is turned upside down when he receives some devastating news. Danny insists that Mark leave the investigation
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186458, 'Episode 6', 'Mark’s head is sent into a spin when Slade reveals a very dark secret. Danny makes a breakthrough in the case after finding some missing evidence but is forced to question his own part in Jesse’s disappearance when he receives a few home truths.', 66238, 6, 1186458, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186459, 'Episode 7', 'Julie and Alan''s relationship is put to the test after they are burgled, while Danny is forced to make a difficult decision in order to save his marriage. ', 66238, 7, 1186459, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186460, 'Episode 8', 'Pru puts herself in danger when she hits rock bottom and finally realises it’s time to sort out her life before it’s too late. Elsewhere, Mark is unnerved when he comes face to face with the evidence that will finally reveal the truth about Jesse’s disappearance.', 66238, 8, 1186460, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186461, 'Episode 9', 'Danny and Mark go it  alone. But just as they think they''re getting close to the truth, Mark  discovers some devastating news that makes him question everything.', 66238, 9, 1186461, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186462, 'Episode 10', 'Mark prepares to finally face up to the truth about Jesse.', 66238, 10, 1186462, 76355, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186264, 'A Girl Born In Prison', 'A pregnant woman is chased by a man who tries to kill her and the baby. Without knowing the details, Ji Chun Deuk, the treasurer of Jeonokseo happens to take care of the baby girl whose mother dies as soon as she gives birth to her. This girl grows up in the prison with the name Ok Nyeo.', 66240, 1, 1186264, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186265, 'Yoon  Won Hyung''s Daughter', 'Ok Nyeo is invited to tell Yoon Won Hyung and Jung Nan Jung’s fortune and receives silk clothes in return. On her way back to Jeonokseo, she gets kidnapped by Mount Daedeok bandits. They take her for Lord Yoon’s daughter and plan to save their leader who is due to be executed soon.', 66240, 2, 1186265, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189661, 'Who Is My Mother?', 'Ok Nyeo happens to help a female prisoner switch herself with someone else who would do anything for money. It turned out to be an old lady, and during their mission, Ok Nyeo hears about why she was born in Jeonokseo and how her mother died.', 66240, 3, 1189661, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189662, 'An Envoy from Ming', 'Although Ok Nyeo applied to become a warden at the Police Bureau, she fails because she''s overqualified. While she’s thinking of becoming a spy instead, an envoy from Ming arrives and announces that he will have to get to the bottom of how and why the former king died.', 66240, 4, 1189662, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189663, 'Become A Spy', 'Ok Nyeo is visited by the Chief of the Police Bureau and asked to decide if she wants to become a spy. She undergoes a series of training to become skillful enough to complete a mission. Meanwhile, Tae Won works towards his goal of taking revenge on Jung Nan Jung, and Queen Munjeong personally asks Tae Soo to accept her deal.', 66240, 5, 1189663, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189665, 'Ok Nyeo''s First Mission', 'After passing the final test, Ok Nyeo officially becomes a spy. Kang Sun Ho assigns her a mission, which is to steal the letter from Oh Jang Hyun. On her mission, she encounters two people, Tae Soo and Tae Won. Tae Soo is surprised to find out she is in the same mission as him, and becomes worried about her safety.', 66240, 6, 1189665, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194792, 'A Spy Dosen''t Demand Reasons', 'Ok Nyeo and Tae Soo’s mission to assassinate the envoy and to steal the letter is carried out. However, Yoon Won Hyung has an ulterior motive, which is more important than killing the envoy. When Ok Nyeo barely makes it back to Joseon, she is arrested and requested to admit to all the charges brought against her because she is a spy.', 66240, 7, 1194792, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206277, 'Episode 13', '', 66246, 13, 1206277, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194793, 'Back In Prison', 'Ok Nyeo is transferred to the Capital District Office Prison as a felony. Everyone, including Tae Won, is trying to find out why she’s imprisoned and how they can help her but it seems that everything is kept secret. Meanwhile, the reason why Tae Won yearns to take revenge on Jung Nan Jung is revealed.', 66240, 8, 1194793, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194794, 'A Hunt For Ok Nyeo', 'With the help of Ki Choon Soo, Ok Nyeo hides in a secret and safe place. But the words get out, and Lord Yoon is informed of her whereabouts. Queen Munjeong sees how desperate her brother is to conceal the truth, so she continues to look into the death of Park Tae Soo.', 66240, 9, 1194794, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194795, 'Queen Dowager''s Order', 'Tae Won takes Ok Nyeo to a safe place as she’s still on the run. Lord Yoon tries his best to catch her while Queen Munjeong is also trying to meet with her. Ok Nyeo is caught in the end and is taken to the Palace and tells the Queen everything that happened.', 66240, 10, 1194795, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197987, 'In And Out Of Jeonokseo', 'After listening to Ok Nyeo, Queen Munjeong order that Ok Nyeo be pardon and Yoon Won Hyung to be removed from all his posts. Tae Won and Ok Nyeo plan to use this chance to get back at Jung Nan Jung, and another incident occurs inside Jeonokseo.', 66240, 11, 1197987, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197988, 'A Treasonous Plot', 'To turn the table around, Jung Nan Jung spreads a false rumour that Lee Myung Woo and the people he bribed were trying to plot treason. Lord Yoon is released from Jeonokseo to take care of the incident, and Tae Won, the last person Lee Myung Woo met before he died, is taken to the Police.', 66240, 12, 1197988, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197989, 'Who Gave You the Order?', 'As soon as Gong Jae Myung is released, he goes to Lord Yoon and tells him that Tae Won is his illegitimate son and that he is being interrogated at the Police Bureau because of the frame set up by Jung Nan Jung. Meanwhile, someone is trying to kill Myung Seon to get rid of the evidence that they attempted to murder the Anguk-dong lady.', 66240, 13, 1197989, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197998, 'Make A Crack', 'The lady in Anguk-dong dies in the end, which makes Tae Won and Ok Nyeo furious. Moreover, Nan Jung receives the Revered Lady title from Queen Munjeong and becomes Lord Yoon’s official spouse. While the whole country is starving due to the famine, Nan Jung’s grain storage is the only thing that is full. Tae Won and Ok Nyeo are planning to use this as a chance to get back at Nan Jung and Lord Yoon.', 66240, 14, 1197998, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197999, 'The Bait', 'To get rice to feed the prisoners in Jeonokseo and to save the poor suffering from the famine, Ok Nyeo and her people gather the ideas to swindle Jung Nan Jung. They throw the bait at her, using her greed, and it seems like she has taken it. Meanwhile, Ji Heon realises that he was adopted and tries to listen to what Ok Nyeo has to say about his birth parents.', 66240, 15, 1197999, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198000, 'Ok Nyeo''s Plan Works', 'Ok Nyeo’s plan to con Jung Nan Jung doesn’t seem to be working out in the beginning when Jung Nan Jung locks up Woo Chi and tortures him. However, with the help of Woo Chi’s friends, the team succeeds eventually. The prisoners in Jeonokseo are able to eat fully after a long time.', 66240, 16, 1198000, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198001, 'Salt Supply Auction', 'To make Jeonokseo run smoother, Ok Nyeo comes up with another great plan: making prisoners work to provide salt. An auction to supply to the Price Policy Division is scheduled. However, Jung Nan Jung’s organisation has been supplying salt exclusively. Will Ok Nyeo and Tae Won be able to compete against her and succeed?', 66240, 17, 1198001, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198002, 'Winning The Bid', 'As soon as she finds out Lord Yoon had been seeing Tae Won, Jung Nan Jung becomes furious and tries to beat Tae Won at the salt supply auction at all costs. She hires men to find out how much Sir Gong’s bidding price will be and offers an unbeatable price despite a huge loss that would be incurred later on, just to beat Tae Won.', 66240, 18, 1198002, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198003, 'The Secret Ledger', 'To come between Tae Won and Lord Yoon, and to take revenge on Sir Gong, Lady Jung steals the secret ledger of Jeonokseo. Officer Sung cannot refuse to carry out the investigation because of the evidence given to him. Ok Nyeo, Chief Jung, Tae Won and Sir Gong will have to stand a trial for bribing each other.', 66240, 19, 1198003, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198004, 'The Trial', 'Lady Jung realises she should have gotten rid of Ok Nyeo a long time ago. She asks Lord Yoon to make her become a slave in return for setting Tae Won free. Meanwhile, Ok Nyeo’s friends are so worried she might become a slave that they plan to help her escape. However, she doesn’t want to inconvenience others who are left behind, hence she stands the trial.', 66240, 20, 1198004, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198005, 'Ok Nyeo Is Sent Away', 'Despite Ji Heon’s effort, Ok Nyeo is sent away to a provincial office as a slave as Lord Yoon and Lady Jung wanted. Although Tae Won and Jae Myung are released, Tae Won becomes furious to hear Jae Myung made a deal with Lady Jung, and leaves the organisation. Deeply heart-broken, Ok Nyeo’s friends try to come up with a plan to save Ok Nyeo from becoming a slave.', 66240, 21, 1198005, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217521, 'Ok Nyeo Alive Or Dead?', 'On her way to Haeju with other prisoners, Ok Nyeo’s group gets attacked and kidnapped by a gang of bandits on Mount Chilsung. The news is heard in Hanyang, which makes everyone think that Ok Nyeo is dead. However, she manages to free herself and the other girls from the bandits on their way to Yongdae Dock, right before they are sold to the Ming slave traders.', 66240, 22, 1217521, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217522, 'Lord Yoon Tae Won', 'k Nyeo finds out that she may have to be a slave that entertains officials in Haeju. Ji Heon and Ok Nyeo try to come up with a plan to find a way out. Meanwhile, Lord Yoon wakes up and apologises to Tae Won for all the wrong things he did. He offers to ally with Tae Won to keep Nan Jung in check together.', 66240, 23, 1217522, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217523, 'Sung Ji Heon, Park Tae Soo''s Grandson', 'Ji Heon and Ok Nyeo go on a trip together to look for what Tae Soo left for his grandson. Meanwhile, to exercise his authority as Chief of Price Policy Division, Tae Won attacks Sung Hwan Ok, the richest man in Kaesong. An unfortunate event occurs, which puts Ok Nyeo, Ji Heon and Tae Won in a very complicated relationship altogether.', 66240, 24, 1217523, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217524, 'Book Of Changes', 'To pray for a good year ahead for fishermen, a ritual ceremony is to be held at Haeju. Ok Nyeo does not miss her chance and thinks of a way to get out of servitude. Meanwhile, Tae Won persuades Nan Jung that he has moved on from wanting to take revenge on her to wanting to make up.', 66240, 25, 1217524, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217525, 'Back In Hanyang', 'Ok Nyeo finally makes her way back to Hanyang as a clerk at Sogyeokseo. Everyone who adores her are happy to see that she’s well, however, Ok Nyeo is deeply disappointed to see how Tae Won has become an official with Lord Yoon’s power. This makes Ok Nyeo feel that she and Ji Heon now share the same goal.', 66240, 26, 1217525, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217526, 'Paper and the State Exam', 'Tae Won plans to take over the paper market in order to secure the funds as per the Queen Dowager’s request. Ok Nyeo and Ji Heon stand at the opposite side of the plan. With Ok Nyeo’s acquaintance with King Myeongjong, they are about to make Lady Jung and Tae Won suffer from a huge loss.', 66240, 27, 1217526, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206278, 'Episode 14', '', 66246, 14, 1206278, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206279, 'Episode 15', '', 66246, 15, 1206279, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206280, 'Episode 16', '', 66246, 16, 1206280, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206281, 'Episode 17', '', 66246, 17, 1206281, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1214481, 'Episode 18', '', 66246, 18, 1214481, 76374, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217527, 'Privy Purse and Plague', 'Tae Won struggles to win the favour of Queen Munjeong and to make up for the loss incurred by buying up too much paper. On the other hand, to secure the authority Queen Munjeong holds, Lady Jung plans something in secret. Suddenly, a disastrous plague sweeps the nation and what the commissioner of Sogyeokseo once said about Lady Jung comes to Ok Nyeo’s mind.', 66240, 28, 1217527, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217528, 'The Plague', 'A horrible plague breaks out from a village, which puts everyone in fear. Tae Won and Lord Yoon find out that Nan Jung and the Queen Dowager were behind this fake epidemic to make money. While Ok Nyeo and her friends are looking into the truth behind this incident, Ok Nyeo becomes kidnapped, and Tae Won realises that he should stop doing something he’d regret later.', 66240, 29, 1217528, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217529, 'The Truth Unveils', 'The truth behind this horrible plague unveils through Ok Nyeo and Chun Doong’s words. The words get to as far as the King, which made him furious with Lord Yoon, Lady Jung and the Queen Dowager. Meanwhile, saved by Tae Won, Ok Nyeo meets the King’s court lady and hears more about her mother, Ga Bi.', 66240, 30, 1217529, 76358, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217530, 'The Art of Negotiation', 'A horrible plague breaks out from a village, which puts everyone in fear. Tae Won and Lord Yoon find out that Nan Jung and the Queen Dowager were behind this fake epidemic to make money. While Ok Nyeo and her friends are looking into the truth behind this incident, Ok Nyeo becomes kidnapped, and Tae Won realises that he should stop doing something he’d regret later.', 66240, 31, 1217530, 76358, null);
