INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186521, 'Episode 1', 'After witnessing a gangland killing, flatmates Leanne and Rhona are placed in witness protection. Leanne leaps at the chance to create an extravagant alter-ego whilst Rhona is determined to get back to her old life. After Leanne’s ‘acting’ threatens to blow their cover Rhona decides to take matters into her own hands.', 66245, 1, 1186521, 76371, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186536, 'Episode 2', 'The girls need to get Leanne’s bag back from criminally connected Patrick’s house. But discovering a closely guarded secret of Patrick’s leads Leanne to become more deeply involved. Meanwhile, there’s a seedy secret in the police force and the girls might not be as well protected as they think.', 66245, 2, 1186536, 76371, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186537, 'Episode 3', 'After arousing the suspicions of their scary neighbour Jackie, Rhona enlists Leanne’s help to blend in on the estate. But their attempts to win Jackie over backfire, forcing the girls into a series ofincreasingly uncomfortable lies. DJ Sound as F*** makes a discovery that could lead him to the girls and Sergeant Forrest gets an unwanted houseguest.', 66245, 3, 1186537, 76371, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186538, 'Episode 4', 'Patrick contacts Leanne out of the blue but Rhona is insistent that she cuts all ties with her former lover. Meanwhile, their nosey neighbour, Jackie, overhears something that could lift the lid on their double life. In Bristol, the police re-examine Mrs Hobbs’ murder case and Sergeant Forrest comes under pressure to reveal the whereabouts of the girls.', 66245, 4, 1186538, 76371, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186539, 'Episode 5', 'The net is closing in on Leanne and Rhona… Will Forrest lead the gang to the girls? Will Appraisal crack under pressure from the Police? Could the discovery of the murder weapon be the girls’ ticket home? Series finale.', 66245, 5, 1186539, 76371, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1260295, 'Episode 1', 'Can Leanne’s dubious acting skills help her and Rhona escape hitman Benny?', 66245, 1, 1260295, 84323, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261688, 'Episode 2', 'Leanne and Rhona wake up to find themselves hurtling full speed down the motorway...', 66245, 2, 1261688, 84323, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261689, 'Episode 3', 'Rhona and Leanne find out the truth about Patrick’s shady criminal connections.', 66245, 3, 1261689, 84323, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261690, 'Episode 4', 'Rhona and Leanne hatch a daredevil plan to get out of Witness Protection.', 66245, 4, 1261690, 84323, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261691, 'Episode 5', 'Nail-biting series finale. Can Leanne and Rhona pull off their plan and get out alive?', 66245, 5, 1261691, 84323, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1418416, 'Episode 1', 'Leanne and Rhona''s gung-ho attempt to frame Willy Whelan backfires leaving Rhona trapped with One-Pack closing in. Leanne is cornered by DJ Sound as F*** and Patrick''s secret is uncovered.', 66245, 1, 1418416, 97810, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1418417, 'Episode 2', 'Leanne is flourishing in her new "Wit-Pro" identity as an estate agent, but Rhona is doing less well. A chance meeting leads to an emotional reunion. Patrick sinks deeper into a life of crime.', 66245, 2, 1418417, 97810, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1418418, 'Episode 3', 'The girls turn sleuths, tracing the rival Bristol gang to a kebab shop. They put on a good cop/bad cop act to trick them into bumping off Willy Whelan. But these hardened gangsters aren''t all they seem.', 66245, 3, 1418418, 97810, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1418421, 'Episode 4', 'Leanne and Rhona need to lure Willy to their fake Tudor banquet so that Baz can kill him. Unbeknown to them though some leaked information means their plan is even riskier than thought.', 66245, 4, 1418421, 97810, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1418424, 'Episode 5', 'The ambush leaves the girls trapped as the building burns around them. Has Willy triumphed in this final stand-off? Will Patrick betray his ex-love Leanne? Will DJ Sound as F*** meet a grim fate?', 66245, 5, 1418424, 97810, null);
