INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186595, 'Pilot', 'American Grit contestants will be mentored by "The Cadre," made up of military members who, along with Cena, will push their civilian charges throughout the competition. The Cadre consists of: Navy Seal trainer, Rorke Denver; Purple Heart recipient, U.S. Army veteran Noah Galloway; Veteran U.S. Marine Gunnery Sergeant, Tawanda “Tee” Hanible; and U.S. Army Ranger sniper, Nick “The Reaper” Irving.', 66247, 1, 1186595, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187690, 'Ice Cubed', '', 66247, 2, 1187690, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189373, 'Moving Camp', '', 66247, 3, 1189373, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190727, 'Charlie Foxtrot', '', 66247, 4, 1190727, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196040, 'Double Time', 'Survival skills, decision making and teamwork are tested as the contestants create shelter, purify water and build a fire in their next challenge.', 66247, 5, 1196040, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196042, 'Squat Till You Drop', 'The competitors face a test of strategy and teamwork as they are challenged to cross a 60-yard field without touching the ground with their feet.', 66247, 6, 1196042, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196043, 'Dawn Patrol', '', 66247, 7, 1196043, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197368, 'Barricade the Bunker', '', 66247, 8, 1197368, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198672, 'Tired Out; Over the Falls', '', 66247, 9, 1198672, 76375, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1326174, 'Find Your Grit', '17 new competitors head to Hampton Island, Ga., where the Cadre will be divide into two teams as the competition begins.', 66247, 1, 1326174, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1326175, 'Cena Does the Dishes', 'The first team challenge arrives and the winning cadre leader selects three rival contestants to do battle in the individual elimination challenge, with one contestant going home.', 66247, 2, 1326175, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1326176, 'Liar Liar', 'The cadre appoint team captains, who lead their teams in a boat race while their teammates are blindfolded. Later, one contestant makes a shocking revelation; host John Cena surprises one competitor with a heart-felt field trip; and three rival contestants face off in the elimination challenge.', 66247, 3, 1326176, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1333376, 'Secrets Are Revealed', 'WWE(R) Superstar John Cena(TM) and The Cadre prepare the contestants for their next challenge that will test their teamwork, as they are tasked with a foot race in the muck, roped waist to waist. More important than speed, this challenge will test their ability to work together as a unit because the first team to cross the finish line still intact will be safe from elimination. The winning Cadre leader will then select three competitors from the losing teams to face off in this week''s double elimination. With something to prove and a quarter of a million dollars at stake, they must either wipe their tears and step up or "ring out".', 66247, 4, 1333376, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1336599, 'Camp Love', 'The week''s challenge is all about love and priorities, testing each team''s strategic skills as they have to choose which prize puzzle they will solve. Meanwhile, two contestants get closer to each other, making the elimination challenge that much more complicated.', 66247, 5, 1336599, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1338162, 'Selfish Vs. Selfless', 'Contestants must race to an array of boxes and choose between helping themselves or helping their teams. While certain outcomes may be beneficial for some, others are worried about change, causing drama between both the contestants and the cadre. With a double elimination challenge ahead, everyone must be strategic, but doing so causes the claws to come out.', 66247, 6, 1338162, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1340606, 'Role Reversal', 'After an upsetting elimination challenge, WWE(R) Superstar John Cena(R) and The Cadre agree that the contestants need some tough love and must improve upon their leadership skills. The challenge offers a surprising twist in that for the first time, the cadres will be competing for their team and the winning team''s contestants will choose who enters elimination. Back at camp, tensions rise as some feel betrayed by gossip being spread and at the elimination challenge, both a contestant and a cadre''s fate are at risk.', 66247, 7, 1340606, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1342798, 'Shady Grady', 'Changes in game play increase the stakes, especially with a double elimination on the horizon.', 66247, 8, 1342798, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1347199, 'Cena Says', 'The remaining contestants compete; the final four are revealed.', 66247, 9, 1347199, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1347200, 'Who''s Got Grit?', 'The remaining contestants compete for the grand prize, and the winner is revealed.', 66247, 10, 1347200, 89200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186604, 'The Adventure Begins', 'As baby Kong grows into a powerful ape, Lukas and his scientist father do all they can to protect him. But someone else wants Kong out of the picture.', 66248, 1, 1186604, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186828, 'Snake in the Grass', 'Lukas, Kong and friends race to save Anita''s niece from a giant anaconda, while Richard plots to turn the snake into a high-tech fighting machine.', 66248, 2, 1186828, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186829, 'Kong in 3D', 'When Kong is caught stealing diamonds on live TV, Lukas knows something fishy is going on. Can he uncover the truth and save his pal''s reputation?', 66248, 3, 1186829, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186830, 'Poacher''s Prize', 'As the team heads to Richard''s lab to rescue liger clones, Jonesy finds a way to make Kong invisible. But the camouflage keeps wearing off too soon!', 66248, 4, 1186830, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1875513, 'Episode 6', '', 66262, 6, 1875513, 107819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1875515, 'Episode 7', '', 66262, 7, 1875515, 107819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186831, 'King''s Ransom', 'Richard captures one of the team and lays a trap for the others. Kong must confront his biggest fear to save Lukas from a pair of nasty robo-sharks.', 66248, 5, 1186831, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186832, 'Little Bots Big Problems', 'In public, Richard plays the hero to set an evil new plan in motion. Danny and Panchi visit the island in disguise to find out what he''s up to.', 66248, 6, 1186832, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186833, 'Botila-Zilla', 'Kong and team scramble to hide from the police and come face-to-face with Richard''s latest creation: a robotic T. rex with the mind of Botila.', 66248, 7, 1186833, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186834, 'Bionic Arms Race', 'As Richard sells his biono-bots to armies around the world, Jonesy tries to hack into Botila''s system to uncover the grand plan.', 66248, 8, 1186834, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186835, 'Honey I Shrunk the Kong', 'A shrink-ray attack leaves a tiny Kong in the clutches of Richard and Botila. And this time, he can''t rely on his super strength to survive.', 66248, 9, 1186835, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186836, 'Kong on Ice', 'As the team races to stop an alarming new threat in the Arctic, Kong learns to fight on ice and Botila takes a defiant step.', 66248, 10, 1186836, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186837, 'Takeover', 'Botila turns the tables on Richard and picks up a disturbing new habit. Lukas and friends consider a surprising request.', 66248, 11, 1186837, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186838, 'Robosquitos', 'As Richard prepares to unleash a swarm of insects armed with sinister powers, Panchi''s birthday makes Kong curious about his own birth family.', 66248, 12, 1186838, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186839, 'Missing', 'While Jonesy and Amy deliver the antidote, Lukas and the kids search for Kong. Richard lures the team into a final showdown on the rim of a volcano.', 66248, 13, 1186839, 76376, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482913, 'The Primordial World Below', 'After falling into a volcano, Kong and pals end up in an underground world crawling with real dinosaurs! On Kong Island, Botila plots a revolution.', 66248, 1, 1482913, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482914, 'Lost Civilization … Found!', 'The gang braves geysers, stampedes and other nasty surprises to get to the temple, where they discover new clues to Kong''s past.', 66248, 2, 1482914, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482915, 'Emergence', 'At the other end of the tunnel, the team finds the giant creatures wreaking havoc in Egypt, and Richard learns he''s a wanted man.', 66248, 3, 1482915, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482917, 'Redemption', 'Happy to be seen as a hero again, Kong basks in the spotlight at a ceremony in New York. But when Botila shows up, the party turns into a showdown.', 66248, 4, 1482917, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482918, 'No Place Like Home', 'In need of a new home base, the team heads to Kong Island, only to find it overrun with mischievous monkeys and other bionobots.', 66248, 5, 1482918, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482919, 'Cave-In', 'Back at the temple, Danny and Zippi explore a secret tunnel while the others deal with a sudden cave-in. Botila meets her match in a ship''s computer.', 66248, 6, 1482919, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482920, 'Sky’s the Limit', 'Lukas helps rescue a stranded baby dino, the apes reveal what Danny''s key can do, and Botila puts her new powers to use -- in space.', 66248, 7, 1482920, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482921, 'Lab Rat', 'When Botila threatens to blow up Earth, Kong and pals blast off on a mission to disarm the satellite. But Jonesy ends up stuck on the wrong ship.', 66248, 8, 1482921, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482922, 'Rise of Evil', 'Fed up with Botila, the clones and bionobots stage a rebellion. While chasing Zippi, Kong is captured by a mysterious figure.', 66248, 9, 1482922, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1482923, 'Battle Royale', 'Following Kong''s signal back to Kong Island, Lukas and friends face off against a supersized enemy and get help from a surprising source.', 66248, 10, 1482923, 103372, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186889, 'Episode 1', 'Manahil is anxious for her exam result and visits her best friend and cosine Rabiya "Beya" to pay respects on Hazrat Shah Molana Muhammad Ruknuddin Naqshbandi tomb for her results. Rabiya''s brother Salahuddin who also tutor her, takes them to tomb.', 66255, 1, 1186889, 76400, null);
