INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1226237, 'Episode 1', 'Love in the Moonlight Special Part 1 briefly goes through what happens in the episodes 1 to 4. By watching this special, viewers would easily understand the characters and its settings if they haven''t watched it yet, and it can also be a nice opportunity for them to review the storyline. Stay tuned to catch up with how Young and Ra On get attracted to each other as they have their daily lives in the palace.', 66256, 1, 1226237, 80485, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1226238, 'Episode 2', 'Love in the Moonlight Special Part 2 briefly goes through what happens in the episodes 5 to 8. By watching this special, viewers will get an opportunity to review the storyline and enjoy the most popular scenes. Stay tuned to watch behind-the-scenes footage of Love in the Moonlight as well as the exclusive bloopers.', 66256, 2, 1226238, 80485, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186890, 'Moonlight Destiny', 'Ra On lives as a boy named Sam Nom in the capital, getting paid to help unrequited lovers find their path towards each other. Lee Yeong, the crown prince, is more interested in visiting the capital and playing hooky rather than focusing on his studies.', 66256, 1, 1186890, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186891, 'The Path to You', 'Ra On enters the palace as a eunuch, still living under the fake identity of Sam Nom. Although she tries her very best to get out of the palace, her plan fails every time.', 66256, 2, 1186891, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1218615, 'I''m Behind You', 'Ra On expected herself to be failed from the exam with reference to become the Eunich. However, owing to the decisive help from the crown prince, Ra On stays at the palace. The king decided to make Lee Yeong, the crown prince as his regent.', 66256, 3, 1218615, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252910, 'Hit My Heart', 'John agrees to write a pop song for Michelle''s dance competition. Rachel has a secret admirer. Isaac worries about a bad influence on his brother.', 66260, 5, 1252910, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1218791, 'After the Play Ends', 'Lee Yeong, the crown prince is in charge of the King''s 40th birthday and the reception for the Qing''s envoy. Furthermore, the crown prince invited Gisaengs from all of the country of the eight provinces and he started to create dance for the Gisaengs.', 66256, 4, 1218791, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219818, 'Tell Me Your Wish', 'Lee Yeong, the crown prince rescued Ra On from the deep pond. Ra On begged forgiveness to Lee Yeong. Furthermore, Mok Tae Gam from Qing requested unreasonable tribute to Joseon and Lee Yeong, the crown prince come into conflict with his father &amp; Kim Heon.', 66256, 5, 1219818, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219819, 'When I Want to Tell Untold Secrets', 'Lee Yeong, the crown prince feels confusing on Ra On as a maiden and  he intentionally treats her cold-heartedly. Ma Jong Ja takes Ra On to  Mok Tae Gam after hearing a news that he is looking for a soloist at the  play.', 66256, 6, 1219819, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219820, 'Confession', 'Lee Yeong, the crown prince and Ra On confuse themselves of their feeling. One day, the rumor go around about a relationship between a Eunich and a court lady. Ra On helps the people whom are involved in the rumor and she fall into danger.', 66256, 7, 1219820, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219821, 'You Don''t Know Anything', 'Lee Yeong, the crown prince starts to behave as a regent but he has  deeper conflict with Kim Heon regarding the Royal Examination. Ra On  suffers from not telling the truth of herself after the confession from  the crown prince.', 66256, 8, 1219821, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219822, 'The Moment the Door of My Heart Opened', 'Ra On has deeper thought of the words from the crown prince that he will treat her as a woman. This made Ra On to avoid the crown prince...', 66256, 9, 1219822, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1219823, 'Like a Fairy Tale', 'The King is agitated regarding the palace situation and he is hastening the marriage of crown prince in order to show strong force of the royal family.', 66256, 10, 1219823, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221552, 'A Promise', 'When checking the King''s meal, the silver spoon turns black and this goes to blame on child from lantern festival and her father. Owing to the help of Eunuch Do and Teacher Dasan, Lee Yeong reveals that the child and her father are innocent.', 66256, 11, 1221552, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221554, 'Faith Becomes Destiny', 'Ra On and her mother enjoy their reunion happily but this lasts only for a moment. Ra On''s mother feel confused after knowing that Lee Yeong is the Crown Prince.', 66256, 12, 1221554, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221555, 'Fondly, Goodbye', 'Ra On overhears the talks between her mother and Teacher Dasan and she gets to know that she is the daughter of Hong Gyeong Nae. Thus, Ra On tries to organize the last moment with Lee Yeong, the crown prince and she leaves the palace.', 66256, 13, 1221555, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221556, 'Misty Road', 'Kim Heon is looking for Ra On who is a daughter of Hong Gyeong Nae and his group gets closer to find out who it is. There are rumors go around that Hong Ra On was the spy of the East Palace attack and this is conveyed to Lee Yeong, the crown prince.', 66256, 14, 1221556, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221558, 'Lies That Seem Like The Truth', 'Kim Heon and his group are trying to seize Ra On so they keep chasing whereabout. Lee Yeong, the crown prince is about to marry with crown princess. Lee Yeong, the crown prince and Ra On try to abandon their love for each other.', 66256, 15, 1221558, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221559, 'The World That You Dream Of', 'On a wedding day, Hong Gyeong Nae appears and it makes everyone shocked. Lee Yeong, the crown prince feels complicated by seeing his lover''s father who is a traitor. Ra On also feels complicated by seeing her mother''s dedicated love for her father.', 66256, 16, 1221559, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221561, 'The End for the Beginning', 'Lee Yeong, the crown prince is in shock due to the fact that Byeong Yeon is the member of White Clouds Society. Without Byeong Yeon, the crown prince traces the real culprit of east palace attack to find out the truth behind the case.', 66256, 17, 1221561, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221564, 'Moonlight Drawn By Clouds', 'Lee Yeong, the crown prince collapses after drinking potion and he can see Ra On in his dream. However, when he comes around, he can see Ha Yeon. On the other hand, there is a rumor going around that the crown prince is in a critical condition.', 66256, 18, 1221564, 76401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186931, 'Episode 1', 'Billy Connolly travels from Chicago to Seattle aboard the mighty "Empire Builder" train. He stops off to witness a true slice of Americana at the Minnesota State Fair, where giant butter sculptures are among the attractions.', 66258, 1, 1186931, 76404, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186932, 'Episode 2', 'In Oregon, Billy visits a vegetable farmer who has switched to growing cannabis. His next stop is the world''s largest and probably loudest elephant seal rookery. He also meets U.S. border guards in Arizona and visits a nuclear missile silo,', 66258, 2, 1186932, 76404, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186933, 'Episode 3', 'Billy travels from San Antonio Texas and up the soulful Crescent Route to New York. Kicking off in a spectacular fashion - a Friday night in Texas, which can mean only one thing: football.', 66258, 3, 1186933, 76404, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186948, 'Chapter 1: The Beginning', 'Cousins Jeff and Sharee discover a time-traveling bong and get stuck bouncing around the space-time continuum.', 66259, 1, 1186948, 76407, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186950, 'Chapter 2: The Middle', 'Jeff and Sharee attempt to free some slaves and kidnap a young Michael Jackson.', 66259, 2, 1186950, 76407, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186951, 'Chapter 3: The End...?', 'Jeff and Sharee go to an orgy in ancient Greece and are also flung into the future.', 66259, 3, 1186951, 76407, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186958, 'Lost & Found', 'A party is thrown for the graduates going on tour, And somebody gets the wrong idea when their crush preforms a love song written by another band member.', 66260, 1, 1186958, 76408, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186959, 'See Through Me', 'Leia is miffed when best friend Rachel''s song is picked over hers for use in the upcoming auditions. Eva helps Jude find a theme for his music video.', 66260, 2, 1186959, 76408, null);
