INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1186972, 'Callin'' Callin'' Part 2', 'Michelle has a uplifting conversation with Johns grandmother. The bands first gig, isn''t going as hoped.', 66260, 14, 1186972, 76408, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252906, 'Sweet Tarts', 'Maggie rejoins the girls'' band but refuses to accept Leia''s controlling ways. Mary coaches Theo to turn his mediocre song into a truly heartfelt one.', 66260, 1, 1252906, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252907, 'Rhythm in My Heartbeat', 'When Leia''s plan to fix Luke''s van backfires, she blames Rachel. Michelle creatively reveals her feelings to John. Eva rebels against her strict mom.', 66260, 2, 1252907, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252908, 'Wondering', 'Mr. T gives Eva''s mom blunt advice. John and Michelle struggle to understand each other. Family responsibilities interfere with Mary''s songwriting.', 66260, 3, 1252908, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252909, 'Take Control', 'Rachel gets an unexpected offer from a record label. Jude finds Clara difficult to work with. Luke''s opinions flow too freely during an interview.', 66260, 4, 1252909, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1875511, 'Episode 5', '', 66262, 5, 1875511, 107819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252911, 'How Far We''ve Come', 'Isaac takes drastic measures to keep Tully away from Lost &amp; Found, hurting Mary in the process. John and Michelle get bad advice from their friends.', 66260, 6, 1252911, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252912, 'Last Shot', 'A competition requires the girls'' band to swap a member with the boys'' band. Against Parker''s advice, Jude auditions for a commercial.', 66260, 7, 1252912, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252914, 'Take You There', 'Annabelle taps Nate''s talent for making ringtones that match an individual''s personality. Thoughts of Tully distract Mary from an important audition.', 66260, 8, 1252914, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252915, 'Let It Go', 'Leia tries to make Luke jealous. When Rachel unknowingly leaks her song online, her record label has a surprising reaction. John worries about Clara.', 66260, 9, 1252915, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252916, 'Falling for You', 'Longing to experience her first kiss, Eva seeks Jude''s advice. Rachel adjusts to her new BFF. Luke asks Theo to distract him from thoughts of Leia.', 66260, 10, 1252916, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252917, 'Call My Name', 'Annabelle devises a plan to bring harmony back to the girls'' band. When Mary tries to cheer Isaac up on his birthday, he makes a confession to her.', 66260, 11, 1252917, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252918, 'You Could Have it All', 'When Clara cracks under her own pressure to perfect some demos for Music Week, John draws on a painful experience to help her. Eva tries a new look.', 66260, 12, 1252918, 83496, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1252919, 'The Sound of Change', 'When Maggie gets good news, Theo reacts oddly. Convinced he made things worse for Clara, John pushes Michelle away. Luke gives Leia a surprise.', 66260, 13, 1252919, 83496, null);
