INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187199, 'Episode 1', 'While arranging a surprise 40th birthday party for his beloved wife Bex, Murray hears that she is leaving him. He desperately tries to find her and to cancel the party - but it is too late.', 66280, 1, 1187199, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187200, 'Episode 2', 'Murray tries to persuade Bex that a holiday is just what they need to repair their relationship, but she leaves him heartbroken at the airport. The couple try to hide the truth from their families with unexpected results.', 66280, 2, 1187200, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187201, 'Episode 3', 'Murray goes to great lengths to see Bex, but she is not best pleased when she finds out what he''s been up to.', 66280, 3, 1187201, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187202, 'Episode 4', 'Bex agrees to go for dinner with Murray at Lorenzo''s, the restaurant where he proposed.', 66280, 4, 1187202, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187371, 'Episode 5', 'Bex moves in with her sister Keeley whilst Murray makes a big decision about his future.', 66280, 5, 1187371, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187372, 'Episode 6', 'Murray decides that he needs to give it one last push with Bex.', 66280, 6, 1187372, 76446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187224, 'No Place Like Camp', 'When Mr. McMahon discovers John Cena misses home, he enlists his counselors to help prevent a camp-wide outbreak of homesickness.', 66281, 1, 1187224, 76449, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189946, 'Not Without My Eyebrow', 'Panic ensues after someone shaves off The Rock’s eyebrow and Ric Flair is tasked with helping The Great One regain his mojo.', 66281, 2, 1189946, 76449, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189947, 'Survival Weekend', 'Sgt. Slaughter drags campers away for a Survival Weekend while Mr. McMahon''s favorite weekend of the year turns into a nightmare.', 66281, 3, 1189947, 76449, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189948, 'Vince Is Just Not That Into You', 'Triple H takes Mr. McMahon out on a date to win his approval while John Cena and Mark Henry team up to welcome an unexpected addition to Camp WWE.', 66281, 4, 1189948, 76449, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189949, 'A Family McMahon', '"Stone Cold" Steve Austin''s pranks drive Mr. McMahon to quit while Nikki Bella must refine Bray Wyatt so he doesn''t ruin the annual Camp WWE dance.', 66281, 5, 1189949, 76449, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1590943, 'A Tale of Two Cenas', 'Cena wishes upon a star for help at camp while Big Show discovers he and Mr. McMahon share an embarrassing secret.', 66281, 1, 1590943, 110582, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1590944, 'The Ultimate Councillor', 'Triple H''s dad arrives at camp posing the greatest threat ever to Mr. McMahon while Austin runs away in search of the Ultimate Warrior', 66281, 2, 1590944, 110582, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1590945, 'Blackjack Beauty', 'Brie befriends a horse in military training while other campers discover the magic of the pool jets.', 66281, 3, 1590945, 110582, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1590946, 'The Truth Hurts', 'R-Truth''s dreams of becoming a hip hop superstar are realized while Mr. McMahon realizes an assassin is on the hunt to get him.', 66281, 4, 1590946, 110582, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1590947, 'Deep Slaughter', 'Mr. McMahon descends into madness when he''s haunted by ghosts while Cena and Nikki investigate some strange disappearances at the camp.', 66281, 5, 1590947, 110582, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187241, 'Station to Station', 'CIA Officer Daniel Miller arrives in Berlin on a clandestine mission to unearth an anonymous whistleblower, alias Thomas Shaw, and reunites with his old friend Hector DeJean. As Daniel gets closer to Shaw, his quarry reacts in murderous fashion.', 66282, 1, 1187241, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1221935, 'Lights Don''t Run on Loyalty', 'As Daniel pursues Shaw, Station Chief Steven Frost and his associates Valerie Edwards and Robert Kirsch gather intelligence on a Georgian Islamic radical in order to avoid an extraordinary rendition by Langley. By episode’s end, Hector surprises us all.', 66282, 2, 1221935, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1235719, 'Riverrun Dry', 'Frost and Kirsch worry their secrets will be unearthed when Langley investigators sweep Berlin Station to ferret out fodder for future Shaw leaks. Meanwhile, Daniel''s hunt for the mole is put at risk.', 66282, 3, 1235719, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237219, 'By Way of Deception', 'Daniel and Hector embark on a dangerous operation to track down Shaw. Meanwhile, Valerie finds out the truth behind Iosava, and Frost and Kirsch deliberate future plans for themselves and the rest of Berlin Station.', 66282, 4, 1237219, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237455, 'Unter Druck', 'Daniel teams up with Esther Krug of the BfV to prevent the next Shaw leak involving a foreign defector. Valerie and Robert spar over strategy as her investigation into Iosava gains traction; Hector gets a late-night visit from Shirley Pimple.', 66282, 5, 1237455, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237456, 'Just Decisions', 'Valerie''s investigation into Aleksandre and Ruth Iosava comes to a head in a German/American sting Operation involving Clare Itani, a CIA Officer and Hector’s lover. Langley''s unannounced participation moves things from bad to worse.', 66282, 6, 1237456, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237458, 'Proof of Life', 'Frost must pick up the pieces after the Iosava Operation goes sour while Robert explores a different angle. Hector goes rogue but brings Daniel with him, preempting a crucial moment of clarity.', 66282, 7, 1237458, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237459, 'False Negative', 'Repercussions from the Iosava debacle leave Frost in the shadows and the Station in disarray as Robert embraces a new role. Hector finds himself in the hot seat, Valerie reveals a secret of her own––and Daniel inches closer to the truth.', 66282, 8, 1237459, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237460, 'Thomas Shaw', 'The mystery of Shaw''s true identity finally solved, Daniel confronts his own conscience as he learns the origins of "Thomas Shaw"; Valerie’s suspicions about Robert further escalate rising tensions between them, and Kelly Frost suddenly becomes an integral part of the team.', 66282, 9, 1237460, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1237461, 'Oratorio Berlin', 'Daniel assembles the crew as they piece together the extent of Langley''s involvement in the Iosava rendition. Steven and Kelly Frost reunite against the odds; Hector pursues a new approach for his atonement – and the Thomas Shaw mantle is passed.', 66282, 10, 1237461, 76452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1353404, 'Everything''s Gonna Be Alt-Right', 'Under the direction of new Chief of Staff BB Yates, Daniel Miller, Robert Kirsch, Valerie Edwards and the rest of Berlin Station embark on an unsanctioned operation to uncover a possible Far Right terrorist attack.', 66282, 1, 1353404, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373379, 'Right Here, Right Now', 'In a 24-hour episode set completely in Spain, Daniel uses Hector to further his mission with Otto, much to Hector''s dismay.', 66282, 2, 1373379, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373648, 'Right to the Heart', 'Valerie works to obtain intel on the Far Right while Robert''s teenage son Noah arrives in Berlin and asks questions. Meanwhile, Frost agrees to the Ambassador''s request to spy on Berlin Station.', 66282, 3, 1373648, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373649, 'Do the Right Thing', 'BB Yates''s past is revealed while she juggles keeping Berlin Station''s Far Right operation covert or revealing it to Ambassador Hanes; Daniel discovers a lack of trust between Otto Ganz and his daughter.', 66282, 4, 1373649, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373650, 'Right of Way', 'The Station''s sting operation to catch the Far Right in an arms deal goes horribly awry, with Otto Ganz escaping. Meanwhile, Robert and Frost make plans to investigate the money trail behind the PfD''s nefarious dealings.', 66282, 5, 1373650, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373651, 'The Right Hook', 'Robert and Frost travel to Norway to investigate the illegal money trail leading to PfD; BB and Valerie devise a new plan involving a member of the Far Right; Daniel deals with the psychological consequences of his mission.', 66282, 6, 1373651, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373652, 'Right and Wrong', 'April weighs telling Robert about Hector''s assassination plot; Daniel tries to arrange safe passage out of Berlin for Hector with help from Esther.', 66282, 7, 1373652, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378024, 'The Righteous One', 'Hector is wanted by German authorities for the assassination of Katerina Gerhardt, but Berlin Station begins to discover there is more at play than a jaded ex-CIA officer.', 66282, 8, 1378024, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1378025, 'Winners Right the History Books', 'Berlin Station continues to search for the truth behind Katerina Gerhardt''s assassination and Nick Fischer''s role in it, as a protest outside the US Embassy and calls to turn Hector over escalate.', 66282, 9, 1378025, 91676, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1619869, 'Aut Concilio Aut Ense', 'Valerie Edwards sends Daniel Miller and Robert Kirsch on an urgent mission, where they meet renegade CIA Officer Rafael Torres, and uncover signs of a covert invasion.', 66282, 1, 1619869, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630233, 'Fire Knows Nothing of Mercy', 'Berlin Station follows up on the evidence Kirsch brought home from his mission, crystallizing their theory about a possible upcoming invasion.', 66282, 2, 1630233, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630234, 'The Old Lie', 'The Station enlists Rafael Torres to track down a missing comrade’s last known location, leading him to hostile territory. Kirsch visits an old friend Steven Frost.', 66282, 3, 1630234, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630235, 'If You Swear, You''ll Catch No Fish', 'Torres risks everything to bring a fallen comrade back to Berlin. April learns the true value of her asset’s medical tech, and works with Sofia to track down the troll farm spreading disinformation in Estonia.', 66282, 4, 1630235, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630236, 'The Dream of the Four Policemen', 'Kirsch and Torres follow a lead to Vienna, where they must risk their lives to secure their fallen comrade’s location. When B.B. Yates returns to Berlin, the Station must decide whether or not they can trust an emissary of the Oval Office.', 66282, 5, 1630236, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630237, 'In Cold Hell', 'B.B. and Valerie attempt to amass support for an intervention. April’s assets face deportation. A dangerous figure invites Hector and Torres into dangerous territory.', 66282, 6, 1630237, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630238, 'The Eye Fears When It Is Done to See', 'B.B. and Valerie attempt to amass support for an intervention. April’s assets face deportation. A dangerous figure invites Hector and Torres into dangerous territory.', 66282, 7, 1630238, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1630239, 'The Green Dacha', 'Daniel and Hector find themselves needing to escape a tricky situation to meet Frost for an exfil. Torres fights to maintain his cover and give his allies a leading edge.', 66282, 8, 1630239, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1703012, 'End of War', 'A powerful figure’s fall from grace makes way for his ruthless successor to take the reins Estonia, where a cyberattack has blacked out the entire country in advance of the ground invasion. In turn, all of Berlin Station must try to take him down.', 66282, 9, 1703012, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1709701, 'Book of the Fallen', 'Mere hours remain before enemy forces topple the Estonian government and reclaim the country for Russia. Without Langley’s backing, Berlin Station acts alone in one final desperate push to prevent the fall of a nation.', 66282, 10, 1709701, 111567, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1243851, 'Somebody''s Dead', 'A suspicious death at an elementary school fund-raiser exposes rivalries simmering beneath the superficial comity among some of the parents.', 66292, 1, 1243851, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261512, 'Serious Mothering', 'Madeline feels slighted by Renata and gets bad news about her community-theater production. Ziggy asks Jane why they moved to Monterey. Celeste tells Perry they should seek counseling. Nathan and Ed have a tense meeting about their wives.', 66292, 2, 1261512, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261513, 'Living the Dream', 'Hoping to get under Renata''s skin, Madeline organizes a trip to compete with Amabella''s birthday party. After another argument, Celeste succumbs to Perry''s charms before their first session with a therapist, Dr. Amanda Reisman. Madeline gets called for a meeting with Abigail''s guidance counselor. Principal Nippal announces the theme for the Fall Gala Fundraiser; later, Jane seeks Madeline''s help with Ziggy''s family tree project, and opens up about her past.', 66292, 3, 1261513, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261514, 'Push Comes to Shove', 'Nathan invites Madeline and Ed to a couples'' dinner to discuss a "parenting paradigm" for Abigail. Celeste prepares for a city-council meeting about Madeline''s play, and bristles at Perry''s concerns about her returning to work. Jane meets with Ziggy''s teacher, Ms. Barnes, who suggests Ziggy be medically evaluated in light of further evidence of classroom bullying. While Madeline is confronted by a skeleton from her past, her internet sleuthing reveals a key player from Jane''s past instead.', 66292, 4, 1261514, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1261515, 'Once Bitten', 'Madeline receives encouraging news about the play from her director, Joseph Bachman, but is left concerned by his newly icy demeanor. Principal Nippal and Ms. Barnes share their conclusions about Ziggy and Amabella with Jane. Celeste has a solo session with Dr. Reisman, who tries to get to the bottom of her relationship with Perry.', 66292, 5, 1261515, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197512, 'Episode 10', '', 66306, 10, 1197512, 76502, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1270962, 'Burning Love', 'Madeline worries about the can of worms she’s opened for Jane. Jane confronts Renata. Bonnie tells Nathan about a secret project Abigail has been working on. Meanwhile, Ed and Madeline have a frank conversation about the lack of passion in their marriage.', 66292, 6, 1270962, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273115, 'You Get What You Need', 'Celeste takes steps towards independence; Madeline deals with fallout from her past.', 66292, 7, 1273115, 76472, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1759620, 'What Have They Done?', 'Following first-day-of-school events, Madeline is worried by Bonnie''s behavior. Mary Louise, Celeste''s mother-in-law, offers her unvarnished assessment of Madeline''s character. Jane learns from her new coworker, Corey, that she''s known in town as one of the “Monterey Five.”', 66292, 1, 1759620, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1810235, 'Tell Tale Hearts', 'Renata faces an uncertain future when Gordon lands in legal trouble. Corey asks Jane out on a “practice” date. After a challenging therapy session with Dr. Reisman, Celeste opens up to Mary Louise about her relationship with Perry. Bonnie''s mom, Elizabeth, arrives. Ed confronts Madeline about her secrets.', 66292, 2, 1810235, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1810236, 'The End of the World', 'Mary Louise tries to get closer to Jane. Renata focuses her wrath on Principal Nippal. Madeline is forced to confront her issues at a couples therapy session with Dr. Reisman. Celeste remains conflicted by her memories of Perry.', 66292, 3, 1810236, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1810237, 'She Knows', 'Celeste accuses Mary Louise of overstepping boundaries with Jane. Renata endures a prying court hearing with Gordon. Jane opens up to Corey at Amabella''s disco-themed birthday party. Madeline continues to try to make things right with Ed.', 66292, 4, 1810237, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1820876, 'Kill Me', 'Renata deals with the fallout from Gordon''s legal troubles and attempts to help Celeste. Bonnie relives painful memories from her past.', 66292, 5, 1820876, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1820877, 'The Bad Mother', 'Celeste is blindsided by Mary Louise. Gordon continues to disappoint Renata. Bonnie contemplates a solution to her mother’s suffering and her own ongoing guilt. Ed entertains an unusual proposition before catching Madeline in an unguarded moment. The Monterey Five feel the pressure of increased scrutiny of Perry’s death.', 66292, 6, 1820877, 119671, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1820878, 'I Want to Know', 'Celeste questions Mary Louise about a tragic event from Perry’s childhood. Madeline worries their lie is tearing the Monterey Five apart.', 66292, 7, 1820878, 119671, null);
