INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187387, 'What Fools These Mortals Be', 'Fairy princess Astral has left her magical home in Athenia and follows her dream of becoming a high school student in the human world.', 66297, 1, 1187387, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187390, 'The New Kid', 'A fairy princess is pretending to be a foreign exchange student at a high school for humans, and when another teenager offers to help her, the secret royal must choose between being accepted and spending time with her new friends.', 66297, 2, 1187390, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187391, 'Lost in Translation', 'Astral helps plan a dance at school and turns to Devon for guidance in talking to Tristan.', 66297, 3, 1187391, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187392, 'Thanks a Latte', 'A café becomes a hangout for Astral until her fairy powers sabotage her fun.', 66297, 4, 1187392, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187593, 'Where There''s Smoke', 'Some confusing advice from Morgan and a surprising visit by a friend from home shake things up for Astral.', 66297, 5, 1187593, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187594, 'Witch!', 'Hailey tries to expose Astral''s "true" identity with surprising results.', 66297, 6, 1187594, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187595, 'Cold Season', 'Astral becomes ill and can''t keep her powers in check, which leads to chaos erupting at school.', 66297, 7, 1187595, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187596, 'Expiration Date', 'Things go awry when Astral spends time with Tristan.', 66297, 8, 1187596, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189482, 'Girls Just Wanna Have Fun', 'Astral and Morgan plan a girls'' night, but a few surprise guests spin things out of control.', 66297, 9, 1189482, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189859, 'I Got This', 'Astral seeks help from her cousin for a love spell, but instead she winds up in over her head.', 66297, 10, 1189859, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189860, 'Trouncing the Council', 'Astral heads to city hall with her pals to try to protect Athenia from a looming threat.', 66297, 11, 1189860, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189861, 'Let There Be Cake', 'Loyalties are questioned when Devon unearths Astral''s plan to assist Athenia.', 66297, 12, 1189861, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189862, 'Get a Job', 'Astral searches for a job so she can earn money to purchase a dress she covets for the fall dance.', 66297, 13, 1189862, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189863, 'Bad, Bad Fairy', 'Astral plays dodgeball and it brings out the worst in her.', 66297, 14, 1189863, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195691, 'Love Hurts', 'Astral casts a love spell, but she takes it too far and it affects everyone at school.', 66297, 15, 1195691, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195692, 'You Can''t Go Home Again', 'Astral deals with a rival by trying to change his mind.', 66297, 16, 1195692, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195693, 'Cliff Anger', 'An unexpected alliance is struck by Astral in order to provide assistance to Athenia.', 66297, 17, 1195693, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195694, 'The Campaign', 'Astral, Morgan and Devon try to create a viral video to generate publicity for the plight of the woods.', 66297, 18, 1195694, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199446, 'The Great Escape', 'Astral gets stuck in the gym with her pals during the Time of the Dimming, so they use this opportunity to hash out some problems.', 66297, 19, 1199446, 76486, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199447, 'Hidden in Plain Sight', 'The fall dance looms and prep work is needed, so Astral and her pals rush to get everything ready.', 66297, 20, 1199447, 76486, null);
