INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187599, 'Pilot', 'Jumping back into L.A. life after six months away, Maria hatches a brilliant plan to meet her neighbors and get back into Mark McGrath''s good graces.', 66309, 1, 1187599, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187672, 'Bisexual Because of Meth', 'Maria weighs an offer to star in a wacky ramen ad and embarks on a confusing new romance with a recovering addict.', 66309, 2, 1187672, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187673, 'White Trash', 'Worried she may be an unwitting racist, Maria seeks out a support group and fights for a big change on the set of a sitcom pilot.', 66309, 3, 1187673, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187674, 'Jack and Diane', 'When Maria slips into a sultry voice at a party, a handsome stranger falls under her spell -- and brings out her worst people-pleaser instincts.', 66309, 4, 1187674, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187675, 'I Love You', 'Maria struggles to keep up with a sporty new beau. But before she can break it off, the relationship takes a startling turn.', 66309, 5, 1187675, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187676, 'Loaf Coach', 'After a long history of overcommitting, Maria hires a "loaf coach" to help her master the art of doing nothing. But her timing couldn''t be worse.', 66309, 6, 1187676, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187677, 'Josue', 'Maria brings on a savvy young adviser to help her conquer her fear of children before a charity benefit.', 66309, 7, 1187677, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187678, 'A Vaginismus Miracle', 'Maria''s first audition in months leads to fireworks on the Fox lot. Later, she races to have sex before her annual deadline.', 66309, 8, 1187678, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187679, 'No Friend Left Behind', 'Fearing she''s ruined all her relationships, Maria seeks out a bitter former friend and vows to win her back by any means necessary.', 66309, 9, 1187679, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187680, 'Knife Feelings', 'Maria braves a romantic hurdle by inviting Scott to her tell-all stand-up show. But she doesn''t count on him having some dark secrets of his own.', 66309, 10, 1187680, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187681, 'Mein Ramp', 'Maria is mortified to learn she''s trending on YouTube for all the wrong reasons. In a flashback, she faces a difficult choice: her meds or her career.', 66309, 11, 1187681, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1187682, 'Enter Super Grisham', 'While Scott tries to figure out what went wrong, Maria throws herself into her work. In the past, a Checklist gig finally pushes her over the edge.', 66309, 12, 1187682, 76529, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1362243, 'Wet Raccoon', 'After moving in together, Maria and Scott become obsessed with each other''s annoying habits. Judd Apatow offers some sage relationship advice.', 66309, 1, 1362243, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391614, 'Hypnopup', 'In a panic over an unpaid bill, Maria drags Scott to a Debtors Anonymous meeting. But their money problems are just beginning.', 66309, 2, 1391614, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391615, 'Goof Around Gang', 'Scott''s foray into stand-up yields unexpected results. Meanwhile, Maria realizes she''s been neglecting her friends.', 66309, 3, 1391615, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391616, 'Fridge Over Troubled Daughter', 'A surprise visit from Maria''s mother gets off to a rocky start when she insists on psychoanalyzing Scott.', 66309, 4, 1391616, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391617, 'Souplutions', 'While tending to her sick beau, Maria tries to show off her nurturing side. But Scott''s best friend, Jessica, seems to do everything better.', 66309, 5, 1391617, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391618, 'Apache Justice', 'Twisted up in knots over an argument with her mom, Maria seeks refuge on the set of a Western TV drama. Future Bruce scores a big new client.', 66309, 6, 1391618, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391619, 'Kids Have to Dance', 'Maria discovers she''s being sued over a sadistic reality show in the Philippines and turns to David Spade for help.', 66309, 7, 1391619, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1391620, 'Little Manila', 'When the plans for Maria''s second wedding hit a snag, her new friends in the Filipino community step in to throw her an unforgettable party.', 66309, 8, 1391620, 92501, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216012, 'Seed Money', 'When Miami tech visionary Izzy Morales fails to attract funding for her new cryptocurrency GenCoin, financier Nick Talman funnels dirty money from his embezzling father. Meanwhile, gangster Ronald Dacey finds his money is missing, while cynical FBI agent Phil Rask hunts for Nick’s father.', 66310, 1, 1216012, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220652, 'Ground Floor', 'After Ronald threatens Nick and Izzy, they scramble to return his money in cash. Agent Rask''s new partner Maddie arrives just in time to ramp up efforts to track Nick''s father, Andy Talman. With gang violence in Little Haiti bearing down on his family, Ronald rethinks Izzy''s GenCoin pitch.', 66310, 2, 1220652, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220863, 'Proof of Concept', 'Nick, Izzy and Ronald''s fundraising is off to a slow start, but Ronald spots an opportunity with a neighborhood VIP. Rask and Maddie catch wind of GenCoin just as Andy tells Nick the truth about Rask. Nick makes a promising business connection.', 66310, 3, 1220863, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220864, 'Angel Investor', 'Nick makes the pitch of a lifetime, reviving GenCoin. Rask and Maddie’s partnership takes a surprising turn just as Rask forms an unlikely alliance. Ronald gets pulled into a wave of violence with his gang.', 66310, 4, 1220864, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220865, 'Buyout', 'As Rask slides into a pit of violence and corruption, he fights to regain control. Nick and Izzy absorb a devastating blow to GenCoin. Ronald takes a risk with the company pitch.', 66310, 5, 1220865, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220866, 'Bootstrapped', 'Rask is forced clean up his mess. Izzy reaches out to an old classmate and finds a promising lead. Taylor’s discovery of Nick’s predicament places GenCoin in serious jeopardy. In the face of disaster, Ronald has a burst of inspiration.', 66310, 6, 1220866, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220867, 'Valuation', 'A struggling GenCoin finds a way to set up shop, but Ronald’s plan to put some money in their pockets backfires. An anxious Rask must field questions from his fellow agents. Izzy follows up on an ambitious lead.', 66310, 7, 1220867, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220868, 'Pro Rata', 'GenCoin lands a major investor, Alex Bell, who has sketchy ties. Rask makes an opportune discovery about Nick. As Ronald’s status in the gang changes, his son Touie is faced with an agonizing decision.', 66310, 8, 1220868, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220869, 'Hostile Takeover', 'Rask hurries to tie up loose ends. Alex drops a bombshell on GenCoin, forcing Izzy into a compromising position. Nick and Ronald bond over their new predicament. Izzy takes a stand, only to find herself on the wrong side.', 66310, 9, 1220869, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1220870, 'Recapitalization', 'In the season finale, Nick and Izzy hash out their differences. Nick has an ace up his sleeve, leading to a shocking new ally for GenCoin. Rask is faced with the brutal truth about Alex. The Morales family is blindsided by tragedy.', 66310, 10, 1220870, 76530, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1355035, 'Disruption', 'Nick finds his circumstances vastly changed at the hands of Phil Rask, whose relationship with the Russians has taken a dark turn. In the wake of tragedy, Izzy is pushed to the brink of a reckless decision. As the cops close in on their business, Ronald and Touie contemplate a dangerous idea.', 66310, 1, 1355035, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1493901, 'Physical Disabilities', 'W. Kamau Bell meets with people with physical disabilities.', 66335, 4, 1493901, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1365092, 'Bleeding Edge', 'Striking a deal with Rask, Nick sets out on a seek-and-find mission to clear his name. Ronald asks for Izzy’s help with a risky project. Rask finds the Russians even more demanding than he’d feared. Izzy comes to a groundbreaking revelation.', 66310, 2, 1365092, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1365093, 'Early Adopters', 'Nick meets a mysterious old friend of his father’s. Ronald and Izzy put Araknet into action as Nick comes to them with a peculiar proposition. An adrift Rask struggles to repair all that’s broken in his life.', 66310, 3, 1365093, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370843, 'Loss', 'After a discouraging discovery, the trio forges a new plan. Izzy seeks the help of someone significant from her past. Nick faces a setback while catching a glimpse into the strange world of Wes Chandler. Ronald struggles to get his crew behind the new way of doing business.', 66310, 4, 1370843, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370844, 'Pivot', 'After a devastating tragedy, Ronald faces a harrowing decision. Izzy finds herself in hot water after a brazen plan lands her in the Russians’ sights. Nick finally grabs Wes’s attention with the help of Wes’s daughter, Mara.', 66310, 5, 1370844, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370845, 'Liabilities', 'Rask makes a bold move to set things right. After a near-death experience, Izzy reaches out to an old friend. Ronald and Nick rally to Izzy’s defense as they rethink the future of their business. The group fears Araknet’s baggage will scare off Wes.', 66310, 6, 1370845, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370846, 'Growth Hacking', 'As ArakNet struggles to best their competitor, Izzy butts heads with the team. Rask recovers, but his murderous past threatens to resurface. Wes, Nick and Mara hustle to bring ArakNet street cred against slim odds. Ronald goes down a dangerous road he’s long avoided.', 66310, 7, 1370846, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370847, 'Opportunity Cost', 'After Ronald suggests a game-changer for Araknet, he struggles to live up to the team’s expectations of him. The Russians hit Araknet hard in an underhanded move, leaving Nick and Izzy to plot swift retaliation.', 66310, 8, 1370847, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370848, 'Leverage', 'As Araknet celebrates a huge win, Ronald struggles to repair his life before it’s too late. The Russians extend a tainted olive branch, causing dissent within the company and throwing Izzy into inner turmoil. Just as Araknet is poised to make a controversial move, an unforeseen enemy strikes.', 66310, 9, 1370848, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370849, 'Soul Proprietor', 'Izzy reaches out to Rask with a proposition. Tamara gives Ronald the push he needs to change his life for good. Nick makes a sickening discovery while Izzy executes a devastating plan to decimate Araknet’s enemies.', 66310, 10, 1370849, 91824, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608739, 'Rebranding', 'An ultimatum from NSA Agent Rebecca Stroud throws Araknet into a paranoid tailspin, forcing Wes to reconsider his financing of the company and Ronald to reevaluate his ties to his friends and his past in the LH7 gang. Nick, meanwhile, is inspired to take the company to the next level.', 66310, 1, 1608739, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608740, 'Sweat Equity', 'Agent Stroud flexes the far-reaching power of the NSA, threatening to derail the lives of Araknet''s founders. Ronald struggles with the decision to undermine LH7 in order to keep Araknet safe. Izzy is enjoying her new life in Cuba until a chance encounter threatens to dredge up the past.', 66310, 2, 1608740, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608741, 'Guerilla', 'As Wes scrambles to hide the rest of his cash from Stroud, Ronald and Nick butt heads over how to carry on as co-CEOs. Meanwhile, Izzy finds herself drawn back into the tech underworld, a choice that will unwittingly put her on a collision course with Araknet’s greatest adversary.', 66310, 3, 1608741, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608742, 'Depreciation', 'Agent Stroud extradites Izzy to the states in exchange for her loyalty. Wes must travel to Barcelona to confront someone from his past. As Nick scrambles for a magic bullet to fixing Araknet’s growth gap, Ronald goes rogue to try and solve some brewing ethics issues.', 66310, 4, 1608742, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608743, 'Diversification', 'Wes throws a big party in the hopes of wooing new investors. LH7’s tactics blow back on Ronald’s family. Nick embarks on a secretive mission to save the company. An encounter with someone from Mara’s past sends her into an emotional tailspin. Stroud urges Izzy to insinuate herself back into Araknet.', 66310, 5, 1608743, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608744, 'Authentication', 'As Araknet enjoys an uptick, Nick grows paranoid that his covert plot will be discovered. When Wes decides to bring in an old friend for financing, Mara rebels and reveals a damning secret. Izzy rejoins ArakNet, but old wounds resurface. Ronald braces for a possible war between LH7 and a rival crew.', 66310, 6, 1608744, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608745, 'Limited Liability', 'Araknet receives horrific news, spurring a moral debate within the company and forcing Ronald to undermine Nick. Izzy tries to uncover Stroud’s true motivations while wrestling with her own duplicity. Wes hopes to repair his relationship with Mara, but simultaneously encourages her to play dirty.', 66310, 7, 1608745, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608746, 'Profit and Loss', 'Ronald’s entanglement with LH7 comes home to roost, aggravating his relationship with Nick. With the 100 million-user mark approaching, Nick makes a disturbing choice to protect his own interests. Izzy agonizes over Stroud’s final orders. Mara sets in motion her own nefarious PR strategy.', 66310, 8, 1608746, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608747, 'Questionable Costs', 'Ronald wrestles with the most difficult decision of his life. To Izzy’s horror, the virus she built blows back on Araknet. When Mara finds out what Nick did to Ronald, their relationship teeters on the edge. Wes’s indictment sends Nick into a downward spiral with biting repercussions.', 66310, 9, 1608747, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1608748, 'Trading Up', 'Ronald fears the impending blowback from a vindictive LH7. Mara’s ultimate plan comes to fruition, blindsiding Wes and Nick. Stroud reemerges to tie up loose ends, leading to an explosive and deadly season finale.', 66310, 10, 1608748, 111780, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240779, 'Episode 1', '', 66330, 1, 1240779, 82096, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1188403, 'Oh Sung Moo Has Disappeared!', 'Yeon Joo’s professor urgently calls Yeon Joo and asks her to get a spoiler about a popular graphic novel series, W, from her father. He promises that he will give her the opportunity to perform a surgery ifshe does, so she visits her father. ', 66330, 1, 1188403, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1188404, 'Find Her, the Key to My Life', 'Sung Moo, who has disappeared for a while, is back. Yeon Joo tries to figure out what has happened to her last night, but Sung Moo doesn’t tell her anything. Meanwhile, Sung Moo starts drawing again to kill Kang Chul. ', 66330, 2, 1188404, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1208090, 'Answer My Questions', 'Yeon Joo is dragged into W again, and So Hee finds her unconscious in the fitting room where she disappeared the last time. When she wakes up, Chul shoots her with a gun to prove that she''s invincible in his world. He assumes that Yeon Joo is from another world that he doesn''t know, and he won''t let her disappear again until she answers his questions.', 66330, 3, 1208090, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1208091, 'A World in the Webtoon', 'Because of So Hee, Yeon Joo is caught by the police and is put in prison to be investigated whether she''s the real suspect. To escape from her situation, she tells Chul the truth about him actually being the main character of a webtoon. When he realises that his entire world is fabricated, everything except him stops.', 66330, 4, 1208091, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1501050, 'HBCU''s', 'W. Kamau Bell head to historically black colleges and universities (HBCU''s) to answer the question on why these schools are important.', 66335, 5, 1501050, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1285322, 'Episode 71', '', 66344, 71, 1285322, 76638, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210623, 'It Is Your Set-up', 'After saying goodbye to Yeon Joo, Chul goes to Seong Moo and threatens him to draw the real criminal and make everything go back to normal. However, he tells Chul that there isn''t a criminal to his family''s murder case and everything including his personality is set up for the story to continue on.', 66330, 5, 1210623, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210624, 'The End', 'After shooting Seong Moo, Chul throws himself into the river from the bridge, and the story ends there just like that. Two months have passed, and Yeon Joo gets dragged into the webtoon again and see Chul drowning in the water. She realises that there''s still a chance to save him from dying.', 66330, 6, 1210624, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210625, 'Chul and Yeon Joo Get Married', 'Yeon Joo succeeds in bringing Chul back to life. She also goes into his world to be found and caught by the police. To get her out of prison, Chul fakes their marriage. While he’s having happy moments with Yeon Joo, an unknown caller rings Chul and threatens that he will also kill her.', 66330, 7, 1210625, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210626, 'The Killer Is After You', 'The killer follows Chul to the real world and finds out about the truth about him and his existence. He wonders around reality and is now after Yeon Joo. Chul asks Yeon Joo to draw him waking up from a dream when she returns to her world because it is the only way to keep everyone safe and to bring everything back to normal.', 66330, 8, 1210626, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210627, 'Make It a Happy Ending', 'Yeon Joo draws Chul waking up from a dream, and he completely forgets what has happened, including her. Seong Moo tries to finish the webtoon by making it a happy ending and decides that the killer''s face will be his. However, the story doesn''t go as planned when the killer takes over his physical existence.', 66330, 9, 1210627, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1210628, 'The World Controlled By The Killer', 'The killer takes Seong Moo’s face and demands that he follows his orders. He becomes invincible and almighty in the W world and starts committing a massacre. The killer even fabricates a piece of evidence that makes Chul the killer of his own parents 10 years ago. Chul has now become the suspect of the massacre on top of his own disaster, and ends up being chased by the police with Yeon Joo.', 66330, 10, 1210628, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216011, 'What Happens Next?', 'Leaving injured Chul alone in a motel, Yeon Joo goes back to the real world to fetch more medicine and to find a way to help him. However, Yeon Joo discovers what has happened to her father and that it’s not just Chul who can summon her into the W world. When she is summoned again for an unknown reason, she reunites with Chul and sees that he has read the story of W so far.', 66330, 11, 1216011, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217936, 'Chul''s Second Awakening', '', 66330, 12, 1217936, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217937, 'For the Last Episode of W', '', 66330, 13, 1217937, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217938, 'Secret of the Tablet', '', 66330, 14, 1217938, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217939, 'Which Kind of Ending Will It Be?', '', 66330, 15, 1217939, 76604, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1217940, 'After W Ends', '', 66330, 16, 1217940, 76604, null);
