INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1188744, 'Meeting the KKK', 'In the premiere episode, W. Kamau Bell arranges a special meeting with the Ku-Klux-Klan.', 66335, 1, 1188744, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189374, 'Behind These Walls', 'Kamau Bell heads to the infamous San Quentin State Prison to meet the men who''ve spent a lifetime behind bars, hear their stories and discover who they have become.', 66335, 2, 1189374, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191061, 'Latino, U.S.A.', 'Kamau Bell heads to East Los Angeles to meet with Latinos fighting to live the American Dream while facing prejudice and intolerance.', 66335, 3, 1191061, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191928, 'Protect and Serve?', 'Kamau Bell heads to Camden, N.J. to check out a new community policing program helping to improve the relationship between citizens and police.', 66335, 4, 1191928, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194429, 'Off the Grid', 'Kamau Bell experiences life off the grid in North Carolina and Tennessee.', 66335, 5, 1194429, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194430, 'Is It Cool to Be Hip?', 'Comedian W. Kamau Bell visits Portland, Oregon, to talk to old and new residents and finds a growing social divide involving hipsters and gentrification.', 66335, 6, 1194430, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196576, 'The Last Frontier', 'Kamau Bell heads to Barrow, Alaska, to observe how a person lives above the Arctic Circle and learns about the Inuit customs and traditions the natives are trying to preserve.', 66335, 7, 1196576, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196577, 'The Fountain of Youth', 'Kamau Bell heads to Daytona Beach to see how spring breakers and retirees are getting the most out of life.', 66335, 8, 1196577, 76626, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1310433, 'Immigrants and Refugees', 'W. Kamau Bell enjoys an abundant cross-section of immigrants who come to this country from all over the world to make a better life.', 66335, 1, 1310433, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1310434, 'Chicago Gangs', 'W. Kamau Bell goes to the heart of Chicago gang territory to explore the truth about violence in the city.', 66335, 2, 1310434, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1317560, 'Native Americans', 'W. Kamau Bell heads to the Dakotas to shed light on the indigenous people mistakenly called Native Americans.', 66335, 3, 1317560, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1319297, 'Muslims in Small Town America', 'W. Kamau Bell meets Muslims in Michigan who are eager to explain that practitioners of Islam are not what people assume they are.', 66335, 4, 1319297, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324241, 'Kamau Buys a Gun', 'W. Kamau Bell, an outspoken critic of gun laws in America, buys a .357 Magnum.', 66335, 5, 1324241, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1327768, 'Puerto Ricans and Puerto Rico', 'W. Kamau Bell unlocks some of the myths of Puerto Ricans; a journey from New York City to Puerto Rico itself.', 66335, 6, 1327768, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330129, 'Appalachian Coal Country', 'The Appalachian region has a rich history and optimism, despite being one of the hardest-hit countries economically; W. Kamau Bell plans to mine.', 66335, 7, 1330129, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330130, 'It''s Chinatown!', 'W. Kamau Bell visits San Francisco''s Chinatown; what it means to be American while culturally connected to another country.', 66335, 8, 1330130, 87401, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1481318, 'The Border', 'W. Kamau Bell heads to the U.S. Mexico border to find out what life is like for the people who live there.', 66335, 1, 1481318, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1483867, 'Sikhs in America', 'W. Kamau Bell unravels the stereotypes of one of the most misunderstood religions in America - Sikhism.', 66335, 2, 1483867, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1483866, 'The South Carolina Gullah', 'W. Kamau Bell visits the coast of South Carolina to meet the Gullah Geechee people.', 66335, 3, 1483866, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1501049, 'The Canadian Way', 'W. Kamau Bell takes a trip up north to Canada to see if everything is truly as great as everyone says.', 66335, 6, 1501049, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1509215, 'Sweet Home (Mobile) Alabama', 'W. Kamau Bell heads south to debunk some myths while also retracing his family roots with his father.', 66335, 7, 1509215, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1514376, 'Native Hawaii', 'W. Kamau Bell visits the islands of Hawaii to talk to natives.', 66335, 8, 1514376, 103249, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1775657, 'Megachurches', 'Kamau visits Dallas—the home of the Megachurch, to find out what is creating the new face of Christianity today, in a city where church and state are far from separate.', 66335, 1, 1775657, 123275, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1782786, 'Not All White People', 'While in and around Seattle, Kamau takes a look at different forms of activism that white people are using to combat America''s history of white supremacy and the rise of extreme right-wing groups across the country.', 66335, 2, 1782786, 123275, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1790503, 'Hmong Americans and the Secret War', '', 66335, 3, 1790503, 123275, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794262, 'Body Politics', 'Kamau visits Jackson, Miss. to explore the divisive world of reproductive rights and reproductive justice, including abortion, sex education, and women''s health.', 66335, 4, 1794262, 123275, null);
