INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1188933, 'Episode 1', 'Can''t get enough ''Game of Thrones''? Join hosts Andy Greenwald and Chris Ryan for this post-''Game'' show that delves inside the Season 6 premiere, explores the complicated politics and history of ''Thrones,'' and offers absurd and not-so-absurd theories about future episodes.', 66346, 1, 1188933, 76640, null);
