INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189639, 'Episode 1', 'Nina is interviewed by George and meets Max and Joe for the first time at Gloucester Crescent.', 66368, 1, 1189639, 76741, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190738, 'Episode 2', 'Nina goes on an awkward date with Nunney, the good-looking boy who lives over the road.', 66368, 2, 1190738, 76741, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1192777, 'Episode 3', 'Nina and George decide to give away Lucas, the family cat, but when Joe finds this out they have to get him back.', 66368, 3, 1192777, 76741, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194718, 'Episode 4', 'Nina is determined to strike up a friendship with Amanda, another nanny.', 66368, 4, 1194718, 76741, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195538, 'Episode 5', 'When Nina  accidentally crashes George’s car she sets in chain a series  of mishaps that may lead to her leaving the house for good.', 66368, 5, 1195538, 76741, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1412309, 'A Christmas Crow', 'Will has promised his wife Anne that he will be home in good time for a quiet Christmas with just the family. But when Marlowe, Kate and even the usually horrible Robert Greene look likely to be facing a miserable lonely Christmas in London, Will''s big heart gets the better of him and he asks them all back with him to Stratford.', 66369, 1, 1412309, 97200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629357, 'A Crow Christmas Carol', 'Things get Dickensian when a mysterious stranger inspires Will to get Greene to mend his evil ways with the help of three Christmas spirits.', 66369, 2, 1629357, 97200, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189658, 'Star Crossed Lovers', 'Episode one sees Will struggle to find inspiration for Romeo while having to deal with an angry actor, a very annoying house-guest and his family’s not terribly helpful script suggestions.', 66369, 1, 1189658, 76742, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189660, 'The Play''s the Thing', 'Just when Will’s controversial new play is about to be presented to Queen Elizabeth, it goes missing. As the finger of suspicion points to his best friend Marlowe, can Will come up with a way to recover his stolen masterpiece? Given its politically sensitive content, is he really wise to want it back?', 66369, 2, 1189660, 76742, null);
