INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193024, 'The Apparel Proclaims The Man', 'Will hopes to move up in the world when he is invited to a high-society party hosted by Lord Southampton, but is unsure what a poorly-educated country boy should wear to one of London''s most upmarket events. The playwright''s rival Sir Robert Greene offers him some fashion tips, but is it a double bluff, a triple bluff, or something even more fiendish?', 66369, 3, 1193024, 76742, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194719, 'Love is Not Love', 'Will has completed his final sonnet and senses literary immortality just around the corner. But will the fair youth and the dark lady like them as much as he hopes? And is Anne likely to be impressed that her husband’s 154 hot new love poems don’t contain much about her?', 66369, 4, 1194719, 76742, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194720, 'What Bloody Man is That?', 'The plague leads Will and his friends to escape to the family home in Stratford. On the way, they meet three witches who have some surprising predictions to make about Will’s future, leading to a very serious case of house envy.', 66369, 5, 1194720, 76742, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197745, 'The Quality of Mercy', 'When Will''s savings go missing, he is forced to make an unusual bargain with his rival. Kate''s frustration with the lack of roles for women leads her to make a dramatic intervention.', 66369, 6, 1197745, 76742, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1364889, 'The Green Eyed Monster', 'When a dashing African Prince comes to town, Will decides to befriend him.', 66369, 1, 1364889, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367813, 'I Know Thee Not, Old Man', 'When his old teacher invites himself to stay, Will must confront some awful memories.', 66369, 2, 1367813, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367843, 'I Did Adore a Twinkling Star', 'Will has to write a romance set in an exotic foreign location Kate has fallen for Marlowe.', 66369, 3, 1367843, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367844, 'Food of Love', 'Will Shakespeare has invented an amazing new dramatic form: the greatest hits musical.', 66369, 4, 1367844, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367845, 'Beware My Sting!', 'The women in Will''s life are not impressed with his play about a strong woman humiliated.', 66369, 5, 1367845, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367846, 'Sweet Sorrow', 'Will''s finished Romeo and Juliet but now there''s competition over who will play Juliet.', 66369, 6, 1367846, 92668, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1561190, 'Lord, What Fools These Mortals Be!', 'Will needs inspiration for his new play A Midsummer Night''s Dream. Meanwhile how can he get hold of some love potion, and where is Bottom going to put that stuffed donkey head?', 66369, 1, 1561190, 108660, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1561191, 'Wild Laughter in the Throat of Death', 'Will Shakespeare has been working on his masterpiece. His friends tell him it''s his greatest comedy yet, but Will insists that Hamlet isn''t actually meant to be funny.', 66369, 2, 1561191, 108660, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1561192, 'If You Prick Us, Do We Not Bleed?', 'London is full of anti-immigrant rioting. Will looks forward to an age when such sentiments are long-gone, but in the meantime he and the players plan to do their bit to help those worse off than themselves with a fund-raising charity gala night. “Inflated Pig''s Bladder Day” is a triumph.', 66369, 3, 1561192, 108660, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1568823, 'Sigh No More', 'When Kate stands in for Sue at the masked ball she accidentally sets off a chain of events that leaves Sue humiliated by the other local teenagers and Will needs to come up with a ruse to turn the tables on the bullies. Meanwhile in all the confusion Hamnet has gone missing.', 66369, 4, 1568823, 108660, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1586577, 'The Most Unkindest Cut of All', 'Will''s troupe plot against each other, but his defusing of the situation helps give him a better idea for his new play about Julius Caesar.', 66369, 5, 1586577, 108660, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629356, 'Go On and I Will Follow', 'As Will wrestles with temptation a bigger threat to his family lurks in the wings.', 66369, 6, 1629356, 108660, null);
