INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189713, 'January', 'It’s the morning of Cathy’s husband’s funeral and her family gather at the house to wait for the funeral cars. Battling her brother''s partner and meeting her son''s new and over-enthusiastic girlfriend Kelly, Cathy prepares herself for a day of great emotion with help from her friend Michael.', 66372, 1, 1189713, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189714, 'February', 'It’s Cathy’s first Valentine’s day since she lost her husband. Her brother Derek comes round to keep her company, but his partner Pauline wishes that she was anywhere else. Her son, Jason, has some surprising news for her and when Michael turns up unannounced he''s concerned to find that Cathy has received a Valentine’s card.', 66372, 2, 1189714, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190797, 'May', 'Cathy is clearing out her garage and the family come round to help. Her brother and his partner are fresh from playing golf and making friends with a millionaire. Kelly’s mum comes round to take an old fridge and Cathy sees a new side to Kelly. Michael is helping out too and faces a decision.', 66372, 3, 1190797, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1192773, 'August', 'It’s a hot summer’s day and while Kelly and her cousin sunbathe in the garden, Cathy is getting ready to go for lunch with a new - male - friend. Michael’s taking her and is keen to find out more about this friend.', 66372, 4, 1192773, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194717, 'October', 'It''s early morning and Cathy is trying to get ready for work. Jason has an interview for a job in Australia and Kelly''s upset that she might have to move there. After a heavy night out with Derek, Michael finds himself on Cathy’s sofa with a secret to keep from Cathy.', 66372, 5, 1194717, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196172, 'December', 'It’s New Year’s Eve, and while Cathy’s trying to have a nice little party, Kelly and Jason have come back arguing. Michael turns up, and as Cathy’s trying to sort out Jason and keep her party going, she tries to find the right moment to give him his Christmas present...', 66372, 6, 1196172, 76746, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1436784, 'March', 'It is Cathy''s 60th birthday and the family are going for lunch.', 66372, 1, 1436784, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1444434, 'April', 'It is Easter Sunday and Cathy and Michael have plans to clear the front room together. Jason and Kelly have got other ideas.', 66372, 2, 1444434, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1448622, 'June', 'Cathy is having a barbecue. Michael hasn''t replied to her email and she wants to know why.', 66372, 3, 1448622, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1458985, 'July', 'Kelly and Jason are up early and going on holiday. Meanwhile, Michael has had a terrible night and has something he wants to tell Cathy.', 66372, 4, 1458985, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1458987, 'September', 'As summer draws to a close, Cathy and Michael see each other for the first time in months. And with Maureen in hospital, Reg anxiously waits for news.', 66372, 5, 1458987, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1458986, 'November', 'It is Fireworks Night and Cathy is having a bonfire. As Michael moves on after the death of his mother, Cathy feels she needs to tell him something.', 66372, 6, 1458986, 99758, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1791954, 'Monday', 'Cathy and her family arrive in the countryside to celebrate Derek’s birthday. Michael arrives too, which Jason finds troubling.', 66372, 1, 1791954, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794418, 'Tuesday', 'It is first thing in the morning and Cathy has a hangover. She and Michael try to piece together what happened the night before.', 66372, 2, 1794418, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794419, 'Wednesday', 'Cathy and Michael get ready to go for a walk in the countryside, but Jason has concerns.', 66372, 3, 1794419, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794420, 'Thursday', 'After a night out at a restaurant, Cathy and her family head to bed. Pauline''s had too much to drink and Jason has something he needs to say to Cathy.', 66372, 4, 1794420, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794421, 'Friday', 'It''s raining and Cathy and her family are stuck indoors. Pauline has a visitor and Cathy makes an important decision.', 66372, 5, 1794421, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1794422, 'Saturday', 'It''s Derek''s birthday. The family come together to get the house ready for the party.', 66372, 6, 1794422, 124343, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189723, 'Episode 1', 'After an explosion tears apart an English city, photojournalist Jennifer Preston notices people acting strangely and ghostly images in her pictures.', 66373, 1, 1189723, 76748, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189724, 'Episode 2', 'Jennifer has trouble convincing her boyfriend of the ghostly phenomena until he learns that his colleagues at the Home Office have lied to him.', 66373, 2, 1189724, 76748, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1189725, 'Episode 3', 'When Jonas vanishes and Mathis becomes the prime suspect in a murder, Jennifer discovers that the conspiracy is greater than she ever imagined.', 66373, 3, 1189725, 76748, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190208, 'Episode 1', '', 66400, 1, 1190208, 76816, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190219, 'California: Pacific Coast Highway', 'Norman and his friend Imogen Lehtonen ride up the California Pacific Coast Highway to check out some dune buggies, ride a futuristic bike and do a podcast.', 66402, 1, 1190219, 76819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200310, 'Death Valley: Dante''s View', 'Balthazar Getty and Norman Reedus spend a night in Las Vegas and then ride out to Death Valley, enjoying the epic scenery.', 66402, 2, 1200310, 76819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201561, 'Appalachia: Blue Ridge Parkway', 'Norman and his buddy Jason snake through the smokey mountains, hit the Dragons Tail, and party with the locals.', 66402, 3, 1201561, 76819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201587, 'Texas: Twisted Sisters', 'Norman takes a ride from Austin to San Antonio, Texas.', 66402, 4, 1201587, 76819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201588, 'Louisiana: Crescent City', 'Norman takes a ride from Lafayette, La., to New Orleans.', 66402, 5, 1201588, 76819, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201589, 'The Keys With Peter Fonda', 'In the first-season finale, Norman Reedus rides with Peter Fonda from Naples to Key West in Florida.', 66402, 6, 1201589, 76819, null);
