INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190332, 'The Couple', 'Martin gives in to his wife''s request to see a marriage counselor.', 66406, 1, 1190332, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190333, 'The Toaster', 'All Martin wants to do is get his toaster fixed. But what seems like a trivial event at first turns into an epic adventure when he encounters the vendor''s unusual customer service rep.', 66406, 2, 1190333, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1190334, 'Fame', 'Groupies, adoration, VIP treatment, and other privileges...nice perks, but there''s more to fame than that. Stardom has a bizarre flip side.', 66406, 3, 1190334, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206518, 'Money', 'Martin hates his girlfriend''s shopaholic spending habits and enlists the kids to try to stem the outflow of cash. In the end, however, it''s Martin himself who puts the family fortune in jeopardy.', 66406, 4, 1206518, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206519, 'The Ex', 'Martin is thrilled when he runs into his ex-girlfriend, but the thrill quickly turns sour when Julie insists he invites the ex to nice family dinner.', 66406, 5, 1206519, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206520, 'Bully', 'Bullying does not discriminate by age, gender, or...smell. It happens everywhere. Martin is a victim, an observer, and even the instigator in this episode that sees him taking on all three roles and, unwisely, insisting on having the last word.', 66406, 6, 1206520, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206521, 'Raising Kids', 'Martin and Julie begin to feel insecure about their parenting skills, that is, until another couple and their son come for a visit, and it becomes clear that you could do much worse.', 66406, 7, 1206521, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206522, 'Senior Moment', 'Julie''s aging uncle comes to visit. The upside: it will give Martin and his family the opportunity to enjoy a multi-generational experience.', 66406, 8, 1206522, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206523, 'The Devil Haunts Me Morning, Noon, and Night', 'Martin''s daily routine becomes the ''routine from hell'' when he discovers that he doesn''t do ''ordinary'' well, and it seems every one of his friends are living it up more than he is.', 66406, 9, 1206523, 76835, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206524, 'Physically Challenged Sex', 'Martin''s brother doesn''t cope well with the lack of sex, so Martin takes matters into his own hands.', 66406, 10, 1206524, 76835, null);
