INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1249678, 'Christmas Special', 'It''s Christmas Eve with The Windsors and it''s an even tenser affair than usual following the events that led Wills to usurp Prince Charles as next in line to the throne.', 66437, 1, 1249678, 83061, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1578056, 'Royal Wedding Special', 'Harry and Meghan are excited about their impending marriage, but before their big day, they must take Charles to America to meet Meghan''s mum Doria.', 66437, 2, 1578056, 83061, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191172, 'Episode 1', 'Charles tries to keep the family in order but Wills wants to mingle with the ordinary people so is working in a café. Pippa is jealous of Kate bagging a prince so uses her fantastic arse to lure Harry.', 66437, 1, 1191172, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191182, 'Episode 2', 'While on a humanitarian mission Kate contracts Ebola forcing Wills to  rush to her bedside. Beatrice and Eugenie discover that the face paint  they applied for the ball doesn''t come off.', 66437, 2, 1191182, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194534, 'Episode 2', '', 66513, 2, 1194534, 77123, null);
