INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194536, 'Episode 4', '', 66513, 4, 1194536, 77123, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191184, 'Episode 3', 'When a stranger claims Charles is his father it throws into question who is second in line to the throne. Wills and Kate shun royal life to live in Rickmansworth and Pippa is irked when Harry is set to marry down under.', 66437, 3, 1191184, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1191185, 'Episode 4', 'Wills becomes obsessed with the Royal Variety Show, while Kate is preoccupied by the Archbishop of Canterbury.', 66437, 4, 1191185, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197564, 'Episode 5', 'Wills has become disillusioned with his role and calls for a referendum on the abolition of the monarchy.', 66437, 5, 1197564, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196204, 'Episode 6', 'President George Osborne has imposed extreme austerity since the abolishment of the monarchy. Can Wills save his family and the nation before it''s sold to the Chinese?', 66437, 6, 1196204, 76912, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1332306, 'Episode 1', 'Prince Charles refuses to help Theresa May secure a trade deal with the Chinese, but when Camilla withholds his conjugal rights, Charles agrees to host a banquet. Wills wants to be a hands-on dad, mixing with ordinary parents, but comes to realise childcare is a nightmare, while Pippa is preparing to marry Johnny, but is enraged that Kate has been made patron of Wimbledon and decides to put a gypsy curse on her.', 66437, 1, 1332306, 89924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1337278, 'Episode 2', 'Reviving his clubbing heyday, Harry buys a club and asks Kate to be the DJ, while Beatrice and Eugenie work the door.', 66437, 2, 1337278, 89924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1339034, 'Episode 3', 'The third instalment of the comedy soap opera about the royal family. Kate is reluctant to join a royal pheasant shoot at Sandringham, but Wills warns if she’s ever going to fit into the family she’d better kill something. Harry seeks revenge on Johnny for cheating him out of his nightclub. Wills stumbles upon his father’s identical twin brother Chuck, kept prisoner in the attic for 68 years following a mix-up that was supposed to see Charles locked away. Charles’s twin is the rightful heir, and seems like he’d make a wonderful king, but which version of Charles will the family choose?', 66437, 3, 1339034, 89924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1341338, 'Episode 4', 'The outrageous royal comedy soap opera continues. Kate and Wills visit Charles’s traditionalist new town, Poundbury in Dorset, where Charles is unveiling another statue of himself. Will Pippa leave her fiancé Johnny after she learns that he’s lost his fortune and has become a pizza delivery man? Kate runs into old flame Gypsy Ricky who reminds her they’re still married following a traditional gypsy ritual; will Camilla use this to destroy Kate in her latest plan to grab power?', 66437, 4, 1341338, 89924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1343850, 'Episode 5', 'The Royals are gathered at Balmoral where Camilla is determined to exact revenge on Theresa May, while Pippa plans to end Meghan and Harry''s relationship', 66437, 5, 1343850, 89924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1343851, 'Episode 6', 'Charles announces he''ll become absolute monarch, as the new Magna Carta decrees. He just needs one world leader''s endorsement... Donald Trump arrives with an indecent proposal. Wills and Kate oppose the absolute monarchy, and Pippa''s wedding day arrives but will Harry let her go through with it?', 66437, 6, 1343851, 89924, null);
