INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1236717, 'So Fiercely Proud of My Mom', 'Chelsea Clinton speaks out about her mother''s resilience, the high stakes in this election, and an "offensive" ploy by Trump. With Rose McGowan.', 66488, 74, 1236717, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1236718, 'Please Take My Knickers Off', 'Stella and Mary McCartney talk fashion, royalty and sisterhood. Craig Ferguson offers a primer on Scotland. Plus, Colleen Ballinger and Kimbal Musk.', 66488, 75, 1236718, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1238349, 'They Said It''s a Man''s Game', 'Comedy legend Carol Burnett shares the joys and hazards of hosting her own variety show in the 1960s. With Rob Corddry and ESPN''s Jessica Mendoza.', 66488, 76, 1238349, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1239004, 'Do Not Despair About Our Country', 'Chelsea sifts through the dizzying emotional and political fallout of the election with help from Sen. Barbara Boxer, Mary McCormack and Nikki Glaser.', 66488, 77, 1239004, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240749, 'Dinner Party: The Best Relationships', 'Sarah Jessica Parker, Morgan Spurlock, Trevor Noah and Julianna Margulies talk friends, parenting, work and the bonds that have shaped their lives.', 66488, 78, 1240749, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240988, 'Inside the Trump Tower Bubble', 'Jake Tapper weighs in on Donald Trump''s shifting positions, Maria Shriver critiques Chelsea''s interviewing style, and Matt LeBlanc talks "Top Gear."', 66488, 79, 1240988, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1243714, 'You Secretly Hope You''re Worthy', 'Emmy Rossum recounts a bold career move, Obama adviser Valerie Jarrett looks back on the president''s big wins, and Flula explores the world of D&amp;D.', 66488, 80, 1243714, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1243716, 'You''re Basically a Piece of Meat', 'Chelsea grills Milo Ventimiglia on the "Gilmore Girls" revival and his "This Is Us" physique. Kyra Sedgwick reflects on her 28-year marriage.', 66488, 81, 1243716, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1244380, 'First Train to Tokyo', 'Chelsea heads to Japan to play drinking games with geishas, visit cat cafés and crying clinics, and interrogate the locals on dating, sex and more.', 66488, 82, 1244380, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1244601, 'We Cannot Go Back to Sleep', 'Sally Field offers a defiant response to Trump''s victory. Jacob Soboroff explains the recount process. Plus, Jason Biggs and a tribute to Mrs. Brady.', 66488, 83, 1244601, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1244787, 'You Need to Be More Sexual', 'Jessica Chastain shares her grandmother''s saucy advice, Chelsea makes a bet with Dale Earnhardt Jr., and Van Jones rebukes Democrats and Republicans.', 66488, 84, 1244787, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1245937, 'Dinner Party: Going to Prison', 'Stars of "Orange Is the New Black" reflect on how the show has changed their lives -- and the world. Four women share their real-life prison stories.', 66488, 85, 1245937, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1246181, 'Let''s Talk Pipeline', 'Susan Sarandon breaks down the dramatic Dakota pipeline standoff and the #BankExit push. Gael García Bernal extols the pleasures of mezcal and Venice.', 66488, 86, 1246181, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1246424, 'The Really Uncoordinated Superhero', 'Jennifer Aniston talks "Office Christmas Party" and her ideal superhero role. Fetty Wap explains his stance on guns. Chelsea gets high with her staff.', 66488, 87, 1246424, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1247312, 'Both Naughty and Nice', 'Kate Hudson recalls a magical holiday, LA Mayor Eric Garcetti shares his plea to Donald Trump, and Cameron Dallas and friends talk social media fame.', 66488, 88, 1247312, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1247313, 'We Got to See a Beacon of Light', 'Common looks back on Obama''s impact, country star Maren Morris marvels at her wild year, and journalist Lauren Duca dissects lies by Trump.', 66488, 89, 1247313, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1247314, 'Can You Tell I''m a Nightmare?', 'In the season finale, Oscar winner Jennifer Lawrence gets punchy, Chris Hardwick talks zombies, and Chelsea revisits favorite moments from the show.', 66488, 90, 1247314, 77016, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1282294, 'I Had No Backup Plan Whatsoever', 'Melissa McCarthy and Chelsea recall the rocky road to show biz success. Van Jones slams Trump''s recklessness and nepotism. With the "Nobodies" cast.', 66488, 1, 1282294, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1306178, 'Women That Are Strong Are Fun', 'Chelsea talks resilient women with Charlize Theron, civic engagement with Rep. Linda Sánchez and "the French Donald Trump" with voters in Paris.', 66488, 2, 1306178, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1306179, 'Ladies and the Trump', 'Tracee Ellis Ross, Aisha Tyler and Rosario Dawson join Chelsea to scorch Trump''s first 100 days in office. Sen. Cory Booker urges political integrity.', 66488, 3, 1306179, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1306207, 'Dinner Party: Getting Schooled', 'Jim Parsons, Rashida Jones, Gaby Hoffmann and Mary McCormack celebrate teachers who impacted their lives. With former Education Secretary John King.', 66488, 4, 1306207, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1306208, 'Answer Me This', 'Chelsea quizzes “Guardians of the Galaxy” star Chris Pratt. Amy Schumer, Goldie Hawn and Wanda Sykes play a guessing game. Plus, Rep. Adam Schiff.', 66488, 5, 1306208, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1317135, 'Scientologists and Pirates and Aliens, Oh My', 'Leah Remini dissects the perils of leaving Scientology, Geoffrey Rush talks Einstein and acting with monkeys, and Danny McBride riffs on movie aliens.', 66488, 6, 1317135, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1321327, 'Beauty Pageants, Black-ish and Going Broke', 'Priyanka Chopra discusses "Baywatch" and self-esteem. Anthony Anderson reflects on racial identity. Sen. Elizabeth Warren champions higher wages.', 66488, 7, 1321327, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1323984, 'Changing the Climate', 'Sen. Al Franken brings his humor to Congress. Sarah Silverman stands up for women''s health issues. Plus, Thomas Middleditch on global warming.', 66488, 8, 1323984, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1327300, 'To England With Love', 'Chelsea gives English etiquette a whirl, goes boating with Eddie Izzard, scrums with a pro rugby team and hits the pub to gauge opinions about Brexit.', 66488, 9, 1327300, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1329628, 'Tear Down These Walls', 'Salma Hayek Pinault talks massage and marriage. CNN''s Don Lemon discusses truth in journalism. Jerrod Carmichael gets real about the N-word.', 66488, 10, 1329628, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1331662, 'A Handler-maid''s Tale', 'Alison Brie and Betty Gilpin dish on wrestling training for "GLOW." Elisabeth Moss ponders real-life echoes of "The Handmaid''s Tale." With Janet Mock.', 66488, 11, 1331662, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1337563, 'Dinner Party: Good Sports', 'NFL stars Russell Wilson and Kurt Warner, gymnast Aly Raisman and boxer Laila Ali reflect on competing, performance nerves and reinventing themselves.', 66488, 12, 1337563, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1342246, 'When Chelsea Met Harry', 'Chelsea quizzes Harry Styles, chats with singer Rita Ora and talks "Game of Thrones" sexual taboos with John Bradley. With "Pod Save America" hosts.', 66488, 13, 1342246, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1342248, 'The Future Is Now', 'Actress Cara Delevingne works to empower girls, tech leaders weigh in on cutting-edge automation, and Garbiñe Muguruza savors her big Wimbledon win.', 66488, 14, 1342248, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1344617, 'Let''s Keep Moving Forward', 'Kate Beckinsale, Jill Soloway and Niecy Nash extol diversity in showbiz. Congressmen Ted Lieu and Eric Swalwell discuss immigration and impeachment.', 66488, 15, 1344617, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1349183, 'Dear India', 'Chelsea discusses Indian culture with actress Freida Pinto, haggles in a Mumbai market with Vikas Khanna, meets a guru and shakes it Bollywood-style.', 66488, 16, 1349183, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1360147, 'We Are All Sharks', 'Reese Witherspoon talks about her new movie and becoming a producer. Kathy Bates discusses "Disjointed" and medical marijuana. With Dan Rather.', 66488, 17, 1360147, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1360148, 'Comfortably Naked', 'James Corden chats musicals and public nudity, Bella Thorne hopes to inspire the next generation, and Sen. Kirsten Gillibrand addresses gun violence.', 66488, 18, 1360148, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1367812, 'Handler and High Water', 'Jessica Biel gets real about motherhood. Chelsea kayaks with Abbi Jacobson and Ilana Glazer. With S.E. Cupp, Evan McMullin and Andrea Savage.', 66488, 19, 1367812, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1370005, 'Game Changers', 'Emma Stone and Billie Jean King talk “Battle of the Sexes.” Justin Hartley reflects on his Hollywood success. Plus, grassroots politician Randy Bryce.', 66488, 20, 1370005, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1373173, 'The Art of the Kneel', 'The NFL''s Reggie Bush and activist DeRay Mckesson discuss athletes'' defiant response to Trump. Maggie Gyllenhaal talks "The Deuce." Plus, Macklemore.', 66488, 21, 1373173, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1376534, 'Hart of the Matter', 'Kevin Hart and the Plastic Cup Boyz joke about comedy. Activists Kris Brown and Igor Volsky voice an urgent plea for gun control. Jackie Chan sings.', 66488, 22, 1376534, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1382550, 'Showing Up Matters', '', 66488, 23, 1382550, 85924, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193113, 'Patience', 'Camp Stillwater is about to reopen after being closed down for years. Deb, the new owner, has thrown her heart, soul and life savings into renovating the camp she loved as a child. She isn’t the only one excited to return as six former campers—Alex, Jessie, Cricket, Joel, Blair and Blotter —join her as counselors hoping to experience the freedom that camp brings now that they are older. Not part of the old crew, Amy is not just new to Camp Stillwater, but to camp in general. While Amy tries her best to fit in with the already tight group, Drew is content to be left alone. As everyone settles in and prepares for the campers’ arrival, Amy is the first to get a feeling that something is not right with this idyllic summer camp.', 66489, 1, 1193113, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199042, 'Barney Rubble Eyes', 'The campers arrive to Camp Stillwater and quickly Alex and Blotter realize one of their new charges, Anton, is going to be a handful. With the tendency to wander off into the woods talking to himself, Alex and Blotter think the shy kid just has an imaginary friend. But when Anton starts talking about “the Tall Man” and communicating cryptic messages to them, they begin to wonder what lurks in the woods around Stillwater. Meanwhile, flashbacks show how Alex got his “if you want something in life, you have to take it” attitude.', 66489, 2, 1199042, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199043, 'Mix Tape', 'The summer is off to a rough start for the counselors at Camp Stillwater and a night away in town is a much-needed break. Both Cricket and Jesse see the free time as an opportunity to make headway with their crushes, but when one of them goes a little too far the evening takes a dangerous turn. Stuck covering the campers while the rest are in town, Blair and Joel use movie night as a way to make their own romantic overtures. Meanwhile, flashbacks show why Cricket’s plans to attract Alex’s attention include insulting graffiti.', 66489, 3, 1199043, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202693, 'Modern Love', 'With a string of unfortunate events plaguing the start of the summer at Camp Stillwater, Deb decides to push up the masquerade ball to try and revitalize the morale. But as the campers begin the preparations for the ball, the counselors start to compare notes of the strange occurrences they have encountered. With too many weird things taking place to be a coincidence, Alex, Cricket and Amy are determined to get to the bottom of what is happening. As their investigation turns towards Deb, Joel finds himself in a tricky situation.', 66489, 4, 1202693, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202694, 'How to Stay Alive in the Woods', 'Deb and the counselors take the campers on an overnight camping trip deep into the woods for an unforgettable experience. As everyone is pitching tents and trying to find the perfect marshmallow roasting stick, Joel grows uneasy about what is happening at Camp Stillwater. Meanwhile, flashbacks feature Joel.', 66489, 5, 1202694, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1203531, 'The Dharma Burns', 'Everyone is shaken by the latest dark events that have transpired at Camp Stillwater. No longer able to ignore that something seriously wrong is happening, some of the counselors decide to take drastic measures to get answers. Also searching for answers, Deputy Sykes gets a tip from the past the he may be on the right path. Meanwhile, flashbacks feature Deb.', 66489, 6, 1203531, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1205422, 'Townie', 'As the counselors and Deputy Sykes put together the pieces of what is happening at Camp Stillwater, Skyes knows that something has to be done to stop it. With the help of Deb and the counselors, he comes up with a plan that will hopefully end the attacks before someone else gets hurt…or worse. Meanwhile, flashbacks feature Deputy Garrett Sykes.', 66489, 7, 1205422, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1205423, 'The Devil Inside', 'As Deb, Deputy Sykes and the counselors all try to come to grips with what took place at Camp Stillwater, a sense of calm finally comes over the camp. But with so much having taken place, can the summer really be saved? Meanwhile, flashbacks feature Jessie.', 66489, 8, 1205423, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206413, 'Home Sweet Home', 'Chaos reigns down on Camp Stillwater as Deb and the counselors come face to face with evil.', 66489, 9, 1206413, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206414, 'She Talks to Angels', 'What was supposed to be a fun summer that the Camp Stillwater counselors would never forget quickly turned into a horrible experience they will be lucky to survive. As summer comes to a close, the centuries-old battle between good and evil at Lake Stillwater will be settled once and for all.', 66489, 10, 1206414, 77019, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1193114, 'Pilot', 'When a young woman is brutally murdered in her London flat, the search for her killer leads to scandal and intrigue stretching all the way from underground sex clubs to the highest levels of the Royal Family.', 66490, 1, 1193114, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195929, '#AmericanPsycho', 'As the investigation into Molly Ryan’s murder heats up, all eyes are watching what Grace does next. With strict instructions from Stan to not leave the flat, Grace is determined to attend Molly’s memorial service regardless.', 66490, 2, 1195929, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195930, 'Exit Wounds', 'Now that Molly’s murder has become a world wide story, Grace becomes the target of social media bullying. While Grace is reeling from the social slander, Stan is forced to turn his attention to fixing her step father James’ situation – a mess that may hit too close to the Molly Ryan case.', 66490, 3, 1195930, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202573, 'Blood Ties', 'Natalie discovers that crown prosecutor Gwendolyn may not be as unbiased in her investigation of Grace as she would have others believe. Detective Sergeant Bruno is feeling trapped when a past indiscretion threatens to be exposed and he must decide if he will let it affect the Molly Ryan murder case. Now with public opinion in her favor, Grace encourages her boyfriend Luc to move forward with his art show despite his continued drug use.
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1203541, 'The Eye of the Needle', 'A weary Grace spends the night at the police station, only to be accosted by paparazzi when she tries to leave. As the situation turns ugly, a stranger comes to her rescue. After agreeing to go off with the Good Samaritan, she begins to suspect that he has darker intentions. When Natalie realizes Grace is gone, she and Detective Bruno frantically search the city, hoping to find her sister before it’s too late. Meanwhile, Patrick goes undercover at The Courtenay, a posh sex club, to get to the bottom of his sister’s double life and find her killer.', 66490, 5, 1203541, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194493, 'Episode 1', '', 66513, 1, 1194493, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194494, 'Episode 2', '', 66513, 2, 1194494, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194495, 'Episode 3', '', 66513, 3, 1194495, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194496, 'Episode 4', '', 66513, 4, 1194496, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194497, 'Episode 5', '', 66513, 5, 1194497, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194498, 'Episode 6', '', 66513, 6, 1194498, 77120, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1194533, 'Episode 1', '', 66513, 1, 1194533, 77123, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1203543, 'A Simple Plan', 'While Luc is on lockdown at the police station, Gwen tries to finally get the piece of information she has been desperately looking for to link Grace to Molly’s murder. But, with Luc sticking to his story that he and Grace were on the roof together all night and Stan working every angle to get Luc out, Gwen is running out of time. Detective Bruno decides to jump in to play good cop and is shocked by what he discovers. Grace teams up with Roz to deflect suspicion off of Grace by planting evidence on a new suspect with ties to The Courtenay sex club. They recruit Natalie to seduce Finch as a distraction, but Natalie may be in over her head when Finch takes her sexy flirtation seriously.  Meanwhile, after putting himself in danger by upsetting the wrong people while delving into Molly’s past, Patrick turns to an unlikely ally, Kaley, who is having a harder and harder time denying her attraction to him. And Prince Theo’s lies start to unravel when he accidentally lets something slip, leading his fiancée Charlotte to suspect he’s hiding something.', 66490, 6, 1203543, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1203544, 'A Fall From Grace', 'As the Molly Ryan murder case ramps up, the case against Grace has never looked worse. Natalie reveals to Stan that Molly worked as a prostitute at The Courtenay, and that Grace may have as well. Stan buries any Courtenay connection to Grace, but tips off the press to Molly’s connection to this dark, dangerous world. Natalie confronts Grace with what she’s discovered and, if anything, leaves even more disturbed by her sister’s potential guilt – especially after Bruno shows her a tape of Grace planting evidence. But before giving up on her sister completely, Natalie turns to an unlikely source for information about Molly’s murder.', 66490, 7, 1203544, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206163, 'Eyes Wide Open', 'As Stan works on Grace’s defense, Graces struggles to remember a chunk of missing time on the night of Molly’s murder. Stan wants to bring in a forensic psychiatrist who specializes in Memory Recovery Therapy to help discover what Grace might have blacked out from that night.  Natalie develops her own theory about Prince Theo and goes to Bruno for help, not knowing he’s been covering up the Prince’s tracks along the way. But Theo has his own problems when he realizes Charlotte has figured out his lies about Molly. Meanwhile, Patrick discovers the Prince is Gentleman 33, who happened to be Molly’s best customer at the Courtenay.', 66490, 8, 1206163, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206164, 'The Crown v Atwood', 'Dubbed “Grace the Disgrace” and hounded by the British tabloids, young American Grace stands trial for Molly Ryan’s murder. Stan determinedly works around every legal obstacle presented in order to cast doubt on her guilt, while Natalie and Bruno race against the clock to find new evidence to prove her innocence. Meanwhile, in custody, Grace recognizes an opportunity that could potentially free her.  Later, Prince Theo’s house of lies starts to crumble.', 66490, 9, 1206164, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1209523, 'What Did You Do?', 'The crown prosecutor is convinced that Grace Atwood killed her flatmate Molly Ryan and now it’s in the hands of the jury. As the jury deliberates Grace’s fate, Detectives Bruno and Pike rush to uncover who is behind the Hertfordshire murder and if the two cases are related. To buy time, Stan and Natalie try and postpone the court proceedings, not knowing that Grace has an escape plan of her own in motion.  Meanwhile, Patrick is convinced that Prince Theo is the murderer and intent on revenge. So, when the Prince’s compulsions lead him back to Kaley, it provides Patrick with the opportunity he’s been waiting for.', 66490, 10, 1209523, 77020, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1320577, 'Episode 1', 'The jaw-dropping special will test the abilities of 12 ordinary people to use their extraordinary skills to win a $100,000 grand prize.', 66491, 1, 1320577, 88686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1320575, 'Beyond the Imagination', 'Five contestants will put their incredible talents - ranging from synesthesic, stereoscopic, memory and frog call skills - to the ultimate test, as they compete for the grand prize of $50,000 dollars. Host Kal Penn, along with celebrity panelists Mike Tyson, Christina Milian and Dr. Rahul Jandial, have a tough decision, as they must help to decide who wins it all.', 66491, 1, 1320575, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330352, 'More Than Meets the Mind', 'Five new contestants show off their outrageous talents - from master memorizers to mathematicians - the panelists and audience are left stunned. With the $50,000 grand prize on the line, another tough decision must be made.', 66491, 2, 1330352, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330353, 'Believe the Unbelievable', 'Five new contestants demonstrate their insane talents on the SUPERHUMAN stage and the judges and audience are left speechless after seeing what could be the best challenge yet. Skills range rom photographic memory, to recognizing bird calls and translating backwards language.', 66491, 3, 1330353, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1334040, 'Extreme Awareness', 'Five seemingly ordinary people compete in incredibly difficult mind and body challenges, hoping to impress the celebrity panelists and audience. Each contestant showcases his/her special talent, with one challenge involving famed magicians Penn & Teller. However, only one will win the grand prize of $50,000.', 66491, 4, 1334040, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1336837, 'All Parts Extraordinary', '$50,000 dollars and the title of "SUPERHUMAN" is on the line, as five new contestants showcase their incredible skills. From memorization to speed counting and facial recognition, the panelists and audience are left stunned, challenge after challenge.', 66491, 5, 1336837, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1338362, 'No Task Too Tall', 'Five new contestants demonstrate their extraordinary talents on the SUPERHUMAN stage. From a contestant who can memorize every detail of a set of keys used to unlock various doors to another who remembers the ice cream order of more than thirty students, the panelists are blown away by their talents. But when one contestant fails to complete a challenge, the studio audience struggles to determine who will win the grand prize of $50,000 dollars.', 66491, 6, 1338362, 88685, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1344833, 'Powers of Deduction', 'Five new contestants demonstrate their extraordinary talents on the SUPERHUMAN stage. With the $50,000 grand prize on the line, another tough decision must be made.', 66491, 7, 1344833, 88685, null);
