INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866203, 'Misunderstanding', 'Marcie defends herself on the bus. Marcie and Peppermint Patty hear something while they try to sleep at camp; A boy named Floyd keeps calling Marcie "lambcake" and she does not like it; Peppermint Patty tells Floyd love is painful; Floyd wants a picture with Marcie.', 66514, 74, 1866203, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866204, 'Too Cute', 'Sally gets a love letter; Charlie Brown and Sally have to buy school supplies; Charlie Brown tells Sally to sleep off the bad day; Charlie Brown writes Sally''s book report.', 66514, 75, 1866204, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866205, 'Team Spirit', 'Frieda joins Charlie Brown''s baseball team; Charlie Brown gets hit on the head; Lucy''s only focus during the game is her baseball glove.', 66514, 76, 1866205, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866206, 'Just for Love', 'Lucy thinks Schroeder is cute; Frieda is at Schroeder''s piano; Frieda offers a used Valentine.', 66514, 77, 1866206, 77121, null);
