INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866211, 'Nice Doggy', 'Charlie Brown tells Linus the story of how he got Snoopy.', 66514, 82, 1866211, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866212, 'Company', 'Rerun wants a dog, and wants to borrow Snoopy; Rerun wants a role model; Rerun wins a balloon.', 66514, 83, 1866212, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866213, 'Reach for the Stars', 'Sally asks about a science program on TV. Charlie Brown and Linus watch the stars; Sally doubts the Tooth Fairy exits; Snoopy''s dog house catches fire.', 66514, 84, 1866213, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866214, 'Creepy Crawlies', 'Woodstock has a creature in his nest. Linus explains the importance of bugs; Lucy and Sally meet a bug; Snoopy has a bug in his supper dish.', 66514, 85, 1866214, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866215, 'Kind of Spooky', 'Sally does not want to kick a football; Linus watches a scary movie about feet; Linus and Charlie Brown discuss writing to the Great Pumpkin and Santa.', 66514, 86, 1866215, 77121, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1866216, 'Fly', 'Woodstock and Snoopy fly; Linus and Snoopy time Woodstock''s flying; Woodstock gets trained to go to the moon.', 66514, 87, 1866216, 77121, null);
