INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195261, 'All Is Not Lost', 'A British ex-special forces agent leads a rescue mission after a commercial flight crashes on an uninhabited island. The survivors make a discovery that could change everything.', 66556, 1, 1195261, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195263, 'Rest in Peace, Callaway Hinkle', 'The survivors find a satellite phone, Danny confronts his past, Todd learns about the death of his child, and a discovery is made that could change everything.', 66556, 2, 1195263, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195266, 'Always Meant to See That', 'Pack, Emma, and Florence face a tough choice and the survivors make a discovery that could change everything.', 66556, 3, 1195266, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195265, 'The Community Pile', 'Pack goes on a vision quest, Danny helps Owen relax, Todd makes a power play to take control, and the survivors make a discovery that could change everything.', 66556, 4, 1195265, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195264, 'Tubthumping', 'The survivors hold an election, Danny and Todd face off, and the survivors make a discovery that could change everything.', 66556, 5, 1195264, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202904, 'The Phantom', 'Todd adjusts to a life of solitude, Pack finds other crash survivors, and the survivors make a discovery that could change everything.', 66556, 6, 1202904, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202905, 'The Trial', 'The survivors hold a trial after someone is seriously injured and the survivors make a discovery that could change everything.', 66556, 7, 1202905, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202906, 'The Adventures of Beth and Lamar', 'Danny and Owen start a new camp, two survivors try to escape the island, and the survivors make a discovery that could change everything.', 66556, 8, 1202906, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202907, 'Javier and the Gang', 'Owen has an encounter in the jungle. Todd, Florence, and Emma adjust to life off the island and the survivors make a discovery that could change everything.', 66556, 9, 1202907, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1202908, 'Cop Tricks', 'The survivors make a discovery that could change everything.', 66556, 10, 1202908, 77284, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330327, 'Ransom', 'The newly arrived pirates try to ransom Danny while marooning the others. Steve tries to make amends for murdering a survivor.', 66556, 1, 1330327, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330329, 'Poison', 'After the pirates decide to stay on the island, Pack tries to negotiate a truce. Steve pitches Danny on a new business venture.', 66556, 2, 1330329, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330330, 'Caiman', 'After something taints the water upstream, Florence and Karen hike into the jungle to find the source while the others debate whether they want the pirates to spoil “Game of Thrones.” Steve strikes up an unlikely romance.', 66556, 3, 1330330, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330331, 'Tony Pepperoni', 'Owen and Florence deal with the return of a deadly foe. Todd makes a haunting discovery about his past after trying to fist fight Chet. I guess Owen is the captain now. Or maybe Florence again? Hard to say.', 66556, 4, 1330331, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330332, 'No One Rides for Free', 'Jess & Todd attempt to buy passage on the pirate''s ship through unconventional means. Owen starts to have feelings for Florence, as Steve grapples with his new love. Jess and Todd are both the captains now, like a sort of dual-captain scenario.', 66556, 5, 1330332, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330333, 'Sister Mercy', 'After discovering the pirate''s plan to harvest their organs, the survivors attempt to escape the island. Karen must make a difficult decision that echoes a moment from her past. Will the pirates remain the captains now?', 66556, 6, 1330333, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330334, 'Cruise-ifornication', 'After making it onto the pirate''s ship (a Red Hot Chili Peppers tribute band cruise), the survivors divide after only some of them get showers. Pack and Bruce form an unlikely friendship.', 66556, 7, 1330334, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330335, 'Speed', 'After Todd and Jess decide to get married, Florence and Owen struggle to define their new romance. Casey returns to officiate the wedding. Pack and Steve make a discovery that threatens to tear them apart.', 66556, 8, 1330335, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330336, 'The Setup', 'Danny launches an investigation after the survivors discover someone has sabotaged the ship by blowing up the engine. Steve makes a shocking discovery at the bottom of the ship. Honestly, no one is the captain now.', 66556, 9, 1330336, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1330337, 'Nerd Speak', 'As the ship sinks, the survivors attempt to escape. Will anyone be the captain now ever again?', 66556, 10, 1330337, 89686, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1542955, 'Bush Man', 'After surviving the Cruisifornication explosion and washing ashore on a new island, the survivors uncover a menacing threat, begging the question -- wait, does anyone actually read these episode descriptions?', 66556, 1, 1542955, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1542956, 'Puke & Cigars', 'After a charismatic millionaire rescues the survivors, Jess and Florence suspect he may not be what he seems, and set out to answer the question -- who is Declan Stanwick? And more importantly, who is reading this? Anyone?', 66556, 2, 1542956, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1542957, 'Six Feet', 'After discovering Declan''s sinister plot, Danny goes undercover with the rich, while Pack and Karen attempt to escape the compound. I wish we could escape writing these episode descriptions, am I right? No one actually reads these, right?', 66556, 3, 1542957, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1542958, 'A Game of Chest', 'After Jess loses her recollection of the last decade, Todd attempts to spark her memory. Steve and Declan face off in a battle of wits.', 66556, 4, 1542958, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1542959, 'Last Meal', 'On the eve of The Hunt, Martha offers to the survivors'' one last meal of their choosing -- as long as they can all decide together.', 66556, 5, 1542959, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1543055, 'Hunt Day', 'It''s Hunt Day, and the survivors must face off against each other in a battle royale to the death.', 66556, 6, 1543055, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1543056, 'Ballers', 'Attempting to hide from the others during The Hunt, Pack and Jess run into a new threat on the island.', 66556, 7, 1543056, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1543057, 'The Dark Prince Returns', 'With Karen gravely injured, Owen and Danny must journey to the center of the island to defeat Chettywompwomp. Florence learns more about Karen''s backstory. Pack, Todd and Jess face a futile task.', 66556, 8, 1543057, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1577589, 'Mrs. Stanwick', 'The survivors attempt to turn the tables on the rich and lure them into a trap.', 66556, 9, 1577589, 107571, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1577591, 'The Island Family', 'Barricaded in the mansion and surrounded by the rich, the survivors mount one last attempt to escape Declan''s island.', 66556, 10, 1577591, 107571, null);
