INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606868, 'Life, Here I Come', 'Satakieli is getting out of the ward and Hyde is moving out from his parents. Papillon is stuck on bloody nightmare, however.', 66575, 1, 1606868, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606869, 'Last Samurai', 'Hyde and Papillon are bugged by the system. Why stress about work when there''s easier ways to make money and getting drunk is more fun?', 66575, 2, 1606869, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606880, 'Bonnie and Clyde', 'Sampo is totally done with school and gets Sonja to be his partner in crime, who also trusts him with a secret.', 66575, 3, 1606880, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606881, 'Spaghetti Western', 'One shopping trip pushes Hyde and Papillon one step closer to the edge.', 66575, 4, 1606881, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606882, 'Kids and Adults', 'Teacher is threatening Sampo with repeating the fifth class. Sampo''s family arrange rude surprise for him.', 66575, 5, 1606882, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606883, 'Controlled Overdose', 'Satakieli is back in the ward and Hyde wants back in too. He just needs bit help from Papillon and larger daily dose.', 66575, 6, 1606883, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606884, 'Gas For Dostojesvki', 'Sampo is mourning his brother and decides to give lesson to Pässi.', 66575, 7, 1606884, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606885, 'Escape From Alcatraz', 'You reap what you sow. Papillon is behind the bars, but is he man enough to stand against his father?', 66575, 8, 1606885, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606886, 'Pedal to the Metal', 'Cornered Sampo decides to screw everything and drive into sunset, with fatal consequences.', 66575, 9, 1606886, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1606887, 'Living and the Dead', 'It''s time to jump and spread the wings.', 66575, 10, 1606887, 111139, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195695, 'Morocco', 'Joining our Stupid Man and his Smart Phone is online prankster, Arron Crascall. Challenges include making fire with camel dung, winning over the hearts of the remote Berber tribe, preparing and cooking a desert lizard that’s still moving, surviving an Egyptian cobra, giving each other rectal enemas…and generally coping with the boiling hot, dehydrating desert.', 66576, 1, 1195695, 77327, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195696, 'Norway', 'Russell Kane is crossing into the deadly Arctic Circle, travelling as far north as he can go – desperate for a cheeky peak at the legendary and beautiful Northern Lights. His mission partners are YouTube’s beguiling wife and wife team - Rose and Rosie.', 66576, 2, 1195696, 77327, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195697, 'Costa Rican: Jungle', 'Russell''s in the Costa Rican jungle with YouTube singing superstar Conor Maynard for the most foolhardy mission yet, with just their mobile phone to help them survive. The Maleku tribe set the mission, which would be easy if it wasn''t for deadly bullet ants, giant abseils and fast river crossings. Oh, and the fact that, for this task, internet reception rarely gets above one bar. Battling humidity and monsoon, the lads will have to convert their phones into multi-tools - using their backlights to attract grasshoppers for dinner - and rely on the inbuilt compass to navigate them safely back to civilisation.', 66576, 3, 1195697, 77327, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195698, 'Italy', 'Russell Kane is going to new heights to prove the internet can transform him into a survival expert by climbing the historic Dolomite Mountains of Italy without any survival or climbing experience. He’s convinced that all knowledge of climbing and survival can be gleaned from his mobile phone, so he isn’t taking on any training; just a partner who has loads of online followers. And that partner is Badman, Muslim internet star, Humza Arshad.', 66576, 4, 1195698, 77327, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195699, 'Poland', 'Joining Russell Kane is the rock ‘n’ roll, heartthrob internet star, TheMazziMaz. The useless pair are chased across Poland by scary-looking guards with dogs. Our hapless heroes are convinced that, even though they have no evasion or tracking skills or any ability to speak a word in Polish, they can evade capture by using just their mobile phones. They are sorely mistaken!', 66576, 5, 1195699, 77327, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195785, 'Costa Rica: Desert Island', 'Series finale. Dropped off by a gruff fisherman on a Costa Rican island, Russell must tool up with enough internet knowledge to escape nature’s clutches, navigate the seas and find his way back to civilisation. His chosen companion this time comes in the shape of snowboarding heroine and Olympian Jenny Jones.', 66576, 6, 1195785, 77327, null);
