INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195750, 'Grapefruit and Probiotics', 'Kate Quilton travels to Swaziland to find out how they get tinned grapefruit so perfect, and, in Finland, Matt Tebbutt discovers exactly what the bacteria are in Probiotics.', 66581, 1, 1195750, 77336, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195776, 'Dates, Sausages, Apples', 'What exactly is processed meat, and is a fresh British banger healthier than a frankfurter? Jimmy investigates dates. And Matt meets a man who has 250 varieties of apple on his tree.', 66581, 1, 1195776, 77341, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195777, 'Pepper, Yeast, Crisps', 'Are crisp flavours made of real cheese and onion or cooked up in a lab? Matt investigates. Meanwhile, Kate learns the secrets of pepper, and Jimmy finds out about different types of yeast.', 66581, 2, 1195777, 77341, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195778, 'Marmalade, Fish, Goat', 'Why does marmalade taste bitter when it''s made of sugar and oranges? Which fish are fully sustainable? And are the British public up for goat meat?', 66581, 3, 1195778, 77341, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1195779, 'Bell Pepper, Leek, Manuka', 'Jimmy joins the battle between the bell pepper and the Mediterranean fruit fly. Matt visits an amazing mobile leek factory. And how can you tell how much manuka is in your manuka honey?', 66581, 4, 1195779, 77341, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279938, 'Green Beans, Scallops, Cornish Pasties', 'At a green bean plantation in Kenya, Jimmy learns how they grow the beans so straight for the supermarkets, and finds out what happens to the beans that don''t make the grade. He also discovers the remarkable lengths that the farmers go to to stop the local wildlife destroying their valuable crop. At a Norwegian scallop farm, Matt braves the icy waters of the North Sea to join the divers harvesting scallops by hand from the sea bed. This sustainable farming method could be a model for the rest of Europe, but it needs a constant source of baby scallops, so Matt gets hands-on in the hatchery as he learns how to encourage a scallop to procreate. And Kate tries to unravel a mystery about Cornwall''s most famous local delicacy: what exactly goes into a Cornish Pasty, swede or turnip?', 66581, 1, 1279938, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896743, 'Food Unwrapped: Is Lunch Making Me Fat?', 'What''s more fattening: sandwiches, wraps or bagels? What sort of lunches make us sleepy? Dr Helen Lawal investigates the rise in teenagers having fried chicken for lunch. Plus: sushi.', 66581, 8, 1896743, 130428, null);
