INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279939, 'Icing Sugar, Rice, Sandwiches', 'Kate visits Israel to unearth the mystery ingredient that makes icing sugar so light, fluffy and powdery. Her journey takes her via a dip in the Dead Sea to an enormous phosphate mine in the desert, where all is revealed. In Italy, Jimmy investigates the difference between risotto rice and long grain rice. An early morning trip to a bustling rice auction and a visit to a flooded rice field shed some light. Back in the UK, Jimmy challenges renowned Italian chef Gennaro Contaldo to knock up a risotto using long grain rice; can it be done? And where do pre-packed sandwiches'' crusts go? Matt discovers that one sandwich maker has come up with an innovative - and surprising - way of putting the waste bread to good use', 66581, 2, 1279939, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279940, 'Pesto, Cockles, Marshmallows', 'Jimmy Doherty, Kate Quilton and Matt Tebbutt reveal more unusual, intriguing and surprising secrets behind the food we eat. Matt heads to Italy to find out how supermarkets can sell pesto at an affordable price when the traditional ingredients are expensive. He visits one of Europe''s biggest pesto producers and takes a remarkable trip to the bottom of the Mediterranean Sea, where basil is being grown in an extraordinary underwater farm. Jimmy wants to know why so many cockles in our supermarkets come from abroad, when he always thought of them as a quintessentially British staple. He visits Wales and the Wash, where two very different stories unfold, and witnesses a remarkable method of cockle gathering that has to be seen to be believed. And why do marshmallows go so crispy and melty at the same time over the campfire? Kate takes a colourful trip around Europe''s largest marshmallow factory to find out.', 66581, 3, 1279940, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279941, 'Craft Beer, Tomatoes, Anchovies', 'Jimmy Doherty investigates craft beer, meeting a couple who gave up jobs in the NHS to pursue their dream lifestyle of brewing and selling ale. Kate Quilton goes in search of the perfect tomato and finds herself in the middle of the world''s biggest food fight at a festival in Valencia, while Matt Tebbutt examines why tinned anchovies taste salty when fresh ones don''t, visiting a processing plant to find out.', 66581, 4, 1279941, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279942, 'British Cheese, Parma Ham, Limes', 'Jimmy Doherty visits the largest wholesale food market in the world in Paris and discovers why British cheese sales are soaring across Europe. Matt Tebbutt travels to one of the largest ham producers in Italy and meets a pig farmer who tells him about a delicate problem that all pork producers face, while Kate Quilton investigates why some limes are so much juicier than others.', 66581, 5, 1279942, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279943, 'Skyr, Oysters, Dried Strawberries', 'Jimmy Doherty looks into skyr, a mysterious yoghurt-like product that claims to be entirely fat-free, but has a surprisingly creamy texture, while Kate Quilton heads to one of the busiest oyster hatcheries in France, where she witnesses the amazing science that goes into providing oysters year-round. Plus, Matt Tebbutt wants to know if the dried strawberries in his cereal are real or just a clever imitation.', 66581, 6, 1279943, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279944, 'Parmesan, Paprika, Hard-Boiled Eggs', 'In Italy, Jimmy looks into why Parmesan costs up to twice as much as supermarket Cheddar. Kate''s been puzzling over paprika and travels to Hungary and Spain to find out exactly where it comes from. And Matt looks at hard-boiled eggs - it can be fiddly enough getting the shell off in the comfort of your own kitchen, so how do the big players manage it now that hard-boiled eggs are popping up everywhere in supermarkets?', 66581, 7, 1279944, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279945, 'Dates, Almond Butter, Haggis', 'Jimmy''s off to Israel on the trail of an elusive fruit - the fresh date. If raisins are dried grapes and prunes are dried plums, then what exactly are dates? Jimmy''s search for the answer takes him to a vast water purification plant, where they harness the raw sewage of Tel Aviv to turn barren desert into fertile farmland. Kate flies to California to investigate why almond butter is more expensive than other nutty spreads, and discovers a combination of extreme weather and global economics have made the price of almonds go completely nuts. And Matt''s in Scotland, investigating haggis. He makes a surprising discovery about the dish''s true origins - and then faces the nerve-shredding ordeal of delivering some highly unwelcome news to an unsuspecting audience.', 66581, 8, 1279945, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279946, 'Bell Peppers, Subterranean Salt, Coconut Oil, Brazil Nuts', 'Jimmy takes to the skies above Israel to join the battle to protect the bell pepper crop from the Mediterranean fruit fly, but is amazed to learn that it''s not insecticide that he''s helping to spread across the desert. Can you put dishwasher salt on your chips? Jimmy visits an extraordinary underground salt mine in Sicily, with a vast network of tunnels leading to a subterranean salt processing plant. Kate visits Vietnam to find out if coconut oil is any healthier than other oils. She also heads to the Amazon rainforest to investigate rumours that the Brazil nuts on UK supermarket shelves are all radioactive.', 66581, 9, 1279946, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1279947, 'Diet Special 2017', 'Sorry, no summary available for this episode!', 66581, 10, 1279947, 85770, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896736, 'Coconut Shortage, Compostable Plastic, the Macaron', 'Jimmy Doherty finds out how Sri Lanka is coping with a looming coconut shortage, while Kate Quilton discovers whether compostables could be the answer to worldwide plastic pollution problem, and Matt Tebbutt is in Paris to learn why the macaron has such a hefty price tag.', 66581, 1, 1896736, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896737, 'Pizza, Shrimp Shells, Salted Caramel', 'Kate Quilton learns about a potentially life-saving property of discarded shrimp shells and Matt Tebbutt investigates why people cannot seem to get enough of salted caramel. Plus, Jimmy Doherty explores the price differences between fresh and frozen…', 66581, 2, 1896737, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896738, 'Hen''s Eggs, Beer Bubbles, Supermarket Burgers', 'Kate uncovers something surprising about small hens'' eggs. Plus: why can''t you eat supermarket burgers pink? And where do the bubbles in beer come from?', 66581, 3, 1896738, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896739, 'Camel Milk, Fresh Pasta, Value Ranges', 'How do you milk a camel? Kate investigates, and explores camel milk''s rising popularity. How does supermarket fresh pasta last so long? And should we buy supermarkets'' standard products or value ones?', 66581, 4, 1896739, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896740, 'Bacon, Fish Fingers, Calcium, New Zealand Lamb', 'Can booze keep you warm? How safe is bacon? Jimmy discovers something unexpected in fish fingers. Why is there calcium in bread? And how can New Zealand lamb be sold as ''fresh'' here?', 66581, 5, 1896740, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896741, 'Potatoes, Smoked Fish, Carb-Restrictive Diets', 'Kate explores the surprising secrets of the vegan cheese melt, in this special vegan episode. Plus: should we be raising children as vegan? And can Jimmy go vegan for a week?', 66581, 6, 1896741, 130428, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896742, 'Potatoes, Smoked Fish, Carb-Restrictive Diets', 'Have you ever wondered how the humble spud is turned into the unusual shapes in your favourite bag of crisps? Jimmy Doherty visits Germany to learn the secret behind the twists, twirls and curls of this much-loved snack. Dr Helen Lawal investigates whether carb-restrictive diets really burn fat quicker, and uncovers an astonishing medical use for this popular weight-loss tool. And Matt Tebbutt finds out the surprising reason why smoked fish is dyed yellow.', 66581, 7, 1896742, 130428, null);
