INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1896747, '19.08.2019', 'Jimmy Doherty investigates whether protein supplements help build better bodies and also heads to Japan to learn about wasabi. Matt Tebbutt exposes the potential dangers of consuming grapefruit while on certain medications, and finds out which foods generate the most wind, while Kate Quilton lifts the lid on peanut butter''s shelf life, and asks if there is really any difference between dog and cat food.', 66581, 10, 1896747, 130428, null);
