INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196203, 'Part 1', 'In the river region of The Gambia in 1750, Omoro Kinte and his wife, Binta, give birth to a son, Kunta. Kunta is kidnapped in 1767 and sold to British slave traders. After arriving in Maryland, Virginia planter John Waller purchases Kunta.', 66606, 1, 1196203, 77382, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196774, 'Part 2', 'Redcoats attempt to persuade slaves to run away and join the English army. Kunta escapes but slave catchers apprehend him and amputate half of his foot to ensure he never runs off again. John Waller sells Kunta to his younger brother, William.', 66606, 2, 1196774, 77382, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196775, 'Part 3', 'George becomes an accomplished trainer of gamecocks and earns the nickname of Chicken George. George marries Matilda, a preacher''s daughter, and fathers many children. Tom Lea loses a wager with an Englishman and sells George to save his farm.', 66606, 3, 1196775, 77382, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196776, 'Part 4', 'Chicken George returns to the Lea farm after 20 years. George''s son, Tom, nurses a grudge against his father. George and Cyrus join the Memphis Colored Battery. Tom returns home after the war to embark on a new life with his family.', 66606, 4, 1196776, 77382, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196380, 'The Meat Raffle', 'Doreen is showing new barmaid Sam the ropes while gossiping about the team captain and trying to raffle off a platter of meat that is of questionable quality. Pete gets locked in the loo with little hope of release.', 66609, 1, 1196380, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196381, 'The Biscuit Plate', 'Pete finds himself in an awkward situation when he blames the goalkeeper for the club''s latest defeat. Tom''s new trousers cause amusement and Sam tries to cover up her own clumsiness.', 66609, 2, 1196381, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196382, 'The Tankard', 'It''s fundraising night in the clubhouse but the pressure proves too much for Pete when he tries to set a record for eating the most fish fingers.', 66609, 3, 1196382, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196383, 'England v Macedonia', 'England take on Macedonia and the fans tune in at the clubhouse. Mandy confides in Doreen about her night with Willy. But could anyone be eavesdropping?', 66609, 4, 1196383, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196384, 'Bonzo the Redbridge Rover', 'Things don''t go entirely as Pete hoped when he brings his young son Stanley to his first ever Redbridge Rovers game.', 66609, 5, 1196384, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196385, 'The Anniversary', 'Pete lays on a huge surprise for Doreen as she celebrates 25 years of working at the Rovers'' clubhouse.', 66609, 6, 1196385, 77412, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196589, 'A God''s Gift', 'It''s the first day of the new school year and the Murakami kids, Yuko and Takuto, are excited to be heading back and catch up with their friends. While Takuto makes it to school, Yuko stops by a shrine that doesn’t get too many visitors these days to pray for the new school year. At the shrine Yuko accidentally breaks the bell and drops it on top of an old man, Kami-sama. Because she is the only person that stopped by the shrine in a long time, Kami-sama grants her the power to become a superheroine. It is now her job to protect her neighborhood from the threats it faces.', 66614, 1, 1196589, 77426, null);
