INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1254922, 'Pilot', 'The stand-ups at L.A.''s primo comedy club, run by the formidable Goldie, react to rising star Clay Appuzzo''s big appearance on ''The Tonight Show Starring Johnny Carson'' in unexpected ways. Comics Cassie and Bill are most affected. Eager to join L.A.''s burgeoning comedy scene, Boston transplants Eddie and Ron are surprised by their unorthodox accommodations and young up-and-comer Adam is forced into a compromising situation by his manager Carl.', 66620, 1, 1254922, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324151, 'Midnight Special', 'Goldie taps Bill, Ralph and Edgar for an industry showcase at the club. When Bill lands a coveted spot on ''Midnight Special,'' his cantankerous father and sister fly in for the show, leading to surprising family drama. Adam is invited to help Goldie with some handyman work at her house and becomes one of the few people allowed inside her personal life.', 66620, 2, 1324151, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324152, 'The Cost of a Free Buffet', 'After defying Goldie, Edgar tries desperately to get back into her good graces. Cassie tests out some controversial new material, to mixed reviews. Adam, Eddie and Ron join forces to take down a ventriloquist. Bill tries to keep his father and sister entertained on their vacation. Goldie is forced to make a tough decision when her oldest friend Judy comes to town.', 66620, 3, 1324152, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324153, 'Sugar and Spice', 'Goldie''s ex-husband shows up and asks her for a favor. A female fan shows her love for Eddie in an unusual fashion. When Bill takes Cassie to an exclusive party at the Riot House, she has a revelation. Adam meets his comedy idol. Cassie wrestles with what it means to be a woman in the comedy world.', 66620, 4, 1324153, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324154, 'The Return', 'Goldie pitches an idea at her weekly poker game, which Eli believes he can sell. Nick returns after a long and mysterious hiatus, causing friction between Cassie and Bill. Adam starts a new handyman job and quickly learns there''s more to the gig than was promised. A visit from Ralph''s Vietnam buddy forces him to confront things better left buried.', 66620, 5, 1324154, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324155, 'Girls Are Funny Too', 'Nick books a life-changing gig. Adam questions Barton about his odd accommodations. Bill tags along with Sully on a sales call that doesn’t end well. Eddie and Ron go on a painful double date. Goldie and Eli sell their comedy special.', 66620, 6, 1324155, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324156, 'My Rifle, My Pony and Me', 'Goldie learns she may have misjudged her relationship with Eli. Eddie helps Cassie hone her material, but with some ulterior motives. Ralph and Edgar''s unforgettable road trip ends badly. Bill helps Nick with a problem from his past.', 66620, 7, 1324156, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324157, 'The Unbelievable Power of Believing', 'A disastrous meeting causes Nick to reevaluate his relationship with girlfriend Tawny. Maggie gives Ron a self-help book that provides him with temporary superpowers. Barton proposes a deal with Goldie''s rival Teddy.', 66620, 8, 1324157, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324158, 'Lingchi', 'Goldie grapples with Marty and Eli over creative control. The comics rally around Bill. An ultimatum from his agent forces Nick to make a fateful decision. Barton and Teddy''s scheming could spell disaster for Adam.', 66620, 9, 1324158, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1324159, 'Creative Indifferences', 'Goldie forces Cassie to choose a side; Adam has a great set, but shows up Ralph; Ron helps Eddie get revenge on DJ Kenny; Nick starts down a new path.', 66620, 10, 1324159, 77452, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1416399, 'Gone with the Wind', 'Goldie looks to expand her comedy empire with the help of an old friend, while her estranged daughter Amanda resurfaces. Cassie awaits the premiere of her comedy special. Eddie and Adam ride the fame wave from Ron''s sitcom stardom. Ralph, Nick and Bill hit the road on a comedy tour, where they have a run-in with the law.', 66620, 1, 1416399, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1473860, 'Plus One', 'Goldie contends with her daughter Amanda''s vow of silence and her ''spiritual mentor'' Howard. Adam tags along with Ron to Soul Train and meets the show''s producer. An anxious Cassie travels home to Texas for a wedding, where she faces some difficult choices from her past. Nick, Bill and Ralph show up at the wedding as well. Eddie capitalizes on a career opportunity with his idol.', 66620, 2, 1473860, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1473861, 'Bete Noire', 'Goldie is rattled by a break in. New comic Dawn Lima takes the main stage. Edgar and Arnie stumble upon a risky money-making enterprise. Nick moves in with Bill. Ron’s sitcom stardom brings unexpected repercussions, while Eddie writes jokes for his idol Roy’s Tonight Show appearance.', 66620, 3, 1473861, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1473862, 'The Mattresses', 'Goldie asks Roy to perform at a telethon, but he and Eddie skip out to deal with Roy’s financial troubles. Cassie starts to doubt her relationship with Eddie. Ralph and Adam collect on a long overdue debt. Nick and Dawn get surprised by unwanted guests who drop by Goldie’s. The comics stage an intervention for Fitzy, which Ron spins into a party.', 66620, 4, 1473862, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1500753, 'Heroes and Villains', 'Edgar and Arnie expand their enterprise. Adam runs his material by Ralph, who takes it to a producer friend. Ron fosters a new relationship. Bill butts heads with a desperate Edgar. Nick uses Goldie’s stage as a confessional with unexpected results. Goldie and Roy argue over parenthood. Cassie and Eddie get a glimpse of the extremes that come with being Roy Martin.', 66620, 5, 1500753, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1504143, 'Between Us', 'Adam and Ralph get some good news. Goldie calls Amanda’s bluff. Ron tries to salvage good will from employers and coworkers. Adam assesses his relationship with Gloria. Bill helps Nick face legal trouble, while Nick confronts his Uncle Chris. Eddie receives a tough lesson in love from Roy. Cassie bonds with Dawn.', 66620, 6, 1504143, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1508510, 'Call Me a Ham', 'Goldie agrees to a favor for Ron. Arnie warns Edgar that Goldie is onto them. Ralph and Adam approach Dawn with an opportunity. Amanda gets Eddie in hot water. Cassie helps out Nick, a favor she might come to regret.', 66620, 7, 1508510, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240695, 'Girl''s Decision in Love', 'When Misaki buys some sleepwear with Hikaru''s opinion in mind, Natsumi comments on it and the two get into an argument.  Yuto sides against Natsumi.', 66647, 30, 1240695, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1508783, 'Now You See Me, Now You Don''t', 'A discontented Bill is asked to headline for an absent Roy. Nick and Eddie are presented with new opportunities. Amanda makes a shocking declaration. Cassie oversteps after a night out with Dawn.', 66620, 8, 1508783, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1508784, 'Deathbed Confessions', '', 66620, 9, 1508784, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1508785, 'Lines Crossed', '', 66620, 10, 1508785, 97584, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1196876, 'Jimmy Fallon & Miley Cyrus', 'Maya Rudolph and Martin Short star with Kenan Thompson and special guests Miley Cyrus, Larry David, Jimmy Fallon and Tom Hanks.', 66623, 1, 1196876, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198664, 'Steve Martin & Tina Fey', 'Maya Rudolph and Martin Short star with Kenan Thompson and special guests Drake, Tina Fey, Sean Hayes, Nathan Lane and Steve Martin.', 66623, 2, 1198664, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201199, 'John Cena / Nick Jonas / Eva Longoria / Ben Stiller', '', 66623, 3, 1201199, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201200, 'Ana Gasteyer / Ricky Gervais / Kevin Kline / Cecily Strong', '', 66623, 4, 1201200, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1205327, 'Sean Hayes / Steve Martin / Kelly Ripa / Emma Stone', 'The Season 1 finale includes guest stars Sean Hayes, Steve Martin, Kelly Ripa, and Emma Stone.', 66623, 6, 1205327, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1206079, 'Season 1, Episode 7', '', 66623, 7, 1206079, 77460, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197364, 'Episode 1', '', 66646, 1, 1197364, 77516, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197365, 'Episode 2', '', 66646, 2, 1197365, 77516, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197366, 'Episode 3', '', 66646, 3, 1197366, 77516, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197367, 'Episode 4', '', 66646, 4, 1197367, 77516, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197370, 'New Boys, New Girls, New City', 'One summer''s day, six young strangers move into a house together and start living an unscripted drama.', 66647, 1, 1197370, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197372, 'Three Crushes', 'Everyone changes into swimsuits after lunch and heads to the pool on the terrace.  The boys are excited at the sight of the girls in their swimsuits.', 66647, 2, 1197372, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197373, 'Dream Police', 'The roommates celebrate tap dancer Yuki''s birthday.  However, his harsh words trigger tears from both Mizuki and Yuriko.', 66647, 3, 1197373, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197374, 'In Tears Again', 'Makoto and Minori go out to dinner alone together.  Yuki asks Yuriko out on a date, but she''s had a bit too much sake to drink.  What will she say?', 66647, 4, 1197374, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197375, 'Eenie Meenie Miney Mo', 'Tatsuya rocks the house by declaring he''ll take each of the three girls on a date this summer.  Meanwhile, something is up with Minori and Makoto.', 66647, 5, 1197375, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197376, 'All Screwed Up', 'Tatsuya declared he would go on a date with all three of the girls.  First comes Mizuki, and next is Yuriko, but her date opens a whole can of worms.', 66647, 6, 1197376, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197377, 'Showing His True Colors', 'Makoto angers Tatsuya with his rash behavior but shows no signs of remorse, creating a touch-and-go situation in the boys'' room.', 66647, 7, 1197377, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197378, 'Late Night Poolside', 'Minori loses interest as she sees how Makoto behaves.  Tatsuya reflects on his dates with the three girls in an effort to choose one as his lover.', 66647, 8, 1197378, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197379, 'What A Good Day!', 'Tatsuya and Minori go on a second date.  Tatsuya tells her how he feels but says she need not give her answer now. Makoto has a present for Minori.', 66647, 9, 1197379, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197380, 'Before He Says the Word...', 'Unable to forget her ex, Yuriko calls and asks to see him.  Meanwhile, after receiving a present from Makoto, Minori talks to him about her feelings.', 66647, 10, 1197380, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197381, 'Boy from the Rainbow State', 'At the Girls Award event, Tatsuya and Minori meet former member Seina, who encouraged their budding relationship.  A new member arrives from overseas.', 66647, 11, 1197381, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197382, 'Is She Just Best of Three?', 'Tatsuya finally asks Minori to officially be his girlfriend.  How will she answer?  Hawaii-born Arman, the newest housemate, asks Mizuki out on a date.', 66647, 12, 1197382, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197383, 'Who Will Survive?', 'Yuriko confesses her feelings to the ex before leaving the house.  And her ex''s reply?  The boys get excited over the arrival of the new girl member.', 66647, 13, 1197383, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197384, 'Ikujinashi', 'Arisa''s arrival to the house excites Arman and Yuki because she''s "their type."  Meanwhile, Tatsuya and Minori find it difficult to take the next step.', 66647, 14, 1197384, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197385, 'Heating Up for Someone Else', 'A kiss takes Tatsuya and Minori''s relationship to the next level.  Arisa and Arman head to Mt. Takao on a date.  But Mizuki also has feelings for Arman.', 66647, 15, 1197385, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197386, 'Magic Spell Costco', 'Arisa grows closer to Arman after having gone out on a number of dates.  Yuki, who also hopes to ask Arisa out, tries hard to steal her attention.', 66647, 16, 1197386, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197387, 'Anywhere for You', 'Arman, Arisa, and Mizuki prepare the Japanese-style room for Minori and Tatsuya, now a couple.  Arisa promises she will go anywhere with Arman if he wins his fight.', 66647, 17, 1197387, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1197388, 'Worst Date Ever', 'Minori confesses her relationship issues to her older sister, Kurumi, who asks Minori whether the two are having make-up sex or not.', 66647, 18, 1197388, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240654, 'A Christmas Nightmare', 'Arman and Arisa go out on a Christmas dinner date.  The two hold hands and enjoy the Christmas lights.  Then, Arman expresses his feelings to Arisa.', 66647, 19, 1240654, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240667, 'Scissorhands', 'Excitement buzzes as Terrace House welcomes two new members.  But upon Natsumi''s arrival, an incident causes a clash between her and Minori.', 66647, 20, 1240667, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240668, 'Case of Poke Bowl', 'New member Natsumi invites Arman out to the beach one morning.  Later that day, Arman fixes the busy Arisa a Hawaiian fish salad called "poke."', 66647, 21, 1240668, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240669, 'Case of the Meat', 'One night, the housemates discover they have run out of food.  Minori suggests eating the fancy wagyu beef that Tatsuya got as a present at work.', 66647, 22, 1240669, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240670, 'No Use Crying Over Meat', 'Tatsuya is furious with his housemates for eating his beef without his permission.  Minori''s older sister comes to visit and reasons with him.', 66647, 23, 1240670, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240681, 'New It Girl in the City', 'Tatsuya and Minori depart from the house as a couple after seven month.  Upon arrival, the new girl becomes an instant love interest among the boys.', 66647, 24, 1240681, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240682, 'Mr. Perfect in the City', 'Aspiring architect Yuto Handa moves in after Misaki.  He intends to complete his studies at Harvard and attracts the attention of the female residents.', 66647, 25, 1240682, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240687, 'Love Is in the Air', 'Hikaru is interested in the new housemate Misaki.  When she talks about her ex, he doesn''t hide his irritation.  The next day, when the two are alone...', 66647, 26, 1240687, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240692, 'Always Smiling With You', 'Hikaru takes Misaki for a romantic motorbike ride to the beach.  Later, Misaki tells Natsumi that she wishes the date had lasted forever.', 66647, 27, 1240692, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240693, 'Cry, Cry, Cry', 'Yuto promises to go fishing with Natsumi, but he changes his mind and tells her he can''t go because of his girlfriend.  Natsumi starts to cry.', 66647, 28, 1240693, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240694, 'Nightie Nightmare', 'High school student Riko Nagai, who recently won a national beauty contest, joins the gang.  Misaki quickly befriends her and they chat about Hikaru.', 66647, 29, 1240694, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1811392, 'Episode 14', '', 66659, 14, 1811392, 91856, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1811393, 'Episode 15', '', 66659, 15, 1811393, 91856, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1811394, 'Episode 16', '', 66659, 16, 1811394, 91856, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240696, 'Natsumi & Fuyumi', 'Misaki confesses her feelings to Hikaru.  That night, she says something that makes Natsumi incredibly angry and winds up paying the price for it.', 66647, 31, 1240696, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240697, 'Shall We Pas de Deux?', 'When Hikaru suddenly declares that he will leave the house with Natsumi, the rest of the members are shocked.  Misaki has a talk with him in private.', 66647, 32, 1240697, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240698, 'First Dip in the Pool', 'Hayato promises to go on a date with Riko, but she worries she''s too young for him.  During the welcome party, an unexpected surprise occurs.', 66647, 33, 1240698, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240699, 'Hamburg x Hamburg', 'Riko asks Hayato if he thinks she''s immature, but he reassures her.  They decide on Tsukiji for their second date.  Arman participates in a festival.', 66647, 34, 1240699, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240700, 'Bye Bye Mr. Perfect', 'Momoka works up the courage to ask Arman out to the beach.  Hayato and Riko enjoy their date at Tsukiji.  Meanwhile, Yuto makes a decision.', 66647, 35, 1240700, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240701, 'Byrnes Sandwich', 'Shortly after Handa''s departure, Yuuki arrives at the house.  Good looking and tall, he''s just Riko''s type.  But he has his eyes on someone else.', 66647, 36, 1240701, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240702, 'Slow Down Your Love', 'Yuuki''s had his eye on Misaki ever since moving in and asks her out on a date.  Misaki tells him about her unrequited feelings for Hikaru.', 66647, 37, 1240702, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240707, 'Quick to Say I Love You', 'After their date ends awkwardly, Riko tries to clear the air with Hayato.  Meanwhile, Momoka faces a life-changing contest.', 66647, 38, 1240707, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240709, 'Rocket Girl Dives Into Love', 'During Misaki''s birthday party, Yuuki can''t control himself and confesses his feelings for Misaki.  The next morning, she asks if he remembers.', 66647, 39, 1240709, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240710, 'Midsummer Intimacy', 'Recently entrant Masako quickly declares her fondness for Hayato and promises to cook with him.  One night, the two of them spend time alone at the pool.', 66647, 40, 1240710, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240711, 'Better Luck This Time', 'Yuuki goes on his first drive with Misaki to Yokohama, where she once fell out of love.  He finally tells her how he really feels about her.', 66647, 41, 1240711, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240712, 'Fragile Boy, Fragile Girl', 'Masako feels even more strongly about Hayato and, after seeing him with Riko, asks him out on a date.  Arman goes out for nighttime skateboarding.', 66647, 42, 1240712, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240716, 'Kiss and Tell', 'Riko and Hayato''s date to see the fireworks ends uneventfully.  He says that he doesn''t see her as a woman, but this statement proves consequential.', 66647, 43, 1240716, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240722, 'Price of a Lie', 'Despite the apparent lack of progress in Riko and Hayato''s relationship, the other housemates question them upon learning they have already kissed.', 66647, 44, 1240722, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240726, 'The Riko Special', 'The house members confront Hayato and Riko about the lies they told about their relationship.  Hayato remains silent and all eyes turn to Riko.', 66647, 45, 1240726, 77518, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1240728, 'Bye Bye Terrace House in the City', 'In the season finale, as the evening of their arrangement arrives, Hayato prepares for Riko in his restaurant.  But she may be headed somewhere else.', 66647, 46, 1240728, 77518, null);
