INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1282949, 'Episode 5', '', 66649, 5, 1282949, 77522, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1282950, 'Episode 6', '', 66649, 6, 1282950, 77522, null);
