INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629853, 'Episode 3', 'It''s the news as you''ve never seen it before - a fascinating, funny look at the last seven days from the team behind QI. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 3, 1629853, 113446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629854, 'Episode 4', 'No Such Thing As The News is a current events programme you can watch with pleasure rather than anxiety. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 4, 1629854, 113446, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629855, 'Episode 5', 'No Such Thing As The News is a current events programme you can watch with pleasure rather than anxiety. With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 5, 1629855, 113446, null);
