INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1629857, 'Episode 7', 'A humorous look at the lesser-known events of the week. Who would ever have thought the news could be this much fun? With James Harkin, Andrew Hunter Murray, Anna Ptaszynski and Dan Schreiber.', 66657, 7, 1629857, 113446, null);
