INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198156, 'Pilot', 'Men who went to all-male schools and work in male-dominated professions talk about their lives.', 66700, 0, 1198156, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198158, 'The Only Man in a World of Women', '147 men who grew up and lived in female-dominated environments share their joys and agonies.', 66700, 1, 1198158, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198159, 'What''s It Like to Live as a Tone-Deaf Man?', 'Tone-deaf men afraid of going to karaoke have their singing abilities  assessed by Kim Yeon-woo, a wanna-be singer, and share what it is like to  live with tone deafness.', 66700, 2, 1198159, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198160, 'Men Who Lost More Than 10 kg', 'Men who lost more than 10 kg of weight are invited to speak about  weight-related issues, and discuss pros and cons of being on a diet.', 66700, 3, 1198160, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198161, 'Men Who Will Be Married Soon', 'Soon-to-be-married bachelors talk about marriage.', 66700, 4, 1198161, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198162, 'Men from the Countryside', 'Country boys who moved to Seoul share their thoughts on big city life.', 66700, 5, 1198162, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198163, 'Men With Unusual Names', 'Men with unusual names tell their stories. They are joined by two  special guests: Yoo Sang-moo, a comedian, and Kim Dong-hyun, a mixed  martial arts fighter.', 66700, 6, 1198163, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198164, 'Men Who are Dating or Married to Older Women', 'Men in relationships with older women tell stories they wouldn''t dare to share with their significant others.', 66700, 7, 1198164, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198165, 'Men Who Look Old or Young', 'Men who don''t look their age tell us about the pros and cons of looking older/younger than you are.', 66700, 8, 1198165, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198166, 'Men Who Look Alike', 'Male celebrity look-alikes share their stories. Special guests include "Gandhi" and "Obama."', 66700, 9, 1198166, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198167, 'Empolyment and War', 'Men who had a hard time finding a job discuss their experiences.', 66700, 10, 1198167, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198168, 'I Am A Woman Special', '100 women join the I Am a Man hosts and tell their stories.', 66700, 11, 1198168, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198169, 'The Single Man Special <The Single Since Birth and Broken-Hearted Man>', '100 single men talk about their lives being Single  Since Birth &amp; The Broken-Hearted Man. Guided by Muzie and Shin  Hyun-joon as dating experts, they tell the I Am a Man audience how to attract women.', 66700, 12, 1198169, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198170, 'Men Who Love Hip-Hop and Rock', 'Men who love hip-hop and rock music talk about their love for music.', 66700, 13, 1198170, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198171, 'Men Who Have Unique Jobs', 'This week, 100 men are invited to talk about their unique jobs.', 66700, 14, 1198171, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198172, 'Men and Women Special (1): Men and Women Who Live on Their Own', 'In this man and women special part 1, awkward situations between men and women turn into a hilarious situation.', 66700, 15, 1198172, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198173, 'Men and Women Special (2): I Am A Baseball Fanatic', 'In this man and women special part 2, I Am a Man hosts meet guys and girls who love baseball.', 66700, 16, 1198173, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198174, 'Men and Women Special (3): I Am An Alcohol Lover', 'In this man and women special part 3, they can''t live without drinking alcohol.', 66700, 17, 1198174, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198175, 'Men and Women Special (4): Men and Women Who Were Once Innocent', 'In this man and women special part 4, I Am a Man hosts meet man and women who were innocent in the past.', 66700, 18, 1198175, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198176, 'Men and Women Special (5): Men and Women Who Like to Travel', 'In this man and women special part 5, they just not only roamed around Korea, but also all around the world.', 66700, 19, 1198176, 77616, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198177, 'Title Match', 'It''s a title match between unique names, look-alikes, tone-deaf and fun-talented people.', 66700, 20, 1198177, 77616, null);
