INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198715, 'Part 1', 'The origin of O.J. Simpson''s football stardom in the ''60s, as America combusted with racial upheaval, and an examination into why the country fell in love with him off the field.', 66738, 1, 1198715, 77687, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198959, 'Part 2', 'While racial tension boils over in early-''90s Los Angeles, O.J. Simpson remains a world apart in exclusive Brentwood, cultivating a perfect image atop a life of secrets.', 66738, 2, 1198959, 77687, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198960, 'Part 3', 'O.J. Simpson is arrested and charged with the murders of his estranged wife and an acquaintance, setting off a saga unlike any in American history.', 66738, 3, 1198960, 77687, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198961, 'Part 4', 'O.J. Simpson''s 1995 "trial of the century" unfolds in downtown Los Angeles, riveting the country for months and reshaping the media and cultural landscape.', 66738, 4, 1198961, 77687, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198962, 'Part 5', 'In the years following his murder acquittal, O.J. Simpson''s life takes strange turns, culminating in a new arrest and, this time, a conviction.', 66738, 5, 1198962, 77687, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1198843, 'Pilot', 'Julie is in over her head when her husband suddenly dies leaving her as sole owner of The LA Rebels, a pro-football team.', 66748, 1, 1198843, 77702, null);
