INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199759, 'Can Gamers SURVIVE the Real Mirror''s Edge?', 'With the help of a professional parkour trainer, MatPat along with friends from Smosh Games and The Warp Zone learn how to perform some of the moves seen in Mirror''s Edge.', 66783, 1, 1199759, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199802, 'Soccer + Cars = AWESOME (Rocket League)', '', 66783, 2, 1199802, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199803, 'Can Gamers Defuse BOMBS? ft. Game Grumps (Keep Talking and Nobody Explodes)', '', 66783, 3, 1199803, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216294, 'DON''T GET CAUGHT! Stealthing like Metal Gear Solid', 'Over the years I’ve done a few theories on Metal Gear Solid, but my research has never involved real army vehicles, real guns, and REAL BOXES! For this episode I brought in a few friends to learn about Metal Gear Solid and real stealth tactics from a veteran and 12-year U.S. Navy Seal…who basically thinks we’re a bunch of gamer pansies. In our challenge we’ll find out just how stealthy we really are at trying to sneak into an actual military supply base in the middle of the night…I’ll give you a hint: not very stealthy.
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216295, 'Surviving Five Nights of FEAR!', 'You know me and animatronic restaurant horror…I just can’t stay away! So when the opportunity to recreate Five Nights at Candy’s came up, you know I was going to Game Lab the heck out of this one. Like every episode of Game Lab, it’s not just about recreating the game in real life, it’s about exploring why the game works and how it applies to the real world. In this episode, we test out the real game mechanics of Five Nights At Candy’s, then learn all about fear responses and why different people respond to these games differently. Our expert for the episode designs some of the most terrifying haunted houses in the world and shows us what it really means to dive into scary games. The 360 video for this episode is also an INCREDIBLY creepy first-person walk through FNAC alone…in the dark…with some unexpected friends… http://bit.ly/28YFQ2o
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216296, 'OSTRICH JOCKEYS?! (Final Fantasy XV)', 'Get ready for some good ol’ fashioned CHOCOBO RACING! Or, as close as I can get, when I traveled to the Arizona ostrich festival to hop on REAL racing ostriches. And these aren’t cute little chicks we’re talking about—these are gigantic, eight-foot, 40-miles-per-hour racing monsters! I got pecked, stepped-on, and bucked off for an entire day learning how to actually race these birds, then I took on some serious competition in an all out tournament. Learn what it means to “ride an ostrich like a football” and what happens when your bird decides they just don’t feel like finishing the race! Then, check everything out in 360 with a ride-along behind the scenes tour of the episode!', 66783, 6, 1216296, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507794, 'Olivia Culpo/Gabriel Iglesias/Mary Lynn Rajskub/Craig Robinson', 'Celebrity panelists include Olivia Culpo, Gabriel Iglesias, Mary Lynn Rajskub and Craig Robinson.', 66784, 13, 1507794, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507795, 'Iliza Shlesinger/Taye Diggs/Jana Kramer/Ken Marino', 'Celebrity panelists include Iliza Shlesinger, Taye Diggs, Jana Kramer and Ken Marino.', 66784, 14, 1507795, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1244254, 'Episode 106', '', 66825, 106, 1244254, 77884, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216297, 'Are YOU Being HACKED? (Watch Dogs 2)', 'Ever wonder what it’s like to be a real life hacker? As someone who works online, it’s one of those things I think about all the time. But it turns out, the truth about hacking is WAY scarier than I could have ever imagined. You know that insane hacking you see in Watch_Dogs and all the bizarre things you can hack like phones, cars, and stoplights? It’s all real, my friends, and it’s just the beginning! For this episode, we brought in two professional hackers to teach us the ins and outs of hacking into a major media company and grabbing data off of their own servers…FOR REAL. This is serious, scary stuff and it completely changed the way I look at the internet and hacking in real life. The 360 video for this one shows us actually breaking into the YouTube space by disabling its own security systems, then getting caught in some sticky situations…make sure you check it out!', 66783, 7, 1216297, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1216298, 'The Science of Sword Fighting! (For Honor)', 'For the finale of Game Lab Season 1 I wanted us to go out in style…so I decided to SIEGE MY OWN CASTLE! Or at least, a castle I rented for a day. This was one of the most fun episodes to make in the entire series—I got to learn sword techniques, dress in historic armor and stab the Beard Bros. IN THE FACE! When you think about comparing these games to real life, you think about the weapons and the armor, but you DON’T think about the adrenaline, the fatigue, and the idea of complete strangers running at you with axes. It’s a lot more intense and a lot more dangerous than I ever anticipated! For the 360 video, we staged a castle defense with trained knights and Vikings that literally puts you in the middle of the battle.', 66783, 8, 1216298, 77797, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199787, 'Tracee Ellis Ross', 'Tracee Ellis Ross joins our panel. Anthony Anderson has more than just his mother to worry about when his co-star and TV wife from "black-ish" is part of the game. Guests include America''s fastest texter, Taylor Swift''s high school sweetheart and somebody who likes to think inside the box - a contortionist.', 66784, 1, 1199787, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199788, 'Iliza Shlesinger', 'Comedian Iliza Shlesinger joins our celebrity panel to hilarious effect. In this episode we have one of the highest grossing Tupperware sales people who just happens to be a drag queen, shark attack survivors and somebody who jumps off buildings for a living. While on fire!', 66784, 2, 1199788, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1199789, 'Mike Tyson', 'With Mike Tyson joining the panel, we have a knock-out line-up of talent that includes a seven-time lottery winner and the woman who was the original voice of Siri. If there''s time, we might even squeeze in a wedding with someone who has been married more than forty times.', 66784, 3, 1199789, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507787, 'Brooks Wheelan', 'Among the contestants are the man with the world''s longest tongue, the inventor of the selfie stick, a professional bridesmaid, and the lead singer of the Village People.', 66784, 4, 1507787, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507788, 'Yvette Nicole Brown', 'Actress Yvette Nicole Brown joins the celebrity panel.', 66784, 5, 1507788, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507789, 'Daymond John', 'In the Season 1 finale, Daymond John joins the panel; and guests include the person with the longest fingernails in the world and Lady Houdini.', 66784, 6, 1507789, 77800, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1251074, 'Jalen Rose, Ashley Graham, Angela Kinsey, Donald Faison', 'The season premiere of "To Tell the Truth" features Ashley Graham, Jalen Rose, Angela Kinsey and Donald Faison on the celebrity panel. In this episode the panel is faced with finding the national champion Sumo wrestler, the inventor of the hashtag, the creator of the language Dothraki used on "Game of Thrones," an original dancer from "Soul Train" and someone who has survived a bear attack.', 66784, 1, 1251074, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1254092, 'Lara Spencer, David Arquette, Tom Bergeron, Sherri Shepherd', 'The celebrity panel of Lara Spencer, David Arquette, Tom Bergeron, and Sherri Shepherd is faced with finding the two-time national world champion drag-racer, someone who has been caught in the eye of a tornado, the creator of the dating site FarmersOnly.com, and a record-breaking professional strongwoman.', 66784, 2, 1254092, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1254093, 'Kal Penn, Justin Long, Nikki Glaser, Adam Rodriguez', 'The celebrity panel of Kal Penn, Adam Rodriguez, Nikki Glaser, and Justin Long is faced with finding a famous bowtie designer who is a janitor by day, a successful Marine who invited Mila Kunis as his date to the Marine Corps Ball, the inventor of "joggling" (juggling while running), and someone that was rescued by Harrison Ford.', 66784, 3, 1254093, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273549, 'Ross Mathews, Iliza Shlesinger, Cedric, Jamie Chung', 'The celebrity panel of Jamie Chung, Cedric the Entertainer, Iliza Shlesinger, and Ross Mathews is faced with finding the person who holds the national land speed record, a former NFL pro turned opera singer, a person who makes a living as a nude art model, and the world''s fastest auctioneer.', 66784, 4, 1273549, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273550, 'Martha Plimpton, Tom Bergeron, Sherri Shepherd, David Arquette', 'The celebrity panel of Martha Plimpton, David Arquette, Tom Bergeron, and Sherri Shepherd is faced with finding out whom the very first guest was on "The Oprah Winfrey Show," a contestant who lost 365 pounds by walking, a contestant who only ate Starbucks for 365 days, someone who can extract venom from snakes, and a professional butt model.', 66784, 5, 1273550, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273551, 'Gabriel Iglesias, Craig Robinson, Rachel Platten, Lauren Ash', 'The celebrity panel of Rachel Platten, Gabriel Iglesias, Lauren Ash, and Craig Robinson is faced with finding twins who opened the only restaurant in the world staffed by identical twins, a participant who survived 20 hours at sea, the person who taught Miley Cyrus how to twerk, and someone who broke the record for the longest distance flown in a wing suit.', 66784, 6, 1273551, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273552, 'Jamie Kennedy, Andy Grammer, Natasha Leggero, Rachel Dratch', 'The celebrity panel of Natasha Leggero, Jamie Kennedy, Rachel Dratch, and Andy Grammer is faced with finding the composer of the memorable music from the TV series "Seinfeld," the fastest woman alive who is also an Olympic gold medalist, a survivor from the Miracle on the Hudson, the actor who portrayed Barney the dinosaur, and one of the original members of Destiny''s Child.', 66784, 7, 1273552, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1273553, 'Tracee Ellis Ross, Iliza Shlesinger, Cedric the Entertainer, Joshua Malina', 'The celebrity panel of Tracee Ellis Ross, Cedric the Entertainer, Iliza Shlesinger, and Joshua Malina is faced with finding a marathoner who ran 50 races in 50 states in 50 consecutive days, the builder of the world''s smallest house, the best paparazzi in the business, and the youngest person to climb Mount Everest.', 66784, 8, 1273553, 83271, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1507790, 'Justin Long/Arielle Kebbel/Nikki Glaser/Kal Penn', 'Celebrity guest panel is presented with the only person in the world to bike to the South Pole, the "Doggy Designer to the Star," and Usher''s choreographer.', 66784, 9, 1507790, 83271, null);
