INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200564, 'Waking Nightmare', 'After an extended drug bender, addict Jake ventures out into the quiet streets to discover he''s actually missed a terrifying global phenomenon.', 66819, 1, 1200564, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1201982, 'Cognitive Dissonance', 'Ellis'' plan hits a snag, just in time for some sleepless delirium to settle in.', 66819, 2, 1201982, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1203512, 'Night Terrors', 'As Ellis heads for Dallas, Jake, Sam and Ally are diverted by a new kind of foe.', 66819, 3, 1203512, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740238, 'Sweet Dreams', 'New clues converge in Dallas, while Ally attempts a dangerous reunion in Austin.', 66819, 4, 1740238, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740239, 'Beacons in the Dark', 'Lex shows her research to Ally; Ellis investigates a mysterious signal.', 66819, 5, 1740239, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740240, 'Wide Awake', 'In the season finale, alliances at Dr. Abrams'' facility are pushed to a breaking point; Ellis'' group puts their theory to the test.', 66819, 6, 1740240, 77877, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1429132, 'Manifest Destiny', 'Ellis finds his way to an aerodrome, meeting Aiden, who is being held at gunpoint and made to fly a light plane.', 66819, 1, 1429132, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1429133, 'Oasis', 'The team hunts for Gabbi and any chance to track down the Safe Sleep Zone, as Aidan and a new ally attempt to enter the Sandman''s Oasis.', 66819, 2, 1429133, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1429134, 'Lucid', 'Aidan and Paula check out their new "home" and the others deal with a group of maniacs who have a unique way of staying awake.', 66819, 3, 1429134, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740242, 'Circadian Rhythms', 'The group find themselves on a plane, piloted by an Ellis trying to hide his mental state from the others. Abrams gives out why he is no longer working in the facility.', 66819, 4, 1740242, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740243, 'Sleepwalkers', 'The team pursues the Oasis through the desert, as Aidan navigates the politics of the camp. Meredith finds an unlikely ally in her new assignment.', 66819, 5, 1740243, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740244, 'Parasomnia', 'As the fractured teams close in on the camp, a chance encounter pushes one hero to the breaking point. Aidan''s actions at the Oasis have unexpected consequences.', 66819, 6, 1740244, 98932, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1740245, 'Apnea', 'Forces converge on The Oasis and the battle for the sleep zone begins.', 66819, 7, 1740245, 98932, null);
