INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200661, 'Part 1', 'Catching Milat is a two-part Australian television miniseries that screened on the Seven Network, in collaboration with "Screen Australia" on 17 and 24 May 2015.[1] It is based on the book "Sins of the Brother" by Mark Whittaker and Les Kennedy and is loosely based upon the true story of how NSW Police and detectives under "Task Force Air" tracked down and caught serial killer Ivan Milat, who was responsible for the infamous backpacker murders.', 66823, 1, 1200661, 77881, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200662, 'Part 2', 'Clive Small, a former assistant police commissioner, retired detective and now author, served as the head of Task Force Air. He has criticised the program as a marginally fictionalised account, especially for overstating the role of Detective Paul Gordon.', 66823, 2, 1200662, 77881, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200663, 'Episode 1', 'Follow six boys from Sydney as they live a life of sex, drugs and rock ''n'' roll with the highs and lows of fame in the rock band INXS.', 66824, 1, 1200663, 77882, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1200664, 'Episode 2', 'INXS are at the peak of their success with the world at their feet. But the rock ''n'' roll lifestyle soon begins to take its toll, leading to a tragic and devastating end.', 66824, 2, 1200664, 77882, null);
