INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66033, 66033, 'Great Minds with Dan Harmon', 'Writer Dan Harmon has his assistant Spencer Crittenden construct a time machine to transport historical figures from the past so he can interview them. The interviewees only survive for a few hours before undergoing a "total protoplasmic disconversion" and collapsing into dust, which Spencer collects in a jar.', null, 'Returning Series', 0, 65, '2016-02-25', null, null, null, '/wvmrTACstFfr4sfBQrcxCDBg7dG.jpg', 0, '/bhP66s2Mz0h7pvTEdxJqg4Bn2AN.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66037, 66037, 'Forever Young', 'A girl from Hanoi (Linh), a huge fan of Korean pop culture, will go for some time to Korea.', null, 'Ended', 45, 538, '2014-12-17', null, null, null, '/1hU5WrvJN9eGU0W13lhQBljIWeB.jpg', 0, '/wfkpKrg96gX8hxJKAuVHBR4h0Ks.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66038, 66038, 'Les Kassos', 'The crisis saves nobody. Even not the characters of our childhood. To  such a point that some people of them even became socially disadvantaged  persons. Fortunately for them, all is not lost and a brave social  worker decided to deal with their case. Come in his office and assist  its confidential interviews with Aspegix and Grodebilix, Zizimir, Sandy,  Proumfs, Mr Patatos, Marius and Gigi, the Tortoises Tramps and all  Kassos which suffer in the biggest indifference.', null, 'In Production', 2, 247, '2013-05-12', null, null, null, '/uiE5SmhDcxE2XvhDxfDPmWAx53w.jpg', 0, '/fPIN92qW2E38xXAmybM9Kw7MLg0.jpg');
