INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66043, 66043, 'Little Big Shots', 'A comedy-variety series showcasing young musicians, singers, dancers and  every form of wunderkind in the country. Harvey goes toe-to-toe with  them in conversations and interviews, with hilarious results.', null, 'Returning Series', 45, 6, '2016-03-08', null, null, null, '/b00TUhQRxLvZ4VJ4GrhU7Eor3XQ.jpg', 0, '/j0dfJzxOwCbIO0cCyFYRH0imlMN.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66046, 66046, 'Mystery Music Show: King of Mask Singer', 'Competitors are given elaborate masks to wear in order to conceal their identity, thus removing factors such as popularity, career and age that could lead to prejudiced voting. In the first round, a pair of competitors sing the same song, while in the second and third rounds they each sing a solo song. After the First Generation, the winner of the Third Round goes on to challenge the Mask King, and is either eliminated or replaces the previous Mask King through live voting. The identities of the singers are not revealed unless they have been eliminated.', null, 'Returning Series', 105, 97, '2015-04-05', null, null, null, '/vlnAfmirzYx1TSxXuaPhHjkPPmK.jpg', 0, '/xDXaptzkHFHGyQ2QGZ3aGnEE1dK.jpg');
