INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66079, 66079, 'Teddy Go!', 'Kazuko Yamase is a 23-year-old, broken-hearted freeter. One day, she sees a knitted teddy bear that really appeals to her. She decides to buy it. Later, the knitted teddy bear suddenly speaks! Within the teddy bear, Yasuo Amano''s spirit lives. He is the person who knitted the teddy bear and he was also detective. Kazuko then becomes involved in a case with Yasuo and helps to solve the case.', null, 'Ended', 19, 1, '2015-10-10', null, null, null, '/hrwKaDw4Wt3RZ5VH80fFtcKyIDR.jpg', 0, '/jmXSRVh5lQ4E0TLzZ712sR2Pk3Y.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66081, 66081, 'The Wonderful Wizard of Oz', 'A young girl named Dorothy has gone to live with her grandparents on their small farm. One day when Dorothy is left alone in the house a tornado appears. Dorothy fails to get to the basement in time, and the entire house is picked up and transported to a magical land, falling on and killing a wicked witch. There she is informed by a good witch that she must travel to the Capital of Emerald and meet a great magician who may be able to help her find a way home. Along the way she makes some incredible friends and sees many strange and fantastic things.', null, 'Ended', 25, 98, '1986-10-06', null, null, null, '/bv7CDzokhadNDHKBFTMXvc9LGPc.jpg', 0, '/8JWsNMszGwrrYXEivVGTwRwoSxA.jpg');
