INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66083, 66083, 'Castle Town Dandelion', 'The everyday lives of the nine super-powered siblings of the royal family are monitored by more than 200 surveillance cameras and broadcast nationwide. The people of the nation who are watching the broadcast will have the ability to elect the next monarch. Akane is the third-oldest sister who can manipulate gravity. She is shy and desperately does not want to be caught on camera.', null, 'Ended', 24, 160, '2015-07-03', null, null, null, '/wUoFeMjou0chtFLUw2MmvQuBd5K.jpg', 0, '/iiehFIscK3j42InTqU84VuMQmIE.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66101, 66101, 'Rewrite', 'Kazamatsuri, a modern, well-developed city renowned for its burgeoning greenery and rich Japanese culture, is home to Kotarou Tennouji, a high schooler least privy to the place''s shared values. Content to fill his pockets with frivolity, the proud and nosey boy whiles away his time pestering the self-proclaimed delinquent Haruhiko, and indulging in his amorous feelings toward the oddball Kotori. Equipped with the superhuman ability to permanently rewrite any part of his body to multiply his strength or speed, Kotarou is naturally drawn to the supernatural. One special meeting with the lone member and president of the Occult Research Club, the "Witch" Akane Senri, leads to Kotarou reviving the Occult Club by recruiting Kotori and three other members: the clumsy transfer student Chihaya, the strict class representative Lucia, and the unassuming Shizuru. As Kotarou unveils hidden secrets of each member of the Occult Club through their shared adventures, he will inevitably encounter a fate that only he might be able to rewrite.', null, 'Ended', 24, 343, '2016-07-02', null, null, null, '/xHdas3uJ1R0mHfhkbVqkiUVV6Sg.jpg', 0, '/uViBBBquKMNz0zVNto48kpaEYrB.jpg');
