INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66609, 66609, 'Rovers', 'Established in 1884, Redbridge Rovers F.C. are one of the oldest club''s in England - and one of the worst. A sitcom that introduces us to the characters who gather within the social club of a non-league football club.', null, 'Ended', 0, 214, '2016-05-24', null, null, null, '/iFeXpSfBKzOMlnfrixYWsqidWf7.jpg', 0, '/lRnmIe9FFHaKkf99FgFoPemN5YO.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66103, 66103, 'Ace Attorney', 'A rookie lawyer Ryuuichi Naruhodou stands up to save his defendants by proving their innocence from unusual cases! Is the defendant guilty or innocent...? Believing his client''s innocence Naruhodou stands in court and battles his rival judges. With the word of "OBJECTION!" and limited evidence, Naruhodou makes a comeback when all odds are against him and seems like there is nothing more he can do. Don''t miss out on the comical episodes between him and his mentor Chihiro Ayasato, assistant Mayoi Ayasato, rival prosecutor Reiji Mitsurugi, and numerous unique characters! The anime also depicts the childhood relationship between Naruhodou and his friends. With the skills inherited from his mentor Naruho reveals the truth!', null, 'Returning Series', 25, 569, '2016-04-02', null, null, null, '/lyP5wbcXEOWvLiaaxuPKBhi09IU.jpg', 0, '/plQXVdg0JUlYmttW35k4WaYsAhy.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66105, 66105, 'High School Fleet', 'Living by the sea, protecting the sea, and journeying across the sea... They''re the Blue Mermaids! Because of a shift in tectonic plates around 100 years ago, Japan lost much of its area to submergence. To preserve Japan''s territories, coastal cities sprung up, one after the other. Eventually, they became marine cities, and along with the expansion of sea-lanes to connect them, the need arose for a sizable staff to protect the seas. At the same time, maritime jobs were becoming more popular among women. Hence, the Blue Mermaids, tasked with keeping the seas safe, had become every female student''s dream job. This is when childhood friends Akeno Misaki and Moeka China enroll in a marine high school in Yokosuka, along with other girls who share their goal of becoming a Blue Mermaid.', null, 'Ended', 25, 173, '2016-04-10', null, null, null, '/x2RsWzulSvD7J244KvOqspO69gU.jpg', 0, '/1ESIC9HBP85dmtMeZDeCRvO2Jpv.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66106, 66106, 'Three Leaves, Three Colors', 'Futaba Odagiri is the new transfer student with a super energetic personality; Teru Hayama is the class president with a surprisingly mean personality contrary to her innocent looks; and Youko Nishikawa is from a formerly rich, now extremely poor family who still holds on to her princess attitude. These three unlikely students with clashing personalities become good friends and survive the day-to-day teenage life in a very funny story.', null, 'Ended', 25, 614, '2016-04-11', null, null, null, '/sTwzEO9as3r5rmOZp58YUExzZdj.jpg', 0, '/l9jpkHujAodTtgJ0UVb49jXsdhr.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66107, 66107, 'Space Patrol Luluco', 'The show takes place in Ogikubo, which is the name of the specially designated area in space in the Milky Way where Earthlings and aliens can live together. Luluco is a female middle school student who lives with her father, and no matter where she is, Luluco is a common, "super normal" girl. As she is living her normal life, one day the mysterious transfer student ΑΩ Nova abruptly appears before her. That meeting will change Luluco''s fate.', null, 'Ended', 7, 614, '2016-04-01', null, null, null, '/7nlEz64vnrgrdLlDvwyIadzgCJp.jpg', 0, '/6lgziQ8tVj38n13N2ZJFsMUwt1Z.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66111, 66111, 'Macross Delta', 'Macross Delta is set in the year 2067, 8 years after the events of  the latest Macross TV series, Macross Frontier. The story focuses on  Walküre, a team of talented idols and the Delta Squadron, a team of  experienced Valkyrie pilots as they battle against the Var Syndrome, a  mysterious phenomena that is consuming the galaxy and there is also the  mysterious Aerial Knights Valkyrie fighter team of the Kingdom of Wind.', null, 'Ended', 25, 614, '2016-04-03', null, null, null, '/3Dccf86YEpvNNHVJAmMNiSXI1gt.jpg', 0, '/7mN8V5YuMidPztL5ffN5V6toJDh.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66112, 66112, 'Shonen Maid', 'After the loss of his mother, Chihiro is left alone. With no known family left, he has to find a way to move on. Things aren’t looking good until a chance encounter with the young and handsome Madoka—who turns out to be his wealthy uncle! Madoka offers him his home and all Chihiro has to do is clean up after the messy, irresponsible man. The problem? This job requires a uniform—a maid outfit!', null, 'Ended', 24, 160, '2016-04-08', null, null, null, '/aq8sasxas00O4MOgvF99DTIFt6Y.jpg', 0, '/tHRpjcU7xwtmoG2lqOugPZt46PS.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66113, 66113, 'Unhappy Go Lucky!', 'The story centers around class 1-7 of Tennomifune Academy, where all the students with "bad karma" or misfortune seem to have been gathered. Hibari, a student in this class, meets the unlucky Hanako and the perennially unhealthy Botan on her first day of school, and together they try to find a way to turn their school life into a happy one.', null, 'Ended', 25, 173, '2016-04-07', null, null, null, '/hpsAXLYRIZtaZZiFGE9FoM9pBM9.jpg', 0, '/sZHNzz5KzIeg4dFj755StgcN27B.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66134, 66134, 'The Durrells', 'In 1935, financially strapped widow Louisa Durrell, whose life has fallen apart, decides to move from England, with her four children (three sons, one daughter), to the island of Corfu, Greece. Once there, the family moves into a dilapidated old house that has no electricity and that is crumbling apart. But life on Corfu is cheap, it''s an earthly paradise, and the Durrells proceed to forge their new existence, with all its challenges, adventures, and forming relationships.', null, 'Ended', 46, 9, '2016-04-03', null, null, null, '/sgZiuQ9PMeyHU7xMaIctwRu4SLa.jpg', 0, '/lkb3NBvByVWBvr63wE4weHVFz4i.jpg');
