INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66147, 66147, 'Section Zéro', 'Set in the near future, multi-national corporations are Europe’s new leaders. One of the most powerful, Promethee, wishes to further secure their growing dominance by replacing the police force with their own private militias, the Black Squad, led by Henry Munro. Following the shooting of his daughter, his life in shambles and darkest secrets exposed, an idealistic law enforcement officer, Sirius, with nowhere to turn, aligns himself with an old cop Franck Varnove. Sirius takes charge of Franck’s clandestine, elite squadron, Section Zéro, to battle these dark, violent militias, promising a return to traditional law enforcement before the world they’ve known disappears forever.', null, 'Returning Series', 52, 285, '2016-04-04', null, null, null, '/u0n9ZEBtGPgMZ7ilG9DSxVeEqZU.jpg', 0, '/4iPPvWXPmR63VYnJiqb75GohKcy.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66148, 66148, 'How The Earth Works', 'Biologist Liz Bonnin and geologist Martin Pepper set out on a global expedition to answer the most thought-provoking questions in earth science today. Throughout history, such geologic events as volcanic eruptions, tsunamis, tectonic plate motion, earthquakes, and asteroid impacts have continually reshaped Earth''s surface, spreading chaos across the planet. By performing experiments, making observations in the field, and consulting expert scientists, the eight-part series works to uncover Earth''s immeasurable capacity to create and destroy.', null, 'Returning Series', 45, 226, '2013-10-09', null, null, null, '/8373HDsMLXQ9b4BYDdWDBKgU8j.jpg', 0, '/pjrP01dPJpoN6YnArOkKklUHNbk.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66336, 66336, 'Die Kanzlei', '', null, 'Returning Series', 45, 308, '2015-09-08', null, null, null, '/taHRPK4MiT38qgVKSb6SY3vyaIv.jpg', 0, '/6PgtzWu6QQ0RJiJiulDwnpbBcPU.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66176, 66176, 'Steal Heart', 'Kang Yoo-na is the daughter of a pickpocket who learned the trade from her father and is already famous in her own right (with a prolific rap sheet of her very own, and three prior convictions). After being released from prison, she works as a part-time barista at a friend''s café, but sometimes goes back to her old habits. Yoo-na shares a multiplex house with a rag-tag group of personalities, including an ex-gangster, a call girl, and a day laborer. They may not have much to boast about, but they are bright and warm people who live their daily lives to the fullest. Things take an interesting turn when they get a new neighbor — unemployed but seemingly pure-hearted Kim Chang-man moves in. Chang-man is an aspiring social worker, and as Yoo-na gets to know the salt-of-the-earth good boy next door, he starts to change them all for the better. Residing together under the same roof, they come to understand each other and mend their past wounds.', null, 'Ended', 70, 885, '2014-05-19', null, null, null, '/vO73WfJF13h6JyLapaLx72xecvj.jpg', 0, '/tNKKidF3mFZ3HkC8u29inN5ydHf.jpg');
