INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66198, 66198, 'Bible Mysteries', 'A series of programmes exploring great figures and events from biblical times. Historical, archaeological and anthropological evidence gives fresh insights into the historical realities of the times. Stylish drama re-enactments, CGI graphics, and expert opinions offer a comprehensive exploration into some of the Bible''s most compelling people and stories. Was Mary Magdalene really a prostitute? Where was St Peter laid to rest? Did Joseph actually have a ''coat of many colours''? Did Herod really order the massacre of the innocents? This series answers these questions and more.', null, 'Ended', 50, 332, '2003-04-01', null, null, null, '/vEcruJMuHFGcJWjwCn3wGhjUIGN.jpg', 0, '/iZigVuACcwqQNvKaobAwDmFh6jb.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66200, 66200, 'Artists in Love', '', null, 'Returning Series', 50, 553, '2016-03-08', null, null, null, '/sYsfJTu0VREAxqkEHWbBSoMrhsr.jpg', 0, '/At7n8aufMj2quQXCtqgxOkxDgXC.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66201, 66201, 'Shadow of Truth', 'In 2006, the body of the girl Tair Rada was found in the bathroom stall at the school where she studied. Days later, the police arrested a suspect - Roman Zadorov, and after a week of intense interrogation he admits and restores the murder. However, even after he was convicted three times, many still believe in his innocence. The series explores the length and breadth provision and leaving no stone unturned in an attempt to complete the picture of the puzzle, exposing new and dramatic discoveries. Through a complex mosaic of interviews, photographs and cinematic touch with the extensive use of inquiry and archives, the show tries to fathom the overwhelming truth.', null, 'Ended', 37, 1766, '2016-03-27', null, null, null, '/jrL303uClfqAWxVSFDtHR2kLVsO.jpg', 0, '/ronNqkTNS6A9YkvQqSy7KyK4B7f.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66202, 66202, 'Almost There', 'Jackson Cooper is a handsome, eternally single psychiatrist living in New York City. Serial dating and workaholic behavior have successfully helped him avoid long-term commitments, until he meets the girl of his dreams. Unfortunately he fails to get her name, number or any other information...', null, 'Returning Series', 30, 251, '2016-03-22', null, null, null, '/boyDEvDXMaSCfp3IXUDGQZm71wT.jpg', 0, '/9vVaLayQPT8ksdkAf2qeuX8zv6z.jpg');
