INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (66584, 66584, '99.9 Criminal Lawyer', 'Hiroto Miyama is an unconventional young lawyer who dances to his own tune and gets a little obsessive. For one thing, he’s only interested in criminal cases, and he will never give up in his pursuit of the truth even if offers only a 0.1% chance of being discovered. Japan’s 99.9% criminal case conviction rate leads the world, attesting to a “highly reliable” judicial system. In other words, once a crime suspect is indicted, prosecutor arguments tend to be accepted hook, line and sinker. In the face of those 99.9% odds, there’s no money in being a defense lawyer specializing in criminal cases, but for Miyama, that’s where the interest and kernels of truth lie. From unexpected places, the mold-breaking Miyama stakes his reputation on a prayer of a chance as he clashes with hotshot lawyers who’ll go to any lengths to win in this gloriously fun, legal mystery.', null, 'Ended', 46, 160, '2016-04-17', null, null, null, '/kdovnbDk7LrW2tN0ur1Rsde89t3.jpg', 0, '/CHzNg3kr0KUcNvtxTa8JAEiCZL.jpg');
